INSERT INTO `species` (`id`, `thumbnail`, `name`, `slug`, `taxonomy`, `scientific_name`, `common_name`, `local_name`, `kingdom`, `created_at`, `created_by`, `updated_at`, `updated_by`, `status`, `archived`, `phylum`, `class`, `order`, `family`, `genus`, `species_name`, `conservation_status`, `description`, `habitat_type`, `water_quality`, `native_range`, `economic`, `ecological_role`, `nutrient_cycling`, `CategoryID`, `image_path`, `habitat`, `feeding`, `social`, `reference`, `coordinates`, `breeding`, `cultural`, `native_impact`, `food_web`, `monitoring`, `protection`, `sustainability`, `latitude`, `longitude`, `deleted_at`) VALUES
	(30, 'species/30/1 Lonchora mallaca 3.png', 'Chestnut Munia', NULL, '.', 'Lonchura malacca', 'Chestnut Munia', 'Maya', 'Animalia', '2025-06-18 02:07:26', 2, '2025-06-18 02:07:26', 2, 'active', 0, 'Chordata', 'Aves', 'Passeriformes', 'Estrildidae', 'Lonchura', 'malacca', 'Least Concern (LC)', 'The Chestnut Munia, commonly known as Maya in the Philippines, is a small, brownish songbird with a distinctive appearance. The adult male typically has a rich chestnut-brown plumage on its body, with a black head and a contrasting white rump. Females have a more subdued coloration with browner tones, but they lack the distinct black head seen in males. Both sexes share a short, conical bill that is ideal for feeding on seeds. These birds are small, measuring about 10â€“12 cm in length. The Chestnut Munia is known for its social behavior and is often found in flocks.', 'This species is commonly seen in open grasslands, agricultural fields, and near marshes where grasses and seeds are abundant. It prefers areas with sparse trees or scattered vegetation, often seen in rice fields, meadows, and the borders of freshwater bodies.', 'The Chestnut Munia prefers areas with abundant seed sources in lowland areas. While it does not depend directly on freshwater for feeding, it may frequent wetlands or water-adjacent environments during the breeding season.', 'This bird species is native to Southeast Asia and has a significant presence in the Philippines, including around the Lake Mainit area. It can be found in a variety of habitats from grasslands to open woodlands, primarily in lowland areas.', 'Although the Chestnut Munia itself does not have a direct economic role, it is part of the biodiversity that sustains the ecosystem around Lake Mainit. As a seed-eating bird, it plays an indirect role in local agriculture by helping control the growth of certain grasses and weeds.', 'The Chestnut Munia is an important part of the local ecosystem. By feeding on seeds and other plant material, it helps maintain a balance in the growth of certain plant species in the area. The species also serves as prey for larger predators in the food chain.', 'As a seed eater, the Chestnut Munia plays a role in the dispersal of seeds. While feeding on grasses and weeds, the birds help spread plant seeds over a broader area, contributing to plant regeneration and nutrient cycling in their environment.', 1, '1746264810_3f21268a99721c8c985e.jpg', 'The Chestnut Munia is found in various parts of Lake Mainit, particularly in grasslands, agricultural areas, and wetlands around the lake. It is a bird adapted to living in the lowland areas of Mindanao, including near Lake Mainitâ€™s marshy and open fields.', 'The Chestnut Munia primarily feeds on grass seeds, grains, and small plant matter. It can often be seen foraging in groups in open fields, picking seeds from grasses and weeds. The species may also occasionally feed on small insects.', 'These birds are highly social and are often seen in small to large flocks outside of the breeding season. They are known for their cooperative behavior and can be found in groups feeding together or nesting in proximity. The species exhibits a strong flocking instinct, which offers protection from predators.', 'â€¢	BirdLife International (2021). "Lonchura malacca." The IUCN Red List of Threatened Species.\r\nâ€¢	Ramos, E. M. (2019). "Biodiversity and Conservation of Birds in Mindanao: Focusing on Lake Mainit." Philippine Journal of Ornithology.\r\nâ€¢	International Union for Conservation of Nature (IUCN), (2021). "The conservation status of Philippine bird species." Global Environmental Review.\r\nâ€¢	Photo Credits to iNaturalist', '[{"lat":9.583621,"lng":125.475363},{"lat":9.34284,"lng":125.515161}]', 'The Chestnut Munia typically breeds during the wet season. The nest is usually built in tall grass or dense vegetation, and the female lays a clutch of 4 to 6 eggs. Both parents participate in incubation and feeding the chicks. The species is monogamous during the breeding season, with pairs forming and staying together for the duration of reproduction.', 'The Maya is a well-known bird species in the Philippines, often associated with Filipino culture. It is frequently kept as a pet, with its melodious song and attractive plumage. In rural areas, it may be considered a symbol of good luck and is culturally significant in various traditions.', 'The Chestnut Munia has a minimal impact on other species due to its diet of seeds and small plants. Its role in seed dispersal may even benefit certain native plant species around Lake Mainit, supporting biodiversity.', 'The Maya serves as prey for a variety of predators, including larger birds of prey, reptiles, and mammals. Its role in the food web helps sustain higher trophic levels and maintains the overall ecological balance in the area.', 'The Chestnut Munia is not currently considered to be under significant threat. However, monitoring its populations is important, especially in areas where habitat loss due to agricultural expansion could affect local numbers. Conservation efforts focused on preserving grassland and wetland habitats would benefit the species.', 'Protecting the open grasslands, wetlands, and agricultural fields around Lake Mainit is vital for the continued existence of the Chestnut Munia. Preservation of natural habitats that provide food and nesting sites will ensure a stable population.', 'While the Chestnut Munia does not directly impact agriculture, promoting sustainable land-use practices can help preserve its habitat. Practices such as reducing the use of pesticides and preventing habitat degradation can support this species and other wildlife in the area.', 9.5633080, 125.6358720, NULL),
	(31, 'species/31/1 Anguilla marmorata 1.png', 'Marbled Eel', NULL, '.', 'Anguilla marmorata', 'Marbled Eel', 'Kasili', 'Animalia', '2025-06-18 02:04:49', 2, '2025-06-18 02:04:49', 2, 'active', 0, 'Chordata', 'Actinopterygii', 'Anguilliformes', 'Anguillidae', 'Anguilla', 'marmorata', 'Least Concern (LC)', 'The Anguilla marmorata, commonly known as the Marbled Eel or Kasili in the Philippines, is a large, snake-like fish with a distinctive marbled pattern on its body. The eelâ€™s body is elongated and cylindrical, with smooth, slimy skin that helps it maneuver through water and mud. The marbling consists of dark, irregular patterns on a pale background, giving the eel a camouflage-like appearance that helps it blend into its environment. Adult Marbled Eels can reach lengths of up to 1.5 meters. Its sharp, small teeth and elongated snout make it efficient at catching and consuming prey.', 'The species is found in freshwater lakes and rivers, such as Lake Mainit, where water quality is stable, and water flows are slow. It prefers habitats that allow it to burrow into the substrate for shelter and hunting.', 'It prefers waters with moderate to low salinity and relatively high organic content, where food sources like small fish, invertebrates, and organic detritus are abundant. The water should be clean, with low pollution levels, and the eels tend to avoid fast-moving streams.', 'Anguilla marmorata is found across Southeast Asia, including the Philippines, Indonesia, and surrounding islands. It is common in rivers, lakes, and coastal waters, including Lake Mainit, where it plays an essential role in the aquatic food web.', 'The Kasili is an important species in local fisheries around Lake Mainit. It is caught for its meat, which is highly valued in Filipino cuisine, particularly in traditional dishes. The eel is often sold in local markets, contributing to the local economy.', 'The Marbled Eel plays a critical role in the local ecosystem by regulating populations of smaller fish and invertebrates. It contributes to the biodiversity of Lake Mainit by controlling the balance of prey species and maintaining ecosystem stability.', 'As a carnivorous species, the Marbled Eel contributes to nutrient cycling in the aquatic ecosystem by consuming a wide variety of organisms. Its feeding habits help break down organic matter and keep smaller fish populations in check, which helps regulate the overall food web.', 2, '1746274721_296b1725b0bbe0506440.png', 'The Anguilla marmorata is found in freshwater, brackish, and estuarine environments, including areas surrounding Lake Mainit. It thrives in slow-moving waters like rivers and estuaries, where it can burrow into the mud or hide in rocky crevices.', 'The Marbled Eel is a carnivorous species, primarily feeding on smaller fish, crustaceans, and aquatic invertebrates. It hunts nocturnally, using its sharp teeth to capture prey. It is also an opportunistic scavenger, feeding on dead organic material and detritus that sinks to the lakebed.', 'This species is generally solitary, with individuals occupying small home ranges. They do not school or form groups, except during the breeding season when they migrate to the ocean. During their life in freshwater, they are often seen alone, lurking near submerged objects, rocks, or in the mud.', 'â€¢	Froese, R., & Pauly, D. (2019). Anguilla marmorata. FishBase.\r\nâ€¢	International Union for Conservation of Nature (IUCN). (2021). The Conservation Status of Freshwater Fish Species.\r\nâ€¢	Tan, S. H. (2018). Ecology of Eels in Southeast Asia: The Case of Anguilla marmorata in the Philippines. Philippine Fisheries Journal.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.53751,"lng":125.515632},{"lat":9.453532,"lng":125.56504},{"lat":9.341079,"lng":125.521808}]', 'Anguilla marmorata is a catadromous species, meaning it breeds in saltwater and spends most of its life in freshwater. The eels migrate from freshwater lakes like Lake Mainit to coastal waters, where they spawn. After spawning, the larvae drift back to freshwater environments where they mature.', 'In Filipino culture, Kasili (Marbled Eel) holds significance, particularly in regions near lakes and rivers, where it is commonly consumed. Eels are often associated with various cultural traditions, including local myths, legends, and culinary practices. The eel is seen as a source of resilience due to its ability to live in both freshwater and marine environments.', 'The Marbled Eel has a minimal direct impact on native species but plays an important role in maintaining the food web. It helps control the populations of invertebrates and smaller fish, which prevents the overpopulation of certain species and supports biodiversity.', 'As a predator, Anguilla marmorata serves as food for larger aquatic predators, including birds, larger fish, and some mammals. It occupies a vital position in the food chain, balancing the populations of its prey and contributing to the health of the ecosystem.', 'While the Marbled Eel is not currently considered a threatened species, its population should be regularly monitored to prevent overfishing, habitat loss, and water pollution, which can negatively impact its habitat and migratory patterns.', 'Protection of freshwater and estuarine habitats, such as those found around Lake Mainit, is essential for the survival of the Marbled Eel. Efforts to preserve water quality, reduce pollution, and protect spawning areas are crucial for the long-term health of eel populations.', 'Promoting sustainable fishing practices, such as limiting the capture of juvenile eels and regulating harvest times to prevent overfishing, can ensure that eel populations remain healthy. Protecting key habitats, such as wetlands and riverbanks, will also be critical in conserving the species.', 9.4991810, 125.5613710, NULL),
	(32, 'species/32/2 Ardeola speciosa 1.png', 'Javan Pond Heron', NULL, '.', 'Ardeola speciosa', 'Javan Pond Heron', 'Wakwak', 'Animalia', '2025-06-21 05:14:09', 2, '2025-06-21 05:14:09', 2, 'active', 0, 'Chordata', 'Aves', 'Pelecaniformes', 'Ardeidae', 'Ardeola', 'speciosa', 'IUCN Red List: Least Concern (LC)', 'The Javan Pond Heron, also known as Wakwak in the Philippines, is a medium-sized heron that exhibits remarkable changes in its plumage between the breeding and non-breeding seasons. During the breeding season, the adult males develop bright chestnut-brown plumage on their back and head, contrasting with their white belly. Females and non-breeding males have a more subdued color palette, primarily white or pale cream, with a slight reddish hue on the back and neck. They possess long, slender legs and a sharp, yellow bill, typical of herons. The Javan Pond Heron stands at approximately 45 cm in height and has a wingspan of around 80 cm.', 'This species prefers shallow, coastal wetlands, rice paddies, and other areas with standing or slow-moving water, where it can forage. It is commonly found in areas with abundant aquatic vegetation, which provides shelter and breeding sites.', 'The Javan Pond Heron thrives in wetlands and water-rich environments like those around Lake Mainit. The clean, shallow waters of the lake and its marshy surroundings support the birdâ€™s feeding and nesting requirements, with a preference for slightly turbid waters.', 'Native to Southeast Asia, including parts of the Philippines, this species is widely distributed in tropical regions, where it can be found in wetlands, ponds, and rivers. It is a migratory species and is known to visit areas like Lake Mainit during certain seasons.', 'While not directly involved in the local fisheries, the Javan Pond Heron plays a crucial role in controlling populations of small fish and aquatic insects, contributing to the balance of the aquatic ecosystem around Lake Mainit.', 'The Javan Pond Heron contributes to controlling the populations of small aquatic organisms and insects. By regulating these populations, it helps maintain a balanced ecosystem, preventing overpopulation of certain species that could disrupt the wetland habitat.', 'As a predator, the Javan Pond Heron plays an essential role in regulating the populations of small aquatic animals. By preying on fish and insects, it helps maintain a balance in the food web, which aids in nutrient cycling and keeps the aquatic ecosystem healthy.', 1, '1746284612_06bb243fddecb8d5c114.jpg', 'The Javan Pond Heron is found in the wetlands and marshes surrounding Lake Mainit, specifically in the shallow, aquatic areas where it can easily hunt for small fish, insects, and other invertebrates.', 'The Javan Pond Heron primarily feeds on small fish, amphibians, insects, and other aquatic invertebrates. It is often seen standing still at the waterâ€™s edge or wading in shallow waters, using its sharp bill to catch prey. During the non-breeding season, it may forage alone or in small groups.', 'The Javan Pond Heron is a social species, typically seen in small to medium-sized groups. Outside of the breeding season, it is not uncommon to see these herons foraging together in suitable wetland habitats. They are often less solitary compared to other heron species and may exhibit cooperative behavior when feeding.', 'â€¢ BirdLife International (2021). "Ardeola speciosa." The IUCN Red List of Threatened Species.\r\n\r\nâ€¢ Tan, D. S. (2021). "Avian Diversity in the Philippines: Ecological Roles and Conservation Efforts." Journal of Philippine Ornithology.\r\nPhilippine Biodiversity Conservation Network (PBCN), (2020). "Wetlands and Migratory Birds in the Philippines." Global Wetland Studies.\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.582605,"lng":125.474333},{"lat":9.340537,"lng":125.521682}]', 'The Javan Pond Heron typically breeds in wetlands during the rainy season. They build their nests in tall grasses or reeds, where they lay up to 4 eggs. Both parents take turns incubating the eggs and feeding the chicks. The breeding plumage of the males is one of the most striking features, with their chestnut-colored feathers attracting females.', 'The Wakwak is not only culturally significant for its name but also represents a symbol of wetland ecosystems in the Philippines. It is often admired for its graceful flight and is part of local folk traditions related to bird watching and conservation.', 'The Javan Pond Heron does not have a significant negative impact on native species but can sometimes compete with other wading birds for resources. Its feeding behavior, however, benefits the overall biodiversity of the wetlands by controlling invertebrate populations.', 'The Javan Pond Heron is an important part of the food web in the wetlands around Lake Mainit. It serves as both a predator and prey, providing food for larger birds and other predators. Its presence in the ecosystem helps to maintain the ecological balance by regulating smaller aquatic species.', 'The Javan Pond Heron is not currently listed as threatened, but its population should be monitored to ensure that the wetland habitats around Lake Mainit remain intact. Changes in water quality or loss of habitat could impact the speciesâ€™ ability to thrive.', 'Protecting the wetlands and marshy areas surrounding Lake Mainit is crucial for the continued survival of the Javan Pond Heron. Conservation efforts should focus on preserving these habitats from urban development, pollution, and other human activities that may degrade water quality.', 'Sustainable agricultural practices, such as maintaining wetland areas, reducing the use of harmful pesticides, and preventing habitat destruction, can support the continued health of the Javan Pond Heron population. Community-based conservation initiatives can help protect both the bird and its habitat.', NULL, NULL, NULL),
	(33, 'species/33/3 Lonchura leucogastra 1.png', 'White-bellied Munia', NULL, '.', 'Lonchura leucogastra', 'White-bellied Munia', 'Mayang-bungol', 'Animalia', '2025-06-18 01:29:32', 2, '2025-06-18 01:29:32', 2, 'active', 0, 'Chordata', 'Aves', 'Passeriformes', 'Estrildidae', 'leucogastra', 'leucogastra', 'Least Concern (LC)', 'The White-bellied Munia, locally known as Mayang-bungol, is a small, attractive bird characterized by its striking coloration. It has a predominantly brownish body with a pale white belly. Its head and upper parts are a dark brown to black, while the lower abdomen and underparts are a lighter cream or white. It has a stout, conical bill that is well-suited for cracking seeds. This finch-like bird is compact in size, measuring approximately 10â€“12 cm in length. Its tail is short and slightly rounded, and it is known for its vibrant plumage that makes it quite easy to spot in its natural habitat.', 'The species thrives in grasslands, agricultural fields, and areas with dense vegetation. It is often found in habitats with grasslands, reed beds, and sometimes even in areas with scattered trees and shrubs. The bird prefers open spaces but requires nearby shelter for foraging and nesting', 'The species is typically found in regions near water bodies, such as around Lake Mainit, where the water is clean, and vegetation is abundant. It often forages on the ground for seeds and insects, so the quality of the surrounding environment is crucial for its survival.', 'The White-bellied Munia is native to the Philippines, especially in the lowland and lower montane areas of the archipelago. It is commonly found on the islands of Mindanao and Luzon, particularly in areas that provide grassy fields and open habitats.', 'The White-bellied Munia is often found in agricultural areas where it feeds on crop seeds, making it a potential pest in rice and other grain fields. However, its role in controlling pest insects also benefits farmers. The birdâ€™s foraging habits may contribute to maintaining the balance between pests and crops in the area around Lake Mainit.', 'The White-bellied Munia plays a vital role in maintaining seed and insect populations within its ecosystem. By feeding on seeds and small invertebrates, it helps regulate the growth of certain plants and reduces the population of insects that may otherwise damage crops. It also serves as prey for larger predators, contributing to the food web.', 'As a seed-eater, the White-bellied Munia aids in the dispersal of plant seeds across the landscape, promoting the growth of various vegetation species. This contributes to nutrient cycling in the ecosystem, ensuring that the plant community remains balanced.', 1, '1746284687_22d8f564fe162245fc26.jpg', 'The White-bellied Munia is commonly found in the grasslands and open areas around Lake Mainit, particularly in regions with abundant tall grasses and shrubs where it can easily find food and nesting sites.', 'The White-bellied Munia is primarily a seed-eating bird. It feeds on a variety of seeds, grasses, and occasionally small insects or other plant matter. It forages in small groups, hopping along the ground, often in open fields or among tall grasses, looking for food. Its diet is composed mostly of seeds from grass and other vegetation found in its habitat.', 'The White-bellied Munia is a social species, often found in small flocks. These birds are not territorial and can often be seen foraging together, especially during the non-breeding season. They are known for their cooperative behavior and form loose colonies when not in the breeding season.', 'â€¢ BirdLife International (2021). "Lonchura leucogastra." The IUCN Red List of Threatened Species.\r\nTan, D. S. (2021). "Avian Diversity in the Philippines: Ecological Roles and Conservation Efforts." Journal of Philippine Ornithology.\r\n\r\nâ€¢ Philippine Biodiversity Conservation Network (PBCN), (2020). "The Role of Grassland Species in the Philippinesâ€™ Ecosystem." Global Avian Studies.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.583621,"lng":125.471246},{"lat":9.343518,"lng":125.516537}]', 'During the breeding season, which typically coincides with the wet season, the White-bellied Munia builds its nest in dense grass or in shrubs near water sources. The nest is usually a small, cup-shaped structure made of grass stems and other plant materials. The female lays 4â€“6 eggs, which are incubated by both parents. The chicks are cared for by both the male and female until they fledge.', 'Known for its beautiful plumage, the White-bellied Munia is popular in aviculture in the Philippines. It is often kept as a pet or songbird and is admired for its lively nature. In some local cultures, it is regarded as a symbol of prosperity due to its association with fertile agricultural lands.', 'While the White-bellied Munia can compete with other seed-eating birds for resources, it generally coexists well with other species. Its feeding habits do not significantly impact the populations of native plant species, though its presence in agricultural areas may sometimes conflict with crop production.', 'The White-bellied Munia plays an important role in the food web as both a predator of plant seeds and prey for larger birds and small mammals. Its activities help maintain the overall biodiversity of the ecosystem by preventing the dominance of any particular plant species and by regulating insect populations.', 'The White-bellied Munia is not currently considered to be at risk, but its population should be monitored, especially as its habitat is often subject to agricultural expansion and habitat destruction. Protecting areas of natural vegetation around Lake Mainit is key to ensuring its continued survival.', 'Protecting grasslands and agricultural habitats around Lake Mainit is crucial to sustaining the White-bellied Munia\'s population. Habitat loss due to urban development or agricultural intensification could threaten the availability of food sources and nesting sites.', 'Implementing sustainable agricultural practices, such as reducing the use of pesticides and maintaining buffer zones of natural vegetation, can help protect the White-bellied Munia. Encouraging the preservation of natural habitats while supporting local agricultural activities will ensure that this species can thrive.', NULL, NULL, NULL),
	(34, 'species/34/4 Gallinula chloropus 1.png', 'Common Moorhen', NULL, '.', 'Gallinula chloropus', 'Common Moorhen', 'Ituman', 'Animalia', '2025-06-18 01:56:27', 2, '2025-06-18 01:56:27', 2, 'active', 0, 'Chordata', 'Aves', 'Gruiformes', 'Rallidae', 'Gallinula', 'chloropus', 'IUCN Red List: Least Concern (LC)', 'The Common Moorhen, locally known as Ituman, is a medium-sized water bird with a distinctive appearance. It has a predominantly dark plumage, with a rich dark brown or blackish-brown body. The bird features a prominent white line that runs down the sides of its body and extends along the tail, creating a contrasting pattern. The moorhen\'s face is red, with a yellow-tipped red bill and a red frontal shield. Its legs are long and greenish-yellow, which further contrasts with its dark body. It has webbed feet, making it an adept swimmer. The Common Moorhen measures about 30â€“40 cm in length, with a wingspan of approximately 50â€“55 cm. Its characteristic call is a high-pitched "chek-chek" sound.', 'The Common Moorhen inhabits wetlands with dense aquatic plants such as reeds, sedges, and water lilies. It prefers calm, shallow waters where it can easily forage for food. These areas provide ample vegetation for nesting and cover from predators.', 'The bird thrives in environments with clean and moderately shallow waters, such as those found in Lake Mainit. The quality of water is essential, as moorhens rely on aquatic plants and small invertebrates for food.', 'The Common Moorhen has a widespread distribution across Asia, Europe, and parts of Africa. In the Philippines, it is found in various freshwater habitats, including wetlands and lakeshores, such as those around Lake Mainit.', ': The Common Moorhen is not commercially significant, but it contributes to the ecosystem by maintaining a balance in aquatic vegetation growth. Its feeding on aquatic plants may help prevent overgrowth of certain species, ensuring the health of the wetland habitat.', 'The Common Moorhen plays a key role in its ecosystem as a seed and plant consumer. By feeding on aquatic plants, it helps control plant growth and maintains the balance of vegetation in wetlands. It also serves as prey for larger birds of prey and other predators.', 'As a herbivore and omnivore, the Common Moorhen contributes to nutrient cycling by consuming plants and small invertebrates. Its feeding habits help regulate the growth of aquatic plants, preventing the overaccumulation of organic material and promoting a balanced ecosystem.', 1, '1746285692_178117bd2e387e66018f.jpg', 'The Common Moorhen is found around the freshwater marshes and shallow edges of Lake Mainit, where there is dense aquatic vegetation for shelter and feeding. It is commonly found in wetlands, riverbanks, and lakeshores.', 'The Common Moorhen is an omnivorous bird, feeding on a wide variety of plant material and small invertebrates. Its diet includes aquatic plants, seeds, roots, and leaves, as well as small invertebrates such as insects, mollusks, and crustaceans. It often forages in shallow waters, either swimming or wading through vegetation to find food.', 'The Common Moorhen is often found alone or in small family groups. It is territorial during the breeding season, with males defending a specific area that includes a nesting site and feeding grounds. Outside of the breeding season, the bird may form loose groups, particularly in areas where food is abundant.', 'â€¢ BirdLife International (2021). "Gallinula chloropus." The IUCN Red List of Threatened Species.\r\nPhilippine Biodiversity Conservation Network (PBCN) (2021). "Avian Diversity in Philippine Wetlands." Journal of Philippine Ornithology.\r\n\r\nâ€¢ Tan, D. S. (2020). "Ecology and Conservation of Water Birds in the Philippines." Wetland Ecosystems Journal.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.584365,"lng":125.47502},{"lat":9.341214,"lng":125.516538}]', 'During the breeding season, which typically occurs from March to June, the Common Moorhen builds a nest in dense vegetation near the water\'s edge. The nest is usually made of reeds and grasses and is well-hidden among plants. The female lays 5â€“8 eggs, which are incubated by both parents. The chicks are precocial, meaning they can walk and swim shortly after hatching, and are fed by both parents until they are old enough to forage on their own.', 'In some parts of the Philippines, the Common Moorhen is regarded as part of the local birdlife, admired for its distinctive appearance and behavior. It may be seen in local wildlife tours or birdwatching activities in the area around Lake Mainit.', 'The Common Moorhen generally coexists well with other species in wetland habitats. It does not pose a significant threat to native species but may compete with other water birds for food resources, particularly in densely vegetated areas.', 'The Common Moorhen is a prey species for larger birds of prey and carnivorous mammals. It also helps maintain the food web by consuming plant material and small invertebrates, which may otherwise proliferate unchecked.', 'Although not currently threatened, the population of the Common Moorhen should be monitored to ensure that wetland habitats remain suitable for their survival. Habitat loss due to development, pollution, or changes in water quality could threaten their population.', 'Protecting wetland areas around Lake Mainit is crucial for the survival of the Common Moorhen. Efforts to maintain water quality and preserve natural aquatic vegetation are vital. Wetland areas that support abundant plant life and provide food for the moorhen should be safeguarded from degradation.', 'Implementing sustainable land-use practices, such as controlling pollution and preventing encroachment on wetland areas, will help maintain suitable habitats for the Common Moorhen. Community-based conservation efforts involving local stakeholders can also support the protection of these critical ecosystems.', NULL, NULL, NULL),
	(35, 'species/35/5 Hirundo tahitica 1.png', 'Pacific Swallow', NULL, '.', 'Hirundo tahitica', 'Pacific Swallow', 'Balinsasayao', 'Animalia', '2025-06-18 01:30:08', 2, '2025-06-18 01:30:08', 2, 'active', 0, 'Chordata', 'Aves', 'Passeriformes', 'Hirundinidae', 'Hirundo', 'tahitica', 'IUCN Red List: Least Concern (LC)', 'The Pacific Swallow (Hirundo tahitica), locally known as Balinsasayao, is a small passerine bird known for its graceful flight and distinctive appearance. It has a slender body, with a long, deeply forked tail. The upper parts are a glossy blue-black, while the underparts are white with a slight rufous tint on the throat and chest. The Pacific Swallow has a small, pointed bill and long, pointed wings. It measures about 17â€“19 cm in length and has a wingspan of around 30â€“32 cm. Its call is a soft twittering sound, and it is often seen flying in open areas, catching insects in mid-air.', 'This swallow species prefers open habitats such as agricultural fields, rural villages, and areas near water. It is often seen flying over the lake, foraging for insects. It also nests in sheltered places such as caves, under bridges, and in man-made structures like eaves and buildings.', 'The bird does not rely directly on water quality for feeding, but it does thrive in regions with abundant insect populations, which are often associated with the healthy ecosystems of lakes and wetlands like those found in Lake Mainit.', 'The Pacific Swallow is widely distributed across Southeast Asia, the Philippines, and many Pacific islands. In the Philippines, it is commonly found in coastal and inland regions, particularly in areas with abundant insects.', 'The Pacific Swallow plays a beneficial role in controlling insect populations, especially pests that affect agricultural crops. This can help reduce the need for chemical pesticides, promoting more sustainable farming practices.', 'The Pacific Swallow is important in its role as a natural pest control agent. By feeding on a wide variety of flying insects, it helps to reduce the numbers of pests that could otherwise damage crops and affect the local ecosystem.', 'While the Pacific Swallow primarily feeds on insects, it indirectly contributes to nutrient cycling by controlling the populations of pest insects that could otherwise disrupt the balance of the local ecosystem. This helps maintain the health of the surrounding flora and fauna.', 1, '1746286032_bfa7d61d7c34dad3dd30.jpg', 'The Pacific Swallow is commonly found around the open waters and rural landscapes of Lake Mainit. It thrives in areas where there is an abundance of insects, typically near bodies of water and in agricultural fields.', 'The Pacific Swallow is an aerial insectivore, meaning it feeds on flying insects such as mosquitoes, flies, and beetles. It captures insects while flying, often performing acrobatic maneuvers to snatch them mid-air. This feeding behavior helps control insect populations in the area.', 'Pacific Swallows are social birds, often seen in small flocks, particularly during migration or when feeding. They are known to congregate in large numbers at roosting sites, especially at the end of the breeding season.', 'â€¢ BirdLife International (2021). "Hirundo tahitica." The IUCN Red List of Threatened Species.\r\n\r\nâ€¢ Philippines Birdwatching Society (2021). "Migratory Bird Species in the Philippines." Philippine Avian Journal.\r\n\r\nâ€¢ Tan, D. S. (2020). "Ecology and Conservation of Swallow Species in Southeast Asia." Journal of Philippine Ornithology.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.584061,"lng":125.472876},{"lat":9.344466,"lng":125.515421}]', 'The Pacific Swallow typically nests in caves, under bridges, or in other sheltered areas near water. The female builds a cup-shaped nest using mud and grasses, which is then lined with soft materials like feathers. She usually lays 3â€“5 eggs, which are incubated by both parents. The chicks are altricial, meaning they are born blind and helpless but quickly develop the ability to fly and catch insects on their own.', 'In some areas of the Philippines, the Pacific Swallow is considered a symbol of good luck, especially for farmers, due to its role in controlling crop-eating insects. Its graceful', 'The Pacific Swallow does not have significant direct interactions with other bird species, but it may compete with other insectivorous birds for food sources. However, its ability to forage in flight and feed on a wide variety of insects means that it coexists with other species without significant competition.', 'As a primary insectivore, the Pacific Swallow plays a key role in controlling insect populations. In turn, it serves as prey for larger predators, such as birds of prey, during its migration or while roosting.', 'Although not currently threatened, monitoring the population of the Pacific Swallow is important, especially to track changes in insect populations, which directly affect its food supply. Conservation efforts should focus on preserving habitats that support healthy insect populations and providing nesting sites for the birds.', 'The Pacific Swallow relies on open habitats near water for feeding and nesting. Protecting areas such as agricultural fields, rural villages, and wetlands around Lake Mainit can help ensure that these habitats remain suitable for the species.', 'By promoting sustainable agricultural practices that reduce the use of chemical pesticides, local communities can help maintain a healthy environment for the Pacific Swallow and its prey. Conservation programs that protect natural wetlands and their insect populations will benefit the bird as well.', NULL, NULL, NULL),
	(36, 'species/36/6 Alcedo argentata 1.png', 'Silvery Kingfisher', NULL, '.', 'Alcedo argentata', 'Silvery Kingfisher', 'Kibid', 'Animalia', '2025-06-18 01:31:02', 2, '2025-06-18 01:31:02', 2, 'active', 0, 'Chordata', 'Aves', 'Coraciiformes', 'Alcedinidae', 'Alcedo', 'argentata', 'IUCN Red List: Least Concern (LC', 'The Silvery Kingfisher (Alcedo argentata), locally known as Kibid, is a small but striking bird characterized by its vivid blue and silvery plumage. This kingfisher species has a bright blue back and head, with a pale underbelly that contrasts beautifully against its vibrant upperparts. The most distinctive feature of the Silvery Kingfisher is its metallic blue feathers, which shimmer in the light. It has a sharp, pointed bill, ideal for catching small fish and aquatic invertebrates. Typically, it measures around 20 cm in length and weighs about 30 grams. Its call is a high-pitched, sharp whistle, which can often be heard near its feeding sites.', 'This species is typically found in forested or riparian habitats near freshwater bodies, including lakes, streams, and rivers. It requires dense vegetation along watercourses for perching and hunting. The bird often rests on branches or rocks near the water before diving for fish.', 'Silvery Kingfishers thrive in clean, clear waters, which are abundant in fish and other small aquatic prey. The water quality in Lake Mainit supports the species, providing a rich habitat for its hunting activities.', 'Alcedo argentata is native to the Philippines and is found in lowland and coastal areas throughout the archipelago. It is also present in parts of Southeast Asia, including Borneo and Malaysia, and it prefers freshwater habitats with plenty of prey species.', 'While not directly involved in local fisheries, the Silvery Kingfisher plays an important ecological role by controlling populations of small fish and aquatic invertebrates, which may otherwise become overabundant.', 'The Silvery Kingfisher is an important part of the food chain in the Lake Mainit ecosystem, as it helps control the populations of small fish and invertebrates. By doing so, it contributes to maintaining balance in the local aquatic environment.', 'As an insectivore and piscivore, the Silvery Kingfisher helps in controlling the populations of small fish and aquatic insects. This helps maintain the balance of aquatic life and contributes to nutrient cycling by preventing the overgrowth of smaller species that might otherwise disrupt the ecosystem.', 1, '1746286309_78b2c992c3f40e74cda1.jpg', 'The Silvery Kingfisher is commonly found around the edges of Lake Mainit, particularly near forested areas and shallow waters where fish and aquatic invertebrates are abundant. It prefers secluded spots along rivers, lakes, and streams.', 'The Silvery Kingfisher primarily feeds on small fish, aquatic invertebrates, and occasionally amphibians. It hunts by perching on a branch or rock and waiting for a suitable prey item to pass by. Once it spots a fish or insect, it dives swiftly into the water to capture its prey. The kingfisher\'s sharp bill allows it to catch fish with great accuracy and speed.', 'Silvery Kingfishers are generally solitary birds but may form pairs during the breeding season. They are territorial and defend their hunting grounds aggressively from other kingfishers and birds of similar size. Outside of the breeding season, they are typically found alone, hunting and resting in their chosen habitats.', 'â€¢ BirdLife International (2021). "Alcedo argentata." The IUCN Red List of Threatened Species.\r\n\r\nâ€¢ Philippine Bird Conservation Society (2021). "The Avifauna of Lake Mainit." Philippine Journal of Ornithology.\r\n\r\nâ€¢ Torres, M. R. (2020). "The Ecological Role of Kingfishers in Southeast Asian Freshwater Ecosystems." Asian Avian Ecology Review.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.584772,"lng":125.473922},{"lat":9.342976,"lng":125.515609}]', 'The breeding season for the Silvery Kingfisher typically occurs during the wet season, when food resources are abundant. The female lays 3â€“4 eggs in a burrow, often dug into a riverbank or along the shores of Lake Mainit. Both parents take turns incubating the eggs and feeding the chicks once they hatch.', 'The Silvery Kingfisher is often admired for its beauty and grace, and its presence around Lake Mainit is a symbol of a healthy, clean aquatic ecosystem. It is a popular bird for birdwatchers and nature enthusiasts visiting the area.', 'The Silvery Kingfisher is an important predator in the ecosystem of Lake Mainit, but its impact on native species is minimal due to its specialized diet of small fish and invertebrates. It coexists peacefully with other aquatic species and has a relatively low level of competition for food resources.', 'The Silvery Kingfisher occupies a key position in the food web, as both a predator of smaller fish and as prey for larger birds of prey. Its hunting activities help to regulate the populations of aquatic organisms, contributing to overall ecosystem health.', 'Although the Silvery Kingfisher is not currently threatened, continued monitoring is essential to assess the overall health of its population. Protecting the clean, clear waters of Lake Mainit and its surrounding habitats will help ensure that the species continues to thrive.', 'To ensure the survival of the Silvery Kingfisher, it is important to protect the riparian habitats around Lake Mainit, especially those that provide suitable nesting sites and foraging opportunities. Conservation efforts should focus on maintaining clean, well-vegetated shorelines and preventing pollution in the lake.', 'Sustainable land and water management practices are crucial in maintaining the habitats required by the Silvery Kingfisher. By reducing pollution, preventing habitat destruction, and protecting the fish populations that the kingfisher feeds on, local communities can contribute to the bird\'s long-term conservation.', NULL, NULL, NULL),
	(37, 'species/37/7 Gallirallus torquatus 1.png', 'Barred Rail', NULL, '.', 'Gallirallus torquatus', 'Barred Rail', 'Tikling', 'Animalia', '2025-06-18 01:31:26', 2, '2025-06-18 01:31:26', 2, 'active', 0, 'Chordata', 'Aves', 'Gruiformes', 'Rallidae', 'Gallirallus', 'torquatus', 'Least Concern (LC)', 'The Barred Rail (Gallirallus torquatus), also known locally as Tikling, is a medium-sized bird in the rail family, with distinct, dark, and light brownish bars running across its body. Its overall coloration is a mixture of dark brown, black, and rufous feathers, giving it a somewhat striped appearance. It has a slightly long neck and a short tail, typical of rail species. The bill is slender and moderately long, suitable for probing mud and aquatic vegetation. Adult birds measure about 25â€“30 cm in length. The Barred Rail\'s legs are adapted for walking and are relatively strong, aiding in its terrestrial lifestyle. It has a relatively shy and secretive behavior, often staying hidden in dense vegetation near water.', 'This species inhabits dense, marshy wetlands, often in areas with thick vegetation such as reeds, sedges, and grasses. It prefers shallow freshwater bodies, where it can forage for small invertebrates, seeds, and plant matter.', 'Barred Rails prefer clean, unpolluted freshwater with shallow depths, where their primary food sourcesâ€”such as insects, small fish, and plantsâ€”are abundant. Lake Mainit\'s relatively clean water quality supports the ecological needs of this species.', 'Gallirallus torquatus is native to the Philippines and is primarily found in the lowland wetlands and marshes of the archipelago. It is particularly abundant in freshwater wetlands, coastal mudflats, and marshy areas across various islands', 'While the Barred Rail itself is not directly involved in local fisheries, it plays an indirect role in maintaining the health of the wetland ecosystem. Its feeding habits help control populations of small invertebrates, which can affect the balance of the food web.', 'As an important component of the wetland food chain, the Barred Rail plays a vital role in controlling populations of invertebrates, contributing to the overall health of the aquatic ecosystem. By feeding on both plant matter and small animals, it helps maintain the balance of the wetland habitat.', 'The Barred Rail aids in nutrient cycling by consuming organic material, including detritus and small invertebrates. This feeding behavior helps break down decaying matter, preventing the buildup of excess organic material in the ecosystem and contributing to water quality.', 1, '1746286573_ac47afdce9537cdff0f1.jpg', 'The Barred Rail is found in marshy and wetland areas around Lake Mainit, particularly in places with dense reeds, aquatic plants, and shallow, muddy areas. It is more commonly observed in the more secluded parts of the lake, away from human settlements', 'The Barred Rail is an omnivorous bird, feeding on a wide variety of food sources found in wetland habitats. It feeds primarily on invertebrates such as insects, small crustaceans, and worms, as well as seeds, fruits, and aquatic plants. It uses its long, slender bill to probe through mud, searching for food hidden in the substrate.', 'Barred Rails are generally solitary or found in small family groups. They are elusive and tend to avoid open spaces, preferring to remain hidden in dense vegetation. They are territorial during the breeding season and will defend their nesting sites from other rails or competing species.', 'â€¢ BirdLife International (2021). "Gallirallus torquatus." The IUCN Red List of Threatened Species.\r\n\r\nâ€¢ Philippine Bird Conservation Society (2021). "The Avifauna of Lake Mainit." Philippine Journal of Ornithology.\r\n\r\nâ€¢ Torres, M. R. (2020). "Ecology and Conservation of Rails in Philippine Wetlands." Asian Wetland Conservation Review.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.583248,"lng":125.473564},{"lat":9.342298,"lng":125.515251}]', 'The Barred Rail typically breeds during the wet season, when food is abundant. It constructs a nest in dense vegetation near water, where the female lays around 4-6 eggs. The eggs are incubated by both parents. After hatching, the chicks are able to move around quickly and forage for food with their parents.', 'The Barred Rail is admired by local birdwatchers and nature enthusiasts. In some cultures, rails are considered a symbol of the untamed, wild aspects of wetland ecosystems, and their presence in Lake Mainit signifies the ecological richness of the area.', 'The Barred Rail has a relatively minimal impact on other species in its habitat due to its specialized diet and secretive nature. It is not considered an invasive species and coexists with other wetland birds and animals.', 'As both a predator and prey species, the Barred Rail plays a crucial role in the wetland food web. It serves as a predator of small invertebrates and as prey for larger birds of prey and mammals that forage in similar habitats.', 'The Barred Rail is not currently listed as a threatened species, but continuous monitoring of its population is essential. Ensuring the protection of wetland habitats, such as those around Lake Mainit, will be crucial for the species\' survival.', 'Protecting wetland areas, particularly those with dense vegetation and shallow water, is vital for the Barred Rail. Conservation efforts should focus on maintaining these habitats and preventing the encroachment of urbanization or pollution.', 'Sustainable land use practices, such as proper waste management and minimizing the degradation of wetland habitats, are essential in preserving the Barred Rail\'s habitat. Efforts to reduce water pollution and maintain healthy wetland ecosystems will benefit this species and other native wildlife.', NULL, NULL, NULL),
	(38, 'species/38/8 Amaurornis phoenicurus 1.png', 'White-breasted Waterhen', NULL, '.', 'Amaurornis phoenicurus', 'White-breasted Waterhen', 'Korwakwak', 'Animalia', '2025-06-18 01:31:43', 2, '2025-06-18 01:31:43', 2, 'active', 0, 'Chordata', 'Aves', 'Gruiformes', 'Rallidae', 'Amaurornis', 'phoenicurus', 'Least Concern (LC)', 'The White-breasted Waterhen (Amaurornis phoenicurus), locally known as Korwakwak, is a medium-sized rail species with distinctive features. The adult bird has a white breast and belly, contrasting with its dark brown upperparts. The face and head are a mix of dark gray with a red beak and a yellow patch around the eyes. It has long, slender legs, and its tail is short, typical of waterhen species. The bird has a slightly curved, red bill that is adapted for probing in mud or shallow water for food. Its vocalizations are a series of loud, harsh calls, often heard in the early morning or late evening. It typically measures around 30â€“35 cm in length.', 'This species prefers freshwater wetlands, rice paddies, marshes, and muddy banks, where dense vegetation and shallow water provide both food and shelter. In Lake Mainit, it is typically seen along the edges of marshes or in areas with tall grasses and reeds.', 'The White-breasted Waterhen thrives in shallow, clear waters with abundant aquatic vegetation. The lake\'s clean water quality supports a rich variety of food sources, making it an ideal habitat for this species.', 'Amaurornis phoenicurus is native to the Indian Subcontinent and Southeast Asia. In the Philippines, it is found in freshwater wetlands, including areas around Lake Mainit.', 'While the White-breasted Waterhen is not directly involved in local fisheries, its presence in wetland ecosystems contributes to the health of the habitat, indirectly supporting the broader aquatic biodiversity, including fish populations.', 'The White-breasted Waterhen plays an important role in the food web of the wetlands by controlling populations of invertebrates and small aquatic organisms. It also helps to maintain the balance of vegetation by feeding on plant material.', 'By foraging on both plant material and small animals, the White-breasted Waterhen helps in the cycling of nutrients in the ecosystem. Its feeding habits contribute to the breakdown of organic material, preventing the buildup of excess vegetation and maintaining water quality.', 1, '1746286875_83852c7ad54018e8ce4b.jpg', 'The White-breasted Waterhen is commonly found in the wetlands, marshes, and mangrove areas around Lake Mainit. It prefers areas with dense vegetation, especially near water\'s edge, where it can easily forage for food.', 'The White-breasted Waterhen is an omnivorous feeder, foraging primarily on aquatic insects, small crustaceans, mollusks, seeds, and plant material found along the shorelines and in the mud. It uses its bill to probe through mud and water to locate food.', 'The White-breasted Waterhen is generally solitary or found in pairs, but it can occasionally form small family groups. It is a territorial species, especially during the breeding season, and will defend its nest and feeding areas from other rails and animals.', 'â€¢ BirdLife International (2021). "Amaurornis phoenicurus." The IUCN Red List of Threatened Species.\r\n\r\nâ€¢ Philippine Bird Conservation Society (2021). "The Avifauna of Lake Mainit." Philippine Journal of Ornithology.\r\n\r\nâ€¢ Torres, M. R. (2020). "Ecology and Conservation of Wetland Birds in Philippine Lakes." Asian Wetland Conservation Review.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.584433,"lng":125.474073},{"lat":9.340435,"lng":125.515074}]', 'The species typically breeds during the wet season when food is abundant. Nests are constructed on the ground, often near water in dense vegetation. The female lays 4â€“6 eggs, and both parents are involved in incubation and chick rearing. The chicks are precocial and can leave the nest shortly after hatching.', 'The White-breasted Waterhen is occasionally hunted for food in some local communities, though it is not a primary source of sustenance. It is more valued for its role in maintaining the health of wetland ecosystems and its unique appearance and calls.', 'The White-breasted Waterhen does not pose a significant threat to other native species in Lake Mainit. It coexists with other wetland birds and animals, and its feeding habits do not directly compete with other species.', 'As a prey species, the White-breasted Waterhen provides food for larger predators, such as birds of prey and carnivorous mammals. In turn, it helps regulate populations of invertebrates and small fish, contributing to the stability of the wetland ecosystem.', 'The White-breasted Waterhen is not considered a threatened species but continuous monitoring is important to track population trends. Habitat degradation, such as pollution or loss of wetland areas, could threaten the species\' population.', 'Protecting the wetlands and marshes around Lake Mainit is critical for the conservation of the White-breasted Waterhen. Efforts should be focused on preserving areas with dense aquatic vegetation and ensuring clean water quality.', 'Sustainable land-use practices and minimizing pollution in wetlands are essential for maintaining healthy ecosystems that support the White-breasted Waterhen and other wildlife. Wetland conservation efforts will help preserve this species\' habitat.', NULL, NULL, NULL),
	(39, 'species/39/9 Aythya fuligula 1.png', 'Tufted Duck', NULL, '.', 'Aythya fuligula', 'Tufted Duck', 'Gakit', 'Animalia', '2025-06-18 01:32:08', 2, '2025-06-18 01:32:08', 2, 'active', 0, 'Chordata', 'Aves', 'Anseriformes', 'Anatidae', 'Aythya', 'fuligula', 'Least Concern (LC)', 'The Tufted Duck (Aythya fuligula) is a medium-sized diving duck with a distinctive appearance. The male has a glossy black head with a characteristic tuft of feathers at the back of the head, and its body is mainly black with white flanks. Females are more subtly colored, with brown plumage and a pale cheek patch. The Tufted Duck has a stout, slightly flattened bill and bright yellow eyes. It measures around 38â€“41 cm in length, with a wingspan of 65 cm.', 'It prefers freshwater lakes with clear water and dense aquatic vegetation. In Lake Mainit, it typically inhabits deeper sections of the lake, where it can dive for food and find shelter in the waterâ€™s edge or in aquatic plant beds.', 'The Tufted Duck requires good water quality with high oxygen levels for diving and feeding. Lake Mainit, with its relatively clean and well-maintained water, provides an ideal environment for this species, especially in areas with aquatic vegetation that supports a variety of invertebrates and small fish.', 'The Tufted Duck is primarily native to Eurasia but is also found in parts of North Africa. It migrates to the Philippines and other tropical countries during the non-breeding season.', 'While not a significant economic species, the Tufted Duck contributes to the biodiversity and beauty of Lake Mainit. It supports local ecotourism, as birdwatchers and nature enthusiasts visit the lake to observe migratory waterfowl.', 'As a diving duck, the Tufted Duck plays an important role in controlling populations of aquatic invertebrates and small fish. It contributes to the balance of the lake\'s ecosystem by feeding on various invertebrates and helping maintain the health of the aquatic food web.', 'The Tufted Duck helps in nutrient cycling by feeding on various aquatic invertebrates and plants. Its feeding activity prevents overgrowth of certain aquatic species and aids in the breakdown of organic material, maintaining the balance of nutrients in the lake.', 1, '1746287217_1c7a81d66a5b86434555.jpg', 'The Tufted Duck is a migratory species that can be found in various parts of Europe, Asia, and parts of North Africa. In the Philippines, it is commonly observed as a winter visitor, migrating from colder regions. However, the Tufted Duckâ€™s presence in Lake Mainit is part of its tropical range during the non-breeding season.', 'The Tufted Duck is a diving species, feeding primarily on aquatic invertebrates, small fish, and submerged plants. It dives underwater to search for food and can stay submerged for extended periods. In Lake Mainit, it forages along the lakeâ€™s deeper areas, diving to the lakebed to find small invertebrates and plant matter.', 'Tufted Ducks are generally solitary or found in small groups outside of the breeding season. In Lake Mainit, they are often observed in small groups, occasionally mixing with other waterfowl species.', 'â€¢ BirdLife International (2021). "Aythya fuligula." The IUCN Red List of Threatened Species.\r\n\r\nâ€¢ Philippine Biodiversity Conservation Agency (2021). "Avifauna of Lake Mainit and Surrounding Wetlands." Philippine Journal of Wildlife Ecology.\r\n\r\nâ€¢ Gedeon, D. (2021). "Migratory Birds and Wetland Ecosystems in Southeast Asia." Asian Journal of Avian Studies, 14(3), 112-130.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.584602,"lng":125.472514},{"lat":9.342806,"lng":125.515403}]', 'The Tufted Duck breeds in freshwater lakes in its native Eurasian range. In the Philippines, it does not breed but migrates during the non-breeding period. The breeding season occurs in temperate regions during spring and summer, where the female builds a nest in dense vegetation close to water.', 'The Tufted Duck does not hold strong cultural significance in the Philippines but is part of the larger avian biodiversity in the region. It is appreciated for its role in the ecosystem and its contribution to the regionâ€™s natural heritage.', 'The Tufted Duck is not a direct threat to native species due to its specialized diet of aquatic invertebrates and plants. However, it competes with other waterfowl for food resources. It coexists with other species by utilizing different feeding niches.', 'The Tufted Duck serves as both a predator and prey. It feeds on smaller aquatic organisms and, in turn, is preyed upon by larger birds of prey. By controlling populations of invertebrates and small fish, it plays a critical role in the food web of the lake.', 'The Tufted Duck is classified as "Least Concern" by the IUCN, but its migratory population needs monitoring to track its presence and ensure the quality of habitats it depends on in Lake Mainit.', 'Protecting the aquatic environments around Lake Mainit, including preventing pollution and conserving aquatic vegetation, is crucial for the survival of Tufted Ducks and other migratory waterfowl.', 'To support sustainable bird populations, managing human activities around the lake, including fishing practices and land development, is key. Ensuring minimal disruption during migratory periods and promoting responsible ecotourism will help preserve habitats for this species.', NULL, NULL, NULL),
	(40, 'species/40/10 Megalurus timoriensis 1.png', 'Tawny Grassbird', NULL, '.', 'Megalurus timoriensis', 'Tawny Grassbird', 'Tisuk', 'Animalia', '2025-06-18 01:32:25', 2, '2025-06-18 01:32:25', 2, 'active', 0, 'Chordata', 'Aves', 'Passeriformes', 'Locustellidae', 'Megalurus', 'timoriensis', 'Least Concern (LC)', 'The Tawny Grassbird (Megalurus timoriensis) is a medium-sized passerine bird characterized by its long, pointed tail and streaked brown plumage. The upperparts are a warm, tawny brown, and the underparts are paler with darker streaks. Its bill is fairly short and slightly curved, suitable for feeding on insects and seeds. It has a distinctive song, often heard in the early morning and evening, which consists of a series of high-pitched notes and trills. The Tawny Grassbird measures about 22â€“24 cm in length, and it has a wingspan of approximately 30 cm.', 'This species prefers tall grasses and reed beds, which provide shelter and a variety of food sources. It is commonly found in the transition zones between aquatic and terrestrial habitats, where it can nest and forage among dense vegetation.', 'Tawny Grassbirds are adaptable and thrive in both wetland and grassland ecosystems. In Lake Mainit, they can be found in areas with good water quality, such as marshes and grassy areas close to the water\'s edge.', 'Megalurus timoriensis is native to Southeast Asia, including the Philippines, Indonesia, and Timor. It is found in areas with suitable grassland or reedbed habitats and is more commonly observed in the wetland and grassy areas surrounding Lake Mainit.', 'The Tawny Grassbird does not have significant direct economic value, but it plays an important role in controlling insect populations, particularly grasshoppers and crickets, which may otherwise damage crops and vegetation.', 'This bird plays a vital role in maintaining the health of the ecosystem by controlling the populations of insects that could otherwise overpopulate and damage the local vegetation. Additionally, it serves as prey for larger predators in the food chain.', 'By feeding on insects, the Tawny Grassbird helps control the insect populations, thus preventing them from overwhelming local plant life. In turn, this helps maintain the balance of the ecosystem by ensuring healthy vegetation and promoting nutrient cycling within the habitat.', 1, '1746287659_4a41ca64ebb519188353.jpg', 'The Tawny Grassbird is found in grasslands, wetlands, and agricultural areas, particularly in the Philippines. In the Lake Mainit region, it thrives in grasslands, wetland areas, and the edges of marshy zones around the lake.', 'The Tawny Grassbird is primarily insectivorous but also feeds on seeds and small fruits. It forages in dense grasses and reeds, where it uses its sharp bill to catch insects such as grasshoppers, crickets, and beetles. During certain seasons, it may also eat seeds from grass and other plants.', 'This species is often solitary or found in pairs during the breeding season. Outside of the breeding period, it may form small groups, particularly in areas with abundant food. It is a shy and secretive bird, typically staying hidden in dense vegetation and only emerging when disturbed.', 'â€¢	BirdLife International (2021). "Megalurus timoriensis." The IUCN Red List of Threatened Species.\r\n\r\nâ€¢	Jones, D. R. (2018). "Grassland and Wetland Birds of the Philippines." Philippine Journal of Avian Conservation, 5(1), 34-41.\r\n\r\nâ€¢	Philippine Biodiversity Conservation Agency (2020). "Avifauna of the Mindanao Region: Survey and Monitoring Efforts." Philippine Journal of Wildlife Ecology.\r\n\r\nâ€¢	Photo Credits from iNaturalis', '[{"lat":9.58423,"lng":125.472359},{"lat":9.344297,"lng":125.514905}]', 'The Tawny Grassbird nests on the ground or in low vegetation, often in tall grasses or reeds. The nest is built by the female and is typically a cup-shaped structure made of grass and reeds. The female lays 2â€“4 eggs, which are incubated for about 14â€“16 days. After hatching, the young are fed by both parents and fledge in approximately 2 weeks.', 'The Tawny Grassbird is often admired for its beautiful song and is sometimes considered a symbol of the natural beauty of the grassland and wetland ecosystems in the Philippines.', 'As an insectivore, the Tawny Grassbird primarily competes with other insect-eating species for food but does not pose a significant threat to other native species. It is an important part of the food web in its habitat.', 'The Tawny Grassbird occupies an important position in the food web as both a predator of insects and a prey species for larger birds of prey. Its feeding habits help regulate the insect population, which can influence the dynamics of the local ecosystem.', 'The Tawny Grassbird is not currently listed as threatened or endangered, but population monitoring is important, especially as wetland and grassland habitats face potential degradation from human activity, such as agricultural expansion and habitat destruction.', 'Protecting the wetlands and grasslands around Lake Mainit is essential for the conservation of the Tawny Grassbird. Preserving these habitats ensures that the species has access to food and suitable nesting sites. Conservation efforts should focus on preventing habitat loss due to encroaching agriculture and urbanization.', 'Implementing sustainable agricultural practices, such as limiting pesticide use and promoting organic farming, can benefit the Tawny Grassbird by preserving the insect populations on which it relies. Additionally, maintaining and restoring wetlands around Lake Mainit will help sustain the bird\'s habitat.', NULL, NULL, NULL),
	(41, 'species/41/2 Channa striata 1.png', 'Striped Snakehead', NULL, '.', 'Channa striata', 'Striped Snakehead', 'Haluan', 'Animalia', '2025-06-18 02:04:27', 2, '2025-06-18 02:04:27', 2, 'active', 0, 'Chordata', 'Actinopterygii', 'Perciformes', 'Channidae', 'Channa', 'striata', 'Least Concern (LC)', 'The Channa striata, commonly known as the Striped Snakehead or Haluan in the Philippines, is a predatory fish characterized by its elongated body, large head, and sharp, angular jaws. Its body is adorned with dark vertical stripes, which give the fish its "striped" name. The color of the fish can range from light brown to olive with darker vertical bands. The Striped Snakehead has a long, cylindrical body that can grow up to 90 cm in length. It possesses a robust and muscular frame, which makes it an efficient predator in its aquatic environment. Its head is large with sharp, pointed teeth, ideal for catching and holding onto its prey.', 'Feeds on fish, amphibians, and crustaceans. Breeds during the rainy season with both parents guarding offspring. Known for being territorial and solitary.', 'Channa striata prefers clean water with low to moderate turbidity. It thrives in environments with high oxygen levels, making Lake Mainit an ideal habitat due to its clean, freshwater environment. The species can tolerate a range of water temperatures but is more commonly found in tropical waters.', 'The Striped Snakehead is native to freshwater systems throughout Southeast Asia, including the Philippines, Thailand, and Malaysia. It has been introduced in various other regions, such as India and Bangladesh, due to its popularity in aquaculture and sport fishing.', 'The Striped Snakehead is economically significant in the Philippines, particularly around Lake Mainit, where it is highly valued for both commercial fishing and recreational fishing. Its meat is prized for its firm texture and delicious taste, making it a popular choice in local markets and restaurants.', 'The Striped Snakehead plays an important role in controlling populations of smaller fish and invertebrates in Lake Mainit. As an apex predator, it helps regulate the food web and maintain balance in the aquatic ecosystem by preventing overpopulation of certain species.', 'As an apex predator, the Striped Snakehead helps control the populations of smaller fish and invertebrates, which can lead to healthier aquatic ecosystems. By regulating prey species, it ensures a more balanced distribution of nutrients within the food web.', 2, '1746288765_0c127e3c50d9249f303b.png', 'The Striped Snakehead is widely distributed in Southeast Asia, including the Philippines. Around Lake Mainit, it can be found in both freshwater and brackish water habitats, including river systems, wetlands, and marshy areas. It thrives in lakes with abundant aquatic vegetation and slow-moving water.', 'The Striped Snakehead is a carnivorous predator that feeds on a variety of prey, including smaller fish, amphibians, crustaceans, and even insects. It is known for its ambush hunting technique, where it lies in wait among vegetation or at the bottom of the water, striking quickly when prey comes within range.', 'The Striped Snakehead is a solitary fish, and individuals typically do not form schools or groups. It is territorial and can be aggressive toward other fish, particularly during the breeding season when it is protecting its nest. Outside of breeding, it is often found alone or in small, loose aggregations when food is abundant.', 'â€¢ Froese, R., & Pauly, D. (2019). Channa striata. FishBase.\r\n\r\nâ€¢ IUCN (2021). The Conservation Status of Freshwater Fish Species.\r\n\r\nâ€¢ Ferraris, C. J., & Stiassny, M. L. J. (2009). The Snakeheads of Southeast Asia: Channa Species in the Philippines. Philippine Journal of Aquatic Ecology.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.537916,"lng":125.524427},{"lat":9.455632,"lng":125.570061},{"lat":9.343518,"lng":125.518938}]', 'Channa striata is known for its parental care behavior. During the breeding season, it constructs a nest in shallow water, often in areas with dense aquatic plants. The female lays eggs, which are fertilized by the male. After fertilization, both parents guard the eggs and fry until they are able to swim on their own. The species typically breeds during the rainy season when water levels rise and food is abundant.', 'In Filipino culture, the Haluan is considered an important fish, often featured in traditional dishes. The Striped Snakehead is also associated with various cultural practices and folk beliefs, with some local communities considering it a symbol of strength and resilience due to its predatory nature.', 'While the Striped Snakehead is an important predator, it can also pose a threat to native fish populations, particularly if its population grows unchecked. In some areas, the introduction of Channa striata has been linked to declines in certain native species, as it competes for resources and preys on smaller fish.', 'The Striped Snakehead occupies an important role in the food web of Lake Mainit. It serves as a predator of smaller fish and aquatic invertebrates, helping maintain the balance of species. It is also preyed upon by larger carnivorous fish and birds of prey, making it an essential link in the food chain.', 'While Channa striata is not currently listed as threatened, its introduction in non-native habitats has raised concerns about its impact on local biodiversity. Monitoring its population and the effects on native species is essential to ensure its presence does not disrupt the local ecosystem.', 'Protecting the freshwater ecosystems around Lake Mainit, including the habitats of the Striped Snakehead, is important for sustaining the species. Efforts to prevent pollution and maintain clean water quality will benefit both the Striped Snakehead and other aquatic species in the area.', 'Sustainable fishing practices, such as regulating harvests and ensuring the species does not overpopulate certain areas, are essential for managing the Striped Snakehead. Conservation measures should also focus on preventing the species\' invasive spread to new areas where it could threaten native biodiversity.', NULL, NULL, NULL),
	(42, 'species/42/3 Oreochromis niloticus 1.png', 'Nile Tilapia', NULL, '.', 'Oreochromis niloticus', 'Nile Tilapia', 'Tilapia', 'Animalia', '2025-06-18 02:05:03', 2, '2025-06-18 02:05:03', 2, 'active', 0, 'Chordata', 'Actinopterygii', 'Perciformes', 'Cichlidae', 'Oreochromis', 'niloticus', 'Least Concern (LC)', 'Nile Tilapia (Oreochromis niloticus), commonly known as Tilapia in the Philippines, is a widely distributed freshwater fish species known for its adaptability to various aquatic environments. It has an oval-shaped, laterally compressed body with a smooth, silvery-gray to grayish-green coloration. The species is easily recognized by its long dorsal fin and the presence of sharp spines along its body. Nile Tilapia can grow up to 60 cm in length and reach weights of 5 kg, although they are typically harvested at smaller sizes in aquaculture. Known for its hardy nature, Nile Tilapia is a key species in both commercial aquaculture and traditional fisheries.', 'Oreochromis niloticus is typically found in warm, shallow, and eutrophic waters, including river mouths, marshes, and the littoral zones of lakes. It prefers environments with abundant aquatic vegetation, which provide shelter, food, and breeding grounds.', 'This species thrives in warm, freshwater environments with temperatures between 22Â°C and 30Â°C. Nile Tilapia can tolerate low levels of oxygen and are adaptable to a range of water qualities, although they prefer relatively clean, well-oxygenated waters. They can also survive in slightly brackish conditions.', 'Oreochromis niloticus is native to the Nile River and surrounding parts of East Africa. It has been widely introduced worldwide, including to the Philippines, where it is now an essential species in local fisheries and aquaculture.', 'Nile Tilapia is one of the most economically important species for both commercial and subsistence fisheries in the Philippines. It is a major target of both small-scale artisanal fisheries and large-scale aquaculture operations, contributing significantly to local food security and economic livelihood.', 'Nile Tilapia plays a critical role in Lake Mainitâ€™s ecosystem by controlling the growth of aquatic plants and algae. As herbivores and detritivores, they help maintain water clarity by consuming large amounts of plant material. They also serve as a prey species for larger fish and birds, contributing to the food web of the lake.', 'Nile Tilapia contribute to nutrient cycling in Lake Mainit by feeding on plant matter, algae, and detritus. Their grazing helps maintain balance in aquatic vegetation and promotes water clarity. Their waste products also provide nutrients that support the growth of other aquatic organisms.', 2, '1746288860_c6da4205147099ac2342.png', 'Nile Tilapia is one of the most common fish species found in Lake Mainit. It thrives in both natural and farmed environments within the lake and its surrounding freshwater systems.', 'Nile Tilapia are primarily herbivorous, feeding on algae, aquatic plants, and detritus. They use their pharyngeal teeth to graze on plant material and filter small invertebrates from the water. As bottom-feeders, they help control algae growth and contribute to nutrient cycling in the ecosystem. Nile Tilapia are also known to consume small invertebrates and zooplankton when plant food is scarce.', 'Nile Tilapia are social fish that can be found in groups or schools, particularly in areas with abundant food. Although territorial during breeding, they are generally peaceful and can co-exist with other species, making them ideal for aquaculture and mixed-species ecosystems. Nile Tilapia are often found in colonies, particularly in shallow, vegetated areas of the lake.', 'â€¢ Froese, R., & Pauly, D. (2019). Oreochromis niloticus. FishBase.\r\n\r\nâ€¢ IUCN, (2021). The Conservation Status of Freshwater Fish Species.\r\n\r\nâ€¢ Tumbaga, R. C., & Sia, L. B. (2017). Aquaculture and Sustainable Fisheries: The Case of Tilapia in the Philippines. Philippine Aquaculture Journal.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.450146,"lng":125.562968},{"lat":9.542927,"lng":125.517677},{"lat":9.345144,"lng":125.516991}]', 'Oreochromis niloticus is a mouthbrooding species, meaning that the female carries fertilized eggs in her mouth until they hatch. This unique reproductive strategy provides protection for the young. Males establish territories and court females with displays and aggressive behavior. After fertilization, the female incubates the eggs in her buccal cavity for up to three weeks, after which the fry are released and swim freely. The species typically breeds during the rainy season when water temperatures and conditions are ideal.', 'Tilapia is a staple fish in Filipino cuisine and is highly valued for its mild flavor and firm, white flesh. It is commonly used in various traditional Filipino dishes such as sinigang na tilapia (sour soup with tilapia), inihaw na tilapia (grilled tilapia), and tilapia with guinataan (coconut milk-based dish). Nile Tilapia is also associated with aquaculture practices in rural communities, where it is often farmed for both personal consumption and sale in local markets.', 'While Nile Tilapia is a beneficial species for aquaculture, its introduction in non-native environments, such as Lake Mainit, can sometimes lead to ecological challenges. It may compete with native species for food and habitat. There is also the risk of genetic pollution in local fish populations if they interbreed with native tilapia species.', 'Nile Tilapia plays an important role in the food web as both a herbivore and a prey species. It is a primary food source for larger predatory fish, birds, and humans. Its ability to consume algae and plant material helps regulate the ecosystem\'s primary productivity, supporting a balanced aquatic environment.', 'While Oreochromis niloticus is not considered threatened, the speciesâ€™ introduction to new ecosystems warrants monitoring to avoid overpopulation and negative ecological impacts. In Lake Mainit, efforts should focus on assessing the speciesâ€™ interactions with native fish populations and ensuring that its presence does not lead to the decline of local biodiversity.', 'Protecting the water quality and aquatic habitats of Lake Mainit is essential for the long-term sustainability of Nile Tilapia populations. Preservation of water clarity, prevention of pollution, and management of aquatic vegetation are crucial to maintaining a healthy environment for Nile Tilapia and other species.', 'To prevent overfishing and ecological imbalance, it is important to implement sustainable fishing and aquaculture practices. These include setting harvest limits, promoting responsible aquaculture, and regulating the introduction of non-native species to prevent adverse impacts on local ecosystems.', NULL, NULL, NULL),
	(43, 'species/43/4 Oreochromis mossambicus 1.png', 'Mozambique Tilapia', NULL, '.', 'Oreochromis mossambicus', 'Mozambique Tilapia', 'Lipunan', 'Animalia', '2025-06-18 02:05:17', 2, '2025-06-18 02:05:17', 2, 'active', 0, 'Chordata', 'Actinopterygii', 'Perciformes', 'Cichlidae', 'Oreochromis', 'mossambicus', 'Least Concern (LC)', 'The Mozambique Tilapia (Oreochromis mossambicus), locally known as Lipunan in the Philippines, is a hardy species of tilapia that is well adapted to a wide range of aquatic environments, including freshwater lakes and rivers. It has an elongated, laterally compressed body, with a silver-gray to olive-green color that darkens during breeding or stress. Males are generally larger and more brightly colored than females. Mozambique Tilapia can grow up to 40 cm in length, although they are typically smaller in natural habitats. This species is known for its ability to tolerate varying water qualities, including low oxygen and higher salinity, making it a popular species for aquaculture in a variety of regions.', 'Mozambique Tilapia prefer warm, shallow waters with abundant aquatic plants and vegetation. They are commonly found in the littoral zones of the lake, especially near marshes and river mouths where food and shelter are abundant.', 'This species is highly adaptable to a wide range of water conditions. It can tolerate slightly brackish water and can survive in environments with low oxygen levels, making it well-suited to Lake Mainitâ€™s variable conditions. However, it prefers well-oxygenated, nutrient-rich waters with temperatures between 22Â°C and 30Â°C.', 'Oreochromis mossambicus is native to southern Africa, including the Limpopo and Zambezi River basins, and has been introduced to many parts of the world, including the Philippines. It is particularly favored for aquaculture due to its tolerance of a wide range of environmental conditions.', 'Oreochromis mossambicus is an important species for local fisheries around Lake Mainit. It is particularly valuable for small-scale and commercial aquaculture, providing a sustainable source of fish for local consumption. Due to its adaptability and hardiness, it is a key species for aquaculture operations in the region.', 'Mozambique Tilapia plays a vital role in the ecosystem of Lake Mainit by controlling the growth of aquatic vegetation and algae. Its feeding habits help maintain the balance of plant life and water quality in the lake, promoting a healthy aquatic environment. Additionally, it serves as an important prey species for larger predators, contributing to the food web.', 'Mozambique Tilapia contributes to nutrient cycling by consuming plant material, detritus, and algae, which helps regulate the nutrient levels in the water. Their waste products provide nutrients that support the growth of other aquatic organisms, enhancing biodiversity in the ecosystem.', 2, '1746290693_43cb08cdd05ea9200707.png', 'Oreochromis mossambicus can be found in several parts of Lake Mainit, particularly in areas with warm, shallow waters. It thrives in both natural freshwater environments and aquaculture systems around the lake.', 'Mozambique Tilapia are primarily herbivorous, feeding on algae, aquatic plants, and detritus. They can also consume small invertebrates and zooplankton when plant matter is scarce. This species plays a role in controlling algae growth, preventing excessive nutrient buildup in the water and maintaining water quality. They are opportunistic feeders and will adjust their diet based on available resources.', 'Mozambique Tilapia are social and typically live in schools, particularly in areas with abundant food. Males can be territorial during the breeding season, but outside of that period, they exhibit cooperative behaviors, often congregating around food sources. Their social behavior helps maintain stability in their populations and supports successful reproduction.', 'â€¢ Froese, R., & Pauly, D. (2019). Oreochromis mossambicus. FishBase.\r\n\r\nâ€¢ International Union for Conservation of Nature (IUCN), (2021). The Conservation Status of Freshwater Fish Species.\r\n\r\nâ€¢ Tumbaga, R. C., & Sia, L. B. (2017). Aquaculture and Sustainable Fisheries: The Case of Tilapia in the Philippines. Philippine Aquaculture Journal.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.542927,"lng":125.519036},{"lat":9.453532,"lng":125.578051},{"lat":9.345821,"lng":125.520409}]', 'Like other tilapia species, Oreochromis mossambicus exhibits mouthbrooding behavior. The female carries fertilized eggs in her mouth until they hatch, providing protection from predators. Males establish territories during the breeding season, using displays of aggression to attract females. The species breeds year-round in favorable conditions, with multiple broods produced annually. After hatching, the fry remain in the motherâ€™s mouth until they are large enough to swim independently.', 'In Filipino cuisine, Lipunan (Mozambique Tilapia) is a popular ingredient in traditional dishes such as sinigang na tilapia (sour soup) and inihaw na tilapia (grilled tilapia). Its widespread availability and versatility in cooking make it a cultural staple in many Filipino households, particularly in rural areas.', 'While Oreochromis mossambicus offers many ecological benefits, its introduction to non-native environments, like Lake Mainit, can lead to ecological challenges. The species may outcompete native fish species for food and breeding sites. Monitoring the population of Mozambique Tilapia is important to prevent overpopulation and ensure it does not negatively affect local biodiversity.', 'Mozambique Tilapia serves as an important link in the food web of Lake Mainit. As a primary herbivore, it helps maintain plant growth and nutrient balance. It is also an important prey species for larger predatory fish, birds, and other wildlife, contributing to the overall ecological health of the lake.', 'While Mozambique Tilapia is not considered to be under threat, its potential to become invasive in certain ecosystems necessitates monitoring. In Lake Mainit, conservation efforts should focus on managing tilapia populations to prevent them from negatively impacting native species and ecosystems.', 'Protecting the aquatic habitats of Lake Mainit is critical to ensure the continued health of tilapia populations and the preservation of biodiversity. Efforts should include protecting water quality, preventing pollution, and maintaining the integrity of aquatic ecosystems.', 'To prevent overexploitation and ecological imbalance, sustainable management practices should be implemented in both local fisheries and aquaculture. These practices include regulating tilapia harvesting, promoting responsible fish farming, and ensuring that the introduction of non-native species does not threaten the local ecosystem.', NULL, NULL, NULL),
	(44, 'species/44/5 Cyprinus carpio 1.png', 'Common Carp', NULL, '.', 'Cyprinus carpio', 'Common Carp', 'Carpa', 'Animalia', '2025-06-18 01:55:34', 2, '2025-06-18 01:55:34', 2, 'active', 0, 'Chordata', 'Actinopterygii', 'Cypriniformes', 'Cyprinidae', 'Cyprinus', 'carpio', 'Least Concern (LC)', 'The Common Carp (Cyprinus carpio), locally known as Carpa in the Philippines, is a large freshwater fish that is widely distributed and cultivated worldwide. It has a robust, elongated body covered with large, thick scales. The body coloration can vary but is typically olive-brown or golden-yellow, with lighter undersides. It features barbels on either side of its upper jaw, which it uses to forage along the bottom of freshwater bodies. Common Carps can grow to impressive sizes, reaching lengths of up to 1.2 meters and weights of over 20 kg, although they are typically harvested at smaller sizes in aquaculture. Known for their adaptability, Common Carps can thrive in a wide range of environments, making them a significant species in aquaculture and local fisheries.', 'The Common Carp prefers slow-moving waters, including lakes, rivers, and marshes with soft, muddy or sandy bottoms. It thrives in areas rich in organic matter and vegetation, which provide both shelter and food. In Lake Mainit, it is typically found in the deeper parts of the lake where the water is warmer and more nutrient-rich.', 'Common Carps are highly adaptable to a wide range of water conditions. They are tolerant of murky, turbid waters and can survive in environments with low oxygen levels. However, they are most commonly found in eutrophic waters with high nutrient levels, which promote the growth of aquatic plants and plankton, providing a rich food source for the fish.', 'Cyprinus carpio is native to Eastern Europe and Asia but has been widely introduced to various parts of the world, including the Philippines. It is particularly common in aquaculture, where it is farmed for food production due to its rapid growth and hardiness.', 'The Common Carp is of significant economic importance, particularly in aquaculture. It is widely farmed in the Philippines due to its adaptability and the high demand for carp in local markets. Cyprinus carpio is also caught in natural fisheries around Lake Mainit, contributing to the livelihoods of local communities who rely on freshwater fish for food and income.', 'The Common Carp plays a significant ecological role in Lake Mainit. As a bottom-feeder, it helps control the growth of aquatic vegetation by consuming plant material and detritus. However, its feeding behavior can lead to the resuspension of sediments in the water, which may increase turbidity and impact water quality. This could affect other aquatic organisms that rely on clear water.', 'By feeding on detritus, algae, and plant material, Common Carps contribute to nutrient cycling in the ecosystem. Their waste products add organic matter to the sediment, promoting the growth of microorganisms and supporting the food web.', 2, '1746290964_2ed7aaffcd21ccaa9887.png', 'Cyprinus carpio can be found in various parts of Lake Mainit, primarily in shallow, sheltered areas with ample food sources such as aquatic plants, algae, and invertebrates. It is particularly common in the deeper regions of the lake and in areas with slower-moving waters.', 'Common Carps are omnivorous bottom-feeders, feeding on a wide range of plant matter, detritus, small invertebrates, and occasionally, small fish. They use their barbels to search the substrate for food and are known to root in the mud, disturbing the lakebed in the process. Their feeding behavior can sometimes lead to water turbidity, as they stir up sediment and organic matter.', 'Common Carps are social and tend to gather in schools, particularly during feeding times. They are more likely to be seen in groups, although their behavior can be influenced by water temperature and food availability. During the breeding season, males often compete for access to females, exhibiting aggressive territorial behaviors.', 'â€¢ Froese, R., & Pauly, D. (2019). Cyprinus carpio. FishBase.\r\n\r\nâ€¢International Union for Conservation of Nature (IUCN), (2021). The Conservation Status of Freshwater Fish Species.\r\n\r\nâ€¢ Tumbaga, R. C., & Sia, L. B. (2017). Aquaculture and Sustainable Fisheries: The Case of Carp in the Philippines. Philippine Aquaculture Journal.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.537984,"lng":125.525466}]', 'Cyprinus carpio breeds during the warm months of the year, typically in the spring or early summer. Spawning takes place in shallow waters, where females lay large numbers of eggs in vegetation or on submerged surfaces. Males fertilize the eggs externally. The eggs hatch in about 2-3 days, and the fry are highly vulnerable to predation in their early stages. Common Carps have high reproductive potential, and their populations can grow rapidly under favorable conditions.', 'Carpa is an important species in Filipino cuisine, where it is often used in various traditional dishes such as sinigang na carpa (sour soup with carp) and inihaw na carpa (grilled carp). Due to its large size, the Common Carp is also an iconic species in fishing and recreational angling, and its presence in Lake Mainit adds cultural and recreational value to the region.', 'The introduction of Cyprinus carpio into ecosystems like Lake Mainit can have mixed ecological effects. While they help control aquatic plants, their feeding behavior can lead to significant disturbance in the substrate, which may affect other species, particularly those that rely on clear water. There is also a risk of competition with native fish species for food and habitat, especially in areas where food resources are limited.', 'The Common Carp is an important prey species for larger fish, birds, and other aquatic predators. By serving as prey, it supports higher trophic levels in the food web. Additionally, by feeding on algae and plants, it helps prevent excessive growth of these organisms, which could otherwise lead to eutrophication and oxygen depletion in the water.', 'The Common Carp is not considered a threatened species, but its ecological impact needs to be carefully managed. Monitoring carp populations in Lake Mainit is important to ensure that they do not become overly abundant and cause negative effects on the local ecosystem. Regular assessments of their interactions with native species should be conducted.', 'Protecting the aquatic habitats of Lake Mainit, especially its shallow, vegetated areas, is crucial for the continued health of Common Carp populations. Managing water quality and preventing pollution from agricultural runoff will benefit both the carp and other species in the lake.', 'To avoid overfishing and prevent ecological degradation, sustainable fishing practices should be encouraged. These include regulating carp harvests, promoting responsible aquaculture, and maintaining a balance between carp and native species in the ecosystem.', NULL, NULL, NULL),
	(45, 'species/45/6 Glossogobius giuris 1.png', 'White Goby', NULL, '.', 'Glossogobius giuris', 'White Goby', 'Pijanga', 'Animalia', '2025-06-18 02:21:06', 2, '2025-06-18 02:21:06', 2, 'active', 0, 'Chordata', 'Actinopterygii', 'Gobiiformes', 'Gobiidae', 'Glossogobius', 'giuris', 'Least Concern (LC)', 'The White Goby (Glossogobius giuris), locally known as Pijanga in the Philippines, is a small, bottom-dwelling fish commonly found in freshwater environments such as rivers, lakes, and brackish water areas. It has a cylindrical body with a slightly flattened head and large, forward-facing eyes. The coloration of the White Goby is typically silvery-white with darker markings along the body, especially on the dorsal side, and it may also have faint horizontal bands across the body. This species generally grows to a length of about 10-15 cm but can reach up to 20 cm in favorable conditions. It has a strong, slightly protruding lower jaw and small, sharp teeth suited for feeding on small invertebrates and detritus.', 'The White Goby prefers shallow, muddy or sandy-bottomed environments such as marshes, estuaries, and river mouths. In Lake Mainit, it is commonly found in areas where there is a mix of freshwater and slightly brackish water, as well as near vegetation-rich zones that offer shelter and food.', 'This species can tolerate a range of water conditions but prefers slightly brackish waters with moderate to low salinity. It is also tolerant of murky waters and can live in low-oxygen environments, making it well-suited to the conditions in Lake Mainit. The White Goby thrives in waters with a temperature range of 24Â°C to 30Â°C.', 'Glossogobius giuris is native to Southeast Asia, including the Philippines, and is found in freshwater and brackish waters across the region. It is widespread in coastal areas, rivers, and lakes.', 'The White Goby plays an important role in local subsistence fisheries around Lake Mainit, where it is commonly caught for food. It is a small but valuable source of protein for local communities, especially in rural areas where fishing is a primary livelihood. Its abundance in shallow waters makes it a readily available resource.', 'The White Goby plays a crucial role in maintaining water quality by feeding on organic detritus, algae, and small invertebrates. This feeding behavior helps in controlling the buildup of sediment and excess nutrients in the water, contributing to the overall health of the aquatic ecosystem in Lake Mainit.', 'As an omnivorous bottom-feeder, the White Goby contributes to nutrient cycling by consuming organic matter and detritus. This helps prevent the accumulation of excess nutrients, which could otherwise lead to algal blooms or oxygen depletion in the water.', 2, '1746291201_419a990bde5a6ee7633d.png', 'Glossogobius giuris can be found in various parts of Lake Mainit, primarily in the shallower areas of the lake and along river mouths where freshwater meets brackish conditions. This species thrives in calm, slow-moving waters with plenty of submerged vegetation and detritus.', 'The White Goby is omnivorous, feeding on a wide range of food items, including small invertebrates, crustaceans, worms, and detritus. It plays an important ecological role by helping to clean the water, feeding on organic matter that settles on the lakebed. It may also feed on algae and plant material, particularly in the juvenile stage.', 'The White Goby is typically a solitary or small group-dwelling fish, though it may form loose aggregations during breeding. Males defend their nests vigorously, often engaging in territorial disputes with other males. The species is generally non-aggressive, with interactions focused around breeding and feeding.', 'â€¢ Froese, R., & Pauly, D. (2019). Glossogobius giuris. FishBase.\r\n\r\nâ€¢ International Union for Conservation of Nature (IUCN), (2021). The Conservation Status of Freshwater Fish Species.\r\n\r\nâ€¢ Tumbaga, R. C., & Sia, L. B. (2017). Aquaculture and Sustainable Fisheries: The Case of Gobies in the Philippines. Philippine Aquaculture Journal.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.535614,"lng":125.522371},{"lat":9.4557,"lng":125.572119},{"lat":9.347854,"lng":125.519068}]', 'Glossogobius giuris breeds during the wet season, with males establishing territories in shallow, sheltered areas. The female lays a large number of eggs in a nest made of submerged plant matter or in crevices between rocks. After fertilization, the male guards the nest until the eggs hatch. The species exhibits external fertilization, and the juveniles are independent shortly after hatching.', 'In Filipino cuisine, Pijanga is a popular ingredient in various traditional dishes, such as sinigang na pijanga (sour soup with white goby) and adobong pijanga (goby cooked in soy sauce, vinegar, and spices). The fish is also used in the preparation of local delicacies and is a common feature in the diet of families living near Lake Mainit.', 'The White Goby has a minimal direct impact on native species, as its diet primarily consists of detritus, small invertebrates, and plant material. However, its presence in the ecosystem plays an important role in maintaining ecological balance by providing food for larger fish and birds.', 'The White Goby is an important prey species for various predatory fish, birds, and larger aquatic animals. Its position in the food web helps sustain higher trophic levels, contributing to the biodiversity and stability of the ecosystem.', 'The White Goby is not currently considered a threatened species, but its populations should be monitored, particularly in areas where human activities such as overfishing, habitat destruction, or pollution could negatively impact its habitat.', 'Protecting the shallow, vegetation-rich habitats of Lake Mainit is crucial for the continued survival of Glossogobius giuris. Conservation efforts should focus on maintaining water quality, preventing habitat destruction, and minimizing pollution from agricultural or industrial sources.', 'Sustainable fishing practices should be encouraged to prevent overfishing of the White Goby, especially in areas where it is a primary food source. Sustainable management of Lake Mainitâ€™s aquatic ecosystems will help ensure the long-term viability of this species and other freshwater organisms.', NULL, NULL, NULL),
	(46, 'species/46/7 Glossogobius celebius 1.png', 'Goby', NULL, '.', 'Glossogobius celebius', 'Goby', 'Pijanga', 'Animalia', '2025-06-18 01:57:00', 2, '2025-06-18 01:57:00', 2, 'active', 0, 'Chordata', 'Actinopterygii', 'Gobiiformes', 'Gobiidae', 'Glossogobius', 'celebius', 'Least Concern (LC)', 'Glossogobius celebius, commonly known as the Goby or Pijanga in the Philippines, is a small species of freshwater fish found in Southeast Asia. It has a relatively slender, cylindrical body with large, round eyes and a wide mouth. The body coloration is generally pale to light brown, often with dark spots or faint horizontal stripes along the length of the body. Its fins are well-developed, with the pelvic fins fused to form a disc-shaped sucker, which is characteristic of the Goby family. Typically growing to a length of 10â€“15 cm, Glossogobius celebius can sometimes reach 20 cm in length under ideal conditions. It is well adapted to life on the lakebed, often found near the bottom, where it feeds and shelters.', 'This species prefers shallow, muddy, or sandy-bottomed environments with slow-moving water. It is often found in brackish or freshwater areas with ample vegetation, as these provide both food and shelter. In Lake Mainit, it inhabits sheltered regions near the shoreline, where there is an abundance of invertebrates and detritus for feeding.', 'Glossogobius celebius is adaptable to a range of water qualities, but it thrives in clear, oxygen-rich waters that are moderately turbid. It can tolerate low levels of salinity, making it well-suited for areas of freshwater influence where the water is slightly brackish. It prefers temperatures between 24Â°C and 30Â°C.', 'Native to Southeast Asia, Glossogobius celebius is found in rivers, lakes, and estuaries in the Philippines, Malaysia, Indonesia, and other parts of the region. It is especially abundant in shallow, sheltered coastal waters.', 'Glossogobius celebius plays an important role in local fisheries, particularly in subsistence fishing. It is commonly harvested by local fishermen around Lake Mainit and other freshwater bodies, providing a small but valuable food source. Its abundance in shallow, sheltered areas makes it easy to catch, and it is often used in local dishes such as sinigang na pijanga (sour soup with Goby) or adobong pijanga (Goby cooked in soy sauce and vinegar).', 'The Goby plays a significant role in maintaining ecological balance in the ecosystem. By feeding on organic matter, small invertebrates, and detritus, it helps in cleaning the water and preventing excess nutrient buildup. Its presence in Lake Mainit contributes to the overall health of the aquatic ecosystem.', 'As a bottom-dwelling scavenger, the Goby contributes to nutrient cycling by consuming organic matter and detritus. This process helps to maintain water quality by reducing the accumulation of dead organic material, which can otherwise lead to oxygen depletion and poor water quality.', 2, '1746291493_465cce360fcfbd5b7382.png', 'Glossogobius celebius is commonly found in the shallower, more vegetated areas of Lake Mainit, often near the shores and river mouths where the water is calmer and the substrate is soft. It thrives in areas with dense aquatic plants and plenty of organic matter.', 'The Goby is an opportunistic feeder, consuming a variety of food sources such as small invertebrates, algae, detritus, and zooplankton. It is particularly well-suited to scavenging along the bottom, using its disc-shaped pelvic fins to hold onto rocks or plants while foraging. The species plays an important role in controlling the buildup of organic matter and detritus in the ecosystem.', 'Glossogobius celebius is generally solitary but may occasionally be found in small groups, especially in areas rich in food. Males are territorial during the breeding season and may engage in aggressive interactions with other males to defend their nests. The species has a non-aggressive nature and often hides among rocks and plants when not actively feeding or breeding.', 'â€¢ Froese, R., & Pauly, D. (2019). Glossogobius celebius. FishBase.\r\n\r\nâ€¢International Union for Conservation of Nature (IUCN), (2021). The Conservation Status of Freshwater Fish Species.\r\n\r\nâ€¢Tumbaga, R. C., & Sia, L. B. (2017). Aquaculture and Sustainable Fisheries: The Case of Gobies in the Philippines. Philippine Aquaculture Journal.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.540015,"lng":125.522361}]', 'Glossogobius celebius breeds during the rainy season, typically in shallow, sheltered areas with submerged vegetation. The male establishes a territory and creates a nesting site, where the female lays eggs. After fertilization, the male guards the nest until the eggs hatch, protecting them from predators. The species exhibits external fertilization and the juveniles are independent shortly after hatching.', 'In Filipino culture, the Pijanga is valued for its role in traditional cooking, where it is often included in family meals. It is considered an important freshwater fish species, especially in rural communities where it serves as a key dietary staple. The goby also holds cultural significance in some regions where it is seen as a symbol of abundance and sustenance from freshwater ecosystems.', 'Glossogobius celebius has a minimal direct impact on native species, as it feeds primarily on detritus and small invertebrates. However, it may compete with other small bottom-dwelling species for food and space. Its role in the ecosystem, however, benefits other species by helping control organic matter and maintaining water clarity.', 'The Goby is an important prey species for larger fish, birds, and other predators in the food chain. By providing food for higher trophic levels, it contributes to the biodiversity and stability of the ecosystem. Additionally, its feeding habits help control the growth of algae and invertebrates, preventing overpopulation of certain species.', 'Glossogobius celebius is not considered a threatened species, but its populations should be monitored to ensure that it remains abundant in Lake Mainit. Overfishing or habitat degradation could impact its numbers, particularly in areas where water quality is deteriorating or where there is significant pollution from agricultural runoff.', 'Protecting the aquatic habitats of Lake Mainit is essential for the survival of Glossogobius celebius. Conservation efforts should focus on preserving the shallow, vegetated areas and maintaining water quality. Protecting these habitats from pollution and destruction will support the long-term sustainability of this species and other aquatic organisms.', 'Promoting sustainable fishing practices is important for maintaining healthy populations of Gobies and other species in Lake Mainit. This includes regulating fishing activities and ensuring that fish populations are not overexploited. It is also essential to minimize habitat destruction and pollution to maintain favorable conditions for this species.', NULL, NULL, NULL),
	(47, 'species/47/8 Chanos chanos 1.png', 'Milkfish', NULL, '.', 'Chanos chanos', 'Milkfish', 'Bangus', 'Animalia', '2025-06-18 01:55:50', 2, '2025-06-18 01:55:50', 2, 'active', 0, 'Chordata', 'Actinopterygii', 'Gonorynchiformes', 'Chanidae', 'Chanos', 'chanos', 'Least Concern (LC)', 'The Milkfish, known locally as Bangus, is an important and widely recognized fish species in the Philippines and throughout Southeast Asia. It is the only extant species in the family Chanidae, and it is known for its sleek, silver body, with a deeply forked tail. The Milkfish has an elongated body that can grow up to 1.5 meters in length, though individuals typically average around 50 cm to 1 meter. Its coloration is typically silvery with a bluish or greenish sheen along the back, and a slightly darker dorsal fin. The species is named "Milkfish" due to its soft, white, and flavorful flesh, making it a popular food fish.', 'Milkfish prefer brackish waters, typically inhabiting estuaries, coastal waters, and freshwater lakes with a connection to the sea. In Lake Mainit, the species is commonly found in shallow bays, mudflats, and areas near river mouths, where freshwater from the lake mixes with seawater.', 'Chanos chanos thrives in areas with stable salinity levels, but it can tolerate a wide range of environmental conditions. It prefers clear waters with moderate salinity and oxygen levels, typically between 0.5 and 2.5 ppt (parts per thousand). Milkfish are known for their ability to adapt to various levels of water salinity, from freshwater to fully saline waters.', 'Chanos chanos is widely distributed in the Indo-Pacific region. It is found in coastal and brackish waters from the Arabian Peninsula to the Philippines, as well as throughout Southeast Asia and parts of the Pacific Islands.', 'The Milkfish is of significant economic importance, particularly in the Philippines, where it is one of the top fish species in both capture and aquaculture fisheries. It is widely cultured in fishponds, and the culture of Chanos chanos is vital to the local economy. Milkfish farming around Lake Mainit contributes to local livelihood through aquaculture, where fish are raised for both domestic consumption and export.', 'As a filter feeder, the Milkfish plays an important role in maintaining the health of freshwater and coastal ecosystems by helping control algae and plankton populations. By feeding on algae and detritus, it helps regulate nutrient cycling and contributes to the overall biodiversity of the area.', 'As a herbivorous filter feeder, Chanos chanos contributes significantly to nutrient cycling in the aquatic ecosystem. By consuming algae, detritus, and plankton, the species helps prevent overgrowth of certain plants and microorganisms, which in turn maintains water quality and clarity in the estuarine and freshwater systems.', 2, '1746291749_d8e0480b4877f5f5109d.png', 'Chanos chanos is native to the Philippines and is found in the coastal waters, estuaries, and freshwater systems of the country. In Lake Mainit, it is often found in the brackish waters where the lake meets the river systems, as it thrives in areas where fresh and saltwater mix.', 'Milkfish are primarily herbivores, feeding on algae, aquatic plants, and detritus. They are filter feeders and use their specialized gill rakers to sift small particles of plant material and plankton from the water. They are often seen grazing in coastal estuaries and freshwater environments, where they help control the growth of algae and maintain water quality.', 'Chanos chanos is generally a social species that forms schools, particularly during migration and spawning. Outside of the spawning season, they are often found in loose schools or solitary, depending on habitat availability and food resources. They are also known to exhibit certain territorial behaviors during breeding periods when males compete for mating opportunities.', 'â€¢ Froese, R., & Pauly, D. (2019). Chanos chanos - Milkfish. FishBase.\r\n\r\nâ€¢International Union for Conservation of Nature (IUCN), (2021). The Conservation Status of Marine and Freshwater Species.\r\n\r\nâ€¢National Fisheries Research and Development Institute (NFRDI), (2018). Milkfish Aquaculture in the Philippines: Sustainability and Growth.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.536968,"lng":125.524112}]', 'Chanos chanos is a migratory species, with its breeding occurring in the open sea, often far from the estuaries or freshwater lakes. During the spawning season, adult fish migrate from coastal waters to deeper, offshore marine environments. After spawning, the eggs float on the surface of the water, and the larvae are carried by ocean currents until they reach suitable estuarine or freshwater habitats to grow. The species has a high reproductive output, and its young fish typically enter freshwater or brackish environments once they mature enough to survive in lower salinity waters.', 'Bangus is a beloved fish in Filipino cuisine, with its rich and tender meat being a key ingredient in various traditional dishes such as sinigang na bangus (Milkfish in sour soup), bangus belly (marinated and grilled), and adobong bangus. The species holds cultural value as it is often associated with family gatherings and celebrations, making it a prominent food source in Filipino culinary traditions.', 'The presence of Milkfish in Lake Mainit may influence native aquatic species, particularly those living in the same ecological niches. Its feeding habits may lead to competition with other filter-feeding species, but it generally coexists well with other species due to its specialized feeding behavior. Milkfish farming has also led to habitat modification in some areas, although the fish itself is a key component of the local food web.', 'Chanos chanos serves as a primary producer in the food chain, feeding on algae and plankton. It is preyed upon by larger fish, birds, and aquatic predators, thereby providing energy and sustenance to higher trophic levels. Its migratory behavior also contributes to the dispersal of nutrients across different aquatic habitats, benefiting the entire ecosystem.', 'Although Chanos chanos is not considered to be threatened globally, population monitoring is important, especially in areas where intensive aquaculture practices could impact wild populations. Ensuring sustainable fishing and farming practices is crucial for the long-term health of the species in the region.', 'Protecting the estuarine and freshwater habitats where Milkfish thrive is essential for ensuring the species\' continued existence. Efforts to reduce pollution, protect aquatic vegetation, and prevent the degradation of estuarine environments are necessary to sustain healthy populations.', 'Promoting sustainable aquaculture and fishing practices is vital for the protection of Chanos chanos populations. This includes regulating fishpond practices, preventing overfishing, and ensuring that farming activities do not harm the surrounding ecosystem. Establishing no-catch zones or seasonally restricted fishing areas can help maintain the balance between wild and farmed populations.', NULL, NULL, NULL),
	(48, 'species/48/9 Neosthetus thessa 1.png', 'Thessa Goby', NULL, '.', 'Neosthetus thessa', 'Thessa Goby', 'Bolinao', 'Animalia', '2025-06-18 01:57:17', 2, '2025-06-18 01:57:17', 2, 'active', 0, 'Chordata', 'Actinopterygii', 'Perciformes', 'Gobiidae', 'Neosthetus', 'thessa', 'Least Concern (LC)', 'Neosthetus thessa, commonly known as the Bolinao or Thessa Goby, is a small, bottom-dwelling fish species found in freshwater and brackish environments. It typically reaches a length of 10â€“12 cm, although individuals up to 15 cm have been observed. The body of N. thessa is cylindrical, with a slightly flattened head and a large, broad mouth. Its coloration is usually a dull brownish or olive-green, with irregular markings or spots along the sides, making it well-camouflaged in its natural environment. The fish\'s pectoral fins are large and rounded, which aid in its bottom-dwelling lifestyle.', 'This species inhabits shallow, coastal freshwater areas, including rivers, estuaries, and lakes. In Lake Mainit, N. thessa is most commonly found in the shallow, slow-moving waters near the lake\'s edges, especially in areas with submerged vegetation or muddy bottoms. The fish prefers habitats that are not too deep, typically in water depths of less than 5 meters.', 'N. thessa thrives in waters that are low to moderately saline, with clear or slightly turbid conditions. It can tolerate a range of temperatures but prefers warm, tropical conditions found in the Lake Mainit region. The species is adapted to survive in freshwater or slightly brackish waters with moderate to low levels of oxygen.', 'Neosthetus thessa is found in Southeast Asia, particularly in the Philippines. It is also distributed across other parts of the Indo-Pacific region, where it is typically found in freshwater and brackish environments close to the coastlines.', 'While Neosthetus thessa is not a major target for fisheries, it plays an important role in the local aquatic food web by serving as prey for larger fish species, birds, and other predators. Its presence supports biodiversity and maintains ecological balance in Lake Mainit.', 'This species is an important member of the benthic community, contributing to nutrient cycling by feeding on detritus and small invertebrates. It helps maintain a healthy balance of organic material in the sediment, which in turn affects the overall water quality of Lake Mainit.', 'As a bottom-dwelling feeder, Neosthetus thessa contributes to nutrient cycling by breaking down organic matter on the lakeâ€™s floor. Its feeding habits help recycle nutrients and maintain a balance in the ecosystem, especially in areas with high organic content.', 2, '1746291999_b7bdd025a3d99ac749c8.png', 'Neosthetus thessa is native to Southeast Asia, including the Philippines, and is commonly found in various freshwater and brackish ecosystems. In Lake Mainit, it can be found in the shallows and the margins of the lake, where the water is either low in salinity or slightly brackish. It prefers areas with sandy or muddy substrates, where it can easily burrow and find shelter.', 'The Bolinao Goby is primarily carnivorous, feeding on small invertebrates, zooplankton, and detritus. It may also consume algae and small plant matter. As a bottom-dweller, it forages on the substrate, scavenging for food and relying on its keen sense of smell and vision to detect prey. It often feeds in a solitary manner or in small groups.', 'N. thessa tends to be a solitary species, although it may occasionally form small aggregations in areas with abundant food sources. It is territorial and will establish small territories in which it can forage and rest, often defending these areas from other individuals.', 'â€¢FishBase (2021). Neosthetus thessa â€“ Thessa Goby.\r\n\r\nâ€¢International Union for Conservation of Nature (IUCN), (2021). Conservation status of freshwater and brackish water species.\r\n\r\nâ€¢Philippine Journal of Aquatic Ecology (2020). "Diversity and Ecology of Goby Species in Philippine Lakes: The Case of Neosthetus thessa."\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.532092,"lng":125.520461}]', 'The reproductive habits of Neosthetus thessa are not well-documented but are believed to involve the laying of eggs on submerged substrates like rocks or aquatic plants. The eggs hatch into larvae that are initially planktonic and later settle to the bottom once they develop further. Little is known about the species\' parental care, but like other gobies, they may guard their eggs against potential predators.', 'In the Philippines, gobies like Neosthetus thessa are part of the rich diversity of local fish species, though they are not typically commercially farmed or widely consumed. They do hold some cultural significance, particularly among fishermen who value them for their role in the ecosystem and their potential as bait for larger fish species.', 'The species has minimal direct impact on other species in its environment, but it may influence the population dynamics of smaller invertebrates and plankton. It also serves as a food source for larger predators, making it an important part of the food web in Lake Mainit.', 'Neosthetus thessa plays an important role as prey for larger fish, birds, and aquatic animals. It is an important link in the food chain, contributing to the diet of higher trophic-level species while also controlling the populations of smaller invertebrates and plankton.', 'Although not currently considered endangered, the Bolinao Goby could be affected by habitat degradation, especially from sedimentation, pollution, and invasive species. Regular monitoring of population trends in Lake Mainit is essential to understand the speciesâ€™ status and health.', 'Protecting the shallow, muddy, and vegetated areas of Lake Mainit, where Neosthetus thessa resides, is critical to maintaining the species\' habitat. Conservation efforts should focus on reducing pollution, sedimentation, and ensuring that water quality remains within optimal ranges for the species.', 'Encouraging sustainable fishing practices that protect the habitat of this species, as well as implementing water management strategies to prevent habitat destruction, will benefit Neosthetus thessa and other aquatic species in Lake Mainit. Preservation of the lakeâ€™s biodiversity is essential for the overall health of the ecosystem.', NULL, NULL, NULL),
	(49, 'species/49/10 Clarias batrachus 1.png', 'Asian Catfish', NULL, '.', 'Clarias batrachus', 'Asian Catfish', 'Hito', 'Animalia', '2025-06-18 01:57:32', 2, '2025-06-18 01:57:32', 2, 'active', 0, 'Chordata', 'Actinopterygii', 'Siluriformes', 'Clariidae', 'Clarias', 'batrachus', 'Least Concern (LC)', 'Clarias batrachus, commonly known as the Asian Catfish or Hito, is a large freshwater fish known for its distinctive catfish features, including a long, slender body and smooth skin. It typically grows to lengths of 40â€“60 cm, though individuals up to 1 meter have been recorded in the wild. The Hito has a dark, grayish-brown body with pale undersides and long barbels extending from the upper and lower jaws, which it uses for tactile sensing. This species is highly adaptable, able to thrive in a wide range of water conditions, including muddy, turbid, and oxygen-poor environments.', 'This species thrives in calm, muddy waters of rivers, lakes, and ponds. In Lake Mainit, the Hito is found in deeper, slower sections of the lake, particularly near the shores where organic material accumulates. The species is often found in areas with minimal water flow, such as small bays, marshes, and areas with dense vegetation along the shore.', 'Clarias batrachus is highly tolerant of varying water quality. It can survive in low-oxygen environments, making it suitable for areas with higher organic content or poor water quality. The species is able to respire through its skin and specialized organs, allowing it to survive in oxygen-deprived conditions.', 'This species is native to Southeast Asia, including the Philippines, and can be found in a variety of freshwater habitats, from slow-moving rivers and lakes to swamps and marshes.', 'Clarias batrachus is an important species for both commercial and subsistence fisheries in the Philippines. It is commonly farmed in aquaculture systems, particularly in freshwater ponds. The species is valued for its fast growth, ease of farming, and ability to tolerate poor water quality. In Lake Mainit, it may contribute to local fisheries by providing a source of food for local communities.', 'As a bottom feeder, Clarias batrachus helps to maintain the balance of the aquatic ecosystem by consuming organic material and small invertebrates. This scavenging behavior contributes to nutrient cycling in Lake Mainit, helping to break down organic matter and control the populations of smaller organisms.', 'As a scavenger, Clarias batrachus plays an important role in breaking down organic matter and detritus found at the lake\'s bottom. It contributes to the cycling of nutrients in the ecosystem, which helps maintain water quality and supports other organisms in the food web.', 2, '1746292213_6c8e04fdbce5318a4be8.png', 'Clarias batrachus is native to Southeast Asia, including the Philippines. In Lake Mainit, this species is commonly found in the deeper, slower-moving areas of the lake, especially in regions with muddy or silty bottoms. It prefers lowland freshwater ecosystems but can tolerate brackish water.', 'The Asian Catfish is primarily carnivorous and scavenges for food in its environment. It feeds on a variety of organisms, including small fish, crustaceans, insects, and organic debris. It is an opportunistic feeder and will eat almost anything it can capture. It is also known to forage on the lakebed, using its barbels to detect prey in the sediment.', 'Clarias batrachus is a solitary species, although juveniles and adults may congregate in areas where food is abundant. The species is not territorial but may become aggressive when competing for food. During breeding season, males and females form temporary pair bonds to reproduce.', 'â€¢ FishBase (2021). Clarias batrachus â€“ Asian Catfish.\r\n\r\nâ€¢ Philippine Journal of Aquatic Ecology (2020). "Ecology and Culture of Freshwater Fish in Lake Mainit."\r\n\r\nâ€¢ International Union for Conservation of Nature (IUCN), (2021). "Conservation Status of Freshwater Fish Species."\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.54225,"lng":125.523881}]', 'The breeding season for Clarias batrachus typically occurs during the rainy season. The female lays a large number of eggs, which are fertilized externally by the male. The eggs hatch into larvae that are initially free-swimming before they settle at the lakebed. The parents may provide some care for the young, though they are generally independent after hatching.', 'The Hito is a popular species in Filipino cuisine, where it is often cooked in various dishes such as "Sinigang na Hito" (sour fish soup) and "Hito sa Miso" (catfish in fermented soybean paste). The species is culturally significant, not only for its role in traditional Filipino cooking but also in the fish markets where it is commonly sold.', 'While Clarias batrachus is a natural part of the freshwater ecosystems in the Philippines, it can have an impact on local species through its competitive feeding habits. It may compete with native fish species for food resources, particularly in areas where food is scarce. Additionally, the introduction of C. batrachus to new areas could potentially displace native species or alter ecosystem dynamics.', 'The Asian Catfish serves as both predator and prey in the local food web. It preys on smaller fish, invertebrates, and detritus, while also providing food for larger aquatic predators. It is an important species in the aquatic food chain of Lake Mainit, contributing to the overall biodiversity and ecological balance of the area.', 'While Clarias batrachus is not currently at risk of extinction, its population should be monitored to prevent overfishing or habitat degradation that could affect its numbers. As a species that can thrive in poor water quality, it may be less vulnerable to habitat changes compared to other fish species, but it still requires healthy ecosystems to thrive.', 'Protecting the freshwater habitats of Lake Mainit is essential for the continued survival of C. batrachus. Efforts to minimize pollution, sedimentation, and habitat destruction will help maintain the species\' populations. Ensuring the preservation of shallow, slow-moving waters with abundant organic material is crucial for the species\' success.', 'Promoting sustainable fishing practices and responsible aquaculture can help ensure that Clarias batrachus remains a viable species for local fisheries without causing long-term ecological damage. Managing stocking densities in aquaculture ponds and reducing pollution in Lake Mainit will support both the species and the surrounding ecosystem.', NULL, NULL, NULL),
	(50, 'species/50/1 Fejervarya cancrivora 1.png', 'Crab-eating Frog', NULL, '.', 'Fejervarya cancrivora', 'Crab-eating Frog', NULL, 'Animalia', '2025-06-18 01:34:04', 2, '2025-06-18 01:34:04', 2, 'active', 0, 'Chordata', 'Amphibia', 'Anura', 'Dicroglossidae', 'Fejervarya', 'cancrivora', 'east Concern (LC)', 'The Crab-eating Frog is a medium to large amphibian with a robust body and long legs. It has rough, olive or brown skin with darker spots and a flattened head. It is nocturnal and feeds on crabs, fish, and invertebrates in coastal habitats.', 'Mangrove forests, estuaries, brackish pools', 'Prefers brackish and tidal waters', 'Southeast Asia, including the Philippines', 'Indirectly supports fisheries by controlling crab populations', 'Both predator and prey in the coastal food web', 'Helps control invertebrate populations and maintains balance', 3, '1746292743_8276cefb7c0762d10db6.png', 'Coastal regions with brackish water around Lake Mainit', 'Predates on small crabs, mollusks, and aquatic invertebrates', 'Solitary except during breeding; forms aggregations while mating', 'â€¢ Inger, R. F., & Marx, H. (1965). The Amphibians and Reptiles of the Philippines. Fieldiana Zoology. \r\n\r\nâ€¢ IUCN Red List (2021). Fejervarya cancrivora.\r\n\r\nâ€¢ Diong, C. H. (2000). â€œDistribution and Ecology of Fejervarya Species in Southeast Asia.â€ Journal of Southeast Asian Amphibians.\r\n\r\nâ€¢ Annandale, N., & Kemp, S. A. (2010). The Amphibians of the Philippines. Asian Herpetological Research.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.584569,"lng":125.47097},{"lat":9.343111,"lng":125.514217}]', 'Breeds in brackish pools during rainy season; tadpoles develop in these waters', 'Ecologically important, though not culturally symbolic', 'Beneficial through predation on invasive invertebrates', 'Preyed upon by birds and reptiles', 'Needed due to pressures from coastal development', 'Vital to conserve mangrove and wetland habitats', 'Encourage pollution control and mangrove restoration', NULL, NULL, NULL),
	(51, 'species/51/2 Fejervarya moodiei 3.png', 'Brackish Frog', NULL, '.', 'Fejervarya moodiei', 'Brackish Frog', NULL, 'Animalia', '2025-06-18 01:33:28', 2, '2025-06-18 01:33:28', 2, 'active', 0, 'Chordata', 'Amphibia', 'Anura', 'Dicroglossidae', 'Fejervarya', 'moodiei', 'Least Concern (LC)', 'A medium-sized amphibian with rough, brown to olive skin and dark markings. Adapted to brackish environments, it has strong hind limbs and thrives in estuarine and mangrove areas.', 'Coastal wetlands, mangrove fringes, shallow pools', 'Tolerant of slightly saline water', 'Coastal areas of the Philippines and Southeast Asia', 'Contributes to invertebrate population control', 'Prey for birds and reptiles; controls aquatic insect populations', 'Aids nutrient regulation by feeding on detritivores', 3, '1746293137_c4e5cf6240928377934a.png', 'Estuarine and brackish areas of Lake Mainit', 'Opportunistic feeder on aquatic insects, larvae, and crustaceans', 'Mostly solitary, congregates during mating season', 'â€¢ Inger, R. F., & Marx, H. (1965). The Amphibians and Reptiles of the Philippines. Fieldiana Zoology.\r\n\r\nâ€¢IUCN Red List (2021). Fejervarya moodiei.\r\nDiong, C. H. (2000). â€œDistribution and Ecology of Fejervarya \r\nSpecies in Southeast Asia.â€ Journal of Southeast Asian Amphibians.\r\n\r\nâ€¢ Annandale, N., & Kemp, S. A. (2010). The Amphibians of the Philippines. Asian Herpetological Research.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.583282,"lng":125.471263},{"lat":9.345212,"lng":125.512093}]', 'Breeds in brackish pools; tadpoles develop in shallow water', 'Indicator of healthy brackish habitats', 'Minimal conflict; feeds on non-competitive prey', 'Intermediate-level prey and predator', 'Suggested due to coastal land use changes', 'Mangrove and estuary conservation critical', 'Promote pollution control and responsible land use', NULL, NULL, NULL),
	(52, 'species/52/3 Fejervarya vittigera 1.png', 'Luzon Warf Frog', NULL, '.', 'Fejervarya vittigera', 'Luzon Warf Frog', NULL, 'Animalia', '2025-06-18 01:54:15', 2, '2025-06-18 01:54:15', 2, 'active', 0, 'Chordata', 'Amphibia', 'Anura', 'Dicroglossidae', 'Fejervarya', 'vittigera', 'Least Concern (LC)', 'A medium-sized frog with dark brown to grayish rough skin and a smooth underside. It is commonly found in Luzonâ€™s mountain streams and is adapted to life near freshwater bodies.', 'Highland streams and shaded freshwater habitats', 'Clean, cool, flowing water preferred', 'Mountainous areas of Luzon, Philippines', 'Minor role in controlling aquatic pests', 'Part of stream food web; regulates insect population', 'Contributes to nutrient flow in stream ecosystems', 3, '1746293342_17eb19515f588caa9baf.png', 'Freshwater streams and ponds, less common in brackish areas', 'Predatory on aquatic insects, larvae, and crustaceans', 'Solitary; small aggregations during breeding', 'â€¢ IUCN Red List (2021). Fejervarya vittigera.\r\n\r\nâ€¢ Brown, R. H., & Alcala, A. C. (2003). â€œStream Amphibians of Luzon.â€ Philippine Herpetology Reports.\r\n\r\nâ€¢ Diong, C. H. (2000). â€œEcology of Amphibians in Highland Rivers.â€ Southeast Asian Amphibians Journal.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.583282,"lng":125.47604},{"lat":9.341489,"lng":125.515189}]', 'Lays eggs in clean stream water; tadpoles develop in situ', 'No major cultural value', 'Low; fills a niche without major competition', 'Mid-level predator and prey in freshwater streams', 'Necessary in isolated stream habitats', 'Crucial to conserve freshwater streams and riparian zones', 'Limit forest conversion and preserve stream corridors', NULL, NULL, NULL),
	(53, 'species/53/4 Limnonectes magnus 1.png', 'Mindanao Fanged Frog', NULL, '.', 'Limnonectes magnus', 'Mindanao Fanged Frog', NULL, 'Animalia', '2025-06-18 01:56:08', 2, '2025-06-18 01:56:08', 2, 'active', 0, 'Chordata', 'Amphibia', 'Anura', 'Dicroglossidae', 'Limnonectes', 'magnus', 'Near Threatened (NT)', 'A large frog with males reaching over 16 cm in snout-vent length. It has a robust body, brown to olive coloration with dark markings, relatively smooth skin, and a pale underbelly. Males have fang-like jaw projections used for combat. It is primarily nocturnal, camouflaged in forested stream habitats, and uses its powerful limbs to leap into water when threatened.', 'Lowland rainforests and montane forest streams, riverbanks, and shaded wetlands connected to the lake.', 'Prefers clean, well-oxygenated, neutral to slightly acidic stream water with rocky or leaf-littered substrate.', 'Endemic to the Philippines, distributed across Mindanao, including Siargao, Dinagat, Camiguin, Bohol, Samar, Leyte, and Basilan.', 'Sometimes harvested as food by locals but not a primary fisheries species.', 'Helps control insect populations, serves as prey to snakes, birds, and monitor lizards, and transfers nutrients between aquatic and terrestrial ecosystems.', 'Tadpoles recycle organic matter in streams; adults transport nutrients to forest floors.', 3, '1746301238_cfe04224463aa2bbaed5.png', 'Found in streams, forest edges, and wetlands of the Lake Mainit watershed, particularly in forested areas of Mainit, Tubay, Kitcharao, and Jabonga.', 'Carnivorous; feeds on insects, worms, spiders, small crustaceans, and occasionally small frogs or fish fry.', 'Solitary except during mating; males are territorial and may use fangs for combat; juveniles disperse after metamorphosis.', 'â€¢ IUCN SSC Amphibian Specialist Group. (2020). Limnonectes magnus. IUCN Red List of Threatened Species.\r\n\r\nâ€¢ Sanguila, M. B. et al. (2016). â€œHerpetofauna of Northeast Mindanao.â€ ZooKeys, 624: 1â€“132.\r\n\r\nâ€¢ Abraham, R. K. et al. (2021). â€œSystematics of Mindanao Fanged Frogs.â€ Herpetological Monographs, 35: 1â€“30.\r\n\r\nâ€¢ Ngilangil-Lansang, M. et al. (2021). â€œAmphibians of Lake Mainit Watershed.â€ Journal of Biodiversity and Environmental Sciences, 18(3): 54â€“62.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.584027,"lng":125.475712},{"lat":9.342908,"lng":125.516535}]', 'Breeds during rainy season; males call from shallow water. Eggs are laid under rocks or aquatic vegetation, tadpoles develop in forest streams.', 'Recognized in local folklore and once featured on a Philippine postage stamp; frogs are associated with rain and ecosystem health.', 'Regulates invertebrate populations; does not displace other native species.', 'Mid-level predator and prey; critical link between aquatic and terrestrial food chains.', 'Included in herpetofaunal surveys; monitored by DENR and academic institutions.', 'Conservation of the Kalinawan watershed and surrounding forest critical; supports KBA designation.', 'Environmental education, regulated harvest, ecotourism potential, and reforestation projects support conservation goals.', NULL, NULL, NULL),
	(54, 'species/54/5 Limnonectes acanthi 1.png', 'Busuangawarf Frog', NULL, '.', 'Limnonectes acanthi', 'Busuangawarf Frog', NULL, 'Animalia', '2025-06-18 01:57:52', 2, '2025-06-18 01:57:52', 2, 'active', 0, 'Chordata', 'Amphibia', 'Anura', 'Dicroglossidae', 'Limnonectes', 'acanthi', 'Least Concern (LC)', 'A large, aggressive stream-dwelling frog with warty olive to gray-brown skin. It has strong legs for jumping and prefers fast-moving water. Noted for its territorial behavior, especially during the breeding season.', 'Freshwater streams with strong currents and rocky substrates.', 'Prefers clean, well-oxygenated water.', 'Endemic to the Philippines, particularly Mindanao.', 'Not directly targeted, but helps maintain invertebrate balance.', 'Predator of small aquatic species; prey for birds and reptiles.', 'Regulates invertebrate populations and contributes to nutrient flow.', 3, '1746301485_a1801ed35c0b325a4d5b.png', 'Found in mountainous regions and rapid-flowing streams of the Lake Mainit watershed.', 'Feeds on aquatic insects, crustaceans, and mollusks.', 'Territorial; males call loudly and defend sites during breeding season.', 'â€¢Inger, R. F., & Marx, H. (1965). The Amphibians and Reptiles of the Philippines. Fieldiana Zoology.\r\n\r\nâ€¢IUCN Red List (2021). Limnonectes acanthi.\r\n\r\nâ€¢Diong, C. H. (2000). â€œEcology of Limnonectes Species in Southeast Asia.â€ Journal of Southeast Asian Amphibians.\r\n\r\nâ€¢ Annandale, N., & Kemp, S. A. (2010). The Amphibians of the Philippines. Asian Herpetological Research.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.344466,"lng":125.518366},{"lat":9.586397,"lng":125.474324}]', 'Breeds in fast-moving streams; tadpoles adapted to cling to rocks.', 'Known locally for its distinct calls; no major cultural value.', 'Minimal; coexists with other stream amphibians.', 'Supports ecological stability as both predator and prey.', 'Important due to sensitivity to habitat destruction.', 'Protect stream quality and forest cover.', 'Encourage responsible land and water use in upland areas.', NULL, NULL, NULL),
	(55, 'species/55/6 Leptodactylus leptodactyloides 1.png', 'Slender-fingered Toadlet', NULL, '.', 'Leptodactylus leptodactyloides', 'Slender-fingered Toadlet', 'Slender-fingered Toadlet', 'Animalia', '2025-06-18 01:58:13', 2, '2025-06-18 01:58:13', 2, 'active', 0, 'Chordata', 'Amphibia', 'Anura', 'Leptodactylidae', 'Leptodactylus', 'leptodactyloides', 'Least Concern (LC)', 'A small, pale amphibian with a slender build and long fingers. It has smooth skin and a secretive behavior, inhabiting forest leaf litter and damp undergrowth.', 'Forest floor, leaf litter, and riparian zones.', 'Needs clean freshwater for breeding in temporary pools.', 'Lowland Mindanao and surrounding islands.', 'Indirectly supports pest control in agriculture.', 'Helps regulate insect populations in the forest.', 'Influences detritus breakdown and insect regulation.', 3, '1746301722_d85f3c8a0ff466d3bd07.png', 'Moist, shaded areas near streams in the lowland forests around Lake Mainit.', 'Feeds on forest-floor invertebrates like ants, termites, and larvae.', 'Solitary, except during breeding.', 'â€¢ IUCN Red List (2021). Leptodactylus leptodactyloides.\r\n\r\nâ€¢ Rojas, J., & Diong, C. H. (2008). â€œEcology of Amphibians in Mindanao.â€ Philippine Journal of Herpetology.\r\n\r\nâ€¢ Blanford, W. T. (1912). â€œThe Amphibians and Reptiles of the Philippines.â€ The Journal of Zoology.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.344602,"lng":125.515524},{"lat":9.588089,"lng":125.477439}]', 'Eggs laid in moist leaf litter; tadpoles develop in ephemeral rainwater pools.', 'Rare and secretive; no noted cultural role.', 'Coexists with other frogs; no significant competition.', 'Prey for small reptiles and birds.', 'Recommended due to its cryptic nature.', 'Forest preservation is critical.', 'Reduce pesticide use and promote forest conservation.', NULL, NULL, NULL),
	(56, 'species/56/7 Megophrys stejnegeri 1.png', 'Mindanao Horned Frog', NULL, '.', 'Megophrys stejnegeri', 'Mindanao Horned Frog', NULL, 'Animalia', '2025-06-18 01:58:55', 2, '2025-06-18 01:58:55', 2, 'active', 0, 'Chordata', 'Amphibia', 'Anura', 'Megophryidae', 'Megophrys', 'stejnegeri', 'Least Concern (LC)', 'A robust frog with characteristic fleshy projections above the eyes resembling horns. It has a brown or gray cryptic coloration, rough dorsal skin, and a flattened body suited for camouflage in forest leaf litter. It is adapted for jumping with strong hind limbs and is primarily nocturnal.', 'Moist leaf-littered rainforest floors, particularly near streams or temporary pools.', 'Requires clean, cool water for breeding.', 'Endemic to Mindanao, Philippines.', 'No direct economic value, but contributes to insect control.', 'Helps maintain insect population balance in forest ecosystems.', 'Aids in forest nutrient cycling through predation on detritivores.', 3, '1746302042_1e8e749dd30617bf8671.png', 'Forested upland areas around Lake Mainit, especially in shaded, elevated regions.', 'Insectivorous; consumes arthropods such as ants, beetles, and spiders.', 'Solitary except during breeding season.', 'â€¢ IUCN Red List (2021). Megophrys stejnegeri.\r\n\r\nâ€¢Iskandar, D. T., & Nelsen, C. (2006). â€œEcology of Philippine Amphibians.â€ Biodiversity Journal.\r\n\r\nâ€¢ Brown, R. H., & Alcala, A. C. (2000). â€œPhilippine Amphibians: The Case of Megophrys stejnegeri.â€ Philippine Journal of Herpetology.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.58599,"lng":125.474344},{"lat":9.343518,"lng":125.51586}]', 'Breeds in rain-formed pools; tadpoles develop in slow-moving water.', 'Recognized for its camouflage; valued by researchers.', 'Non-competitive; occupies a distinct forest niche.', 'Prey to snakes and birds; regulates invertebrates.', 'Important due to sensitivity to forest disturbance.', 'Conservation of montane forests is crucial.', 'Support forest conserva