	(57, 'species/57/8 Platymantis corrugatus 1.png', 'Rough-back Forest Frog', NULL, '.', 'Platymantis corrugatus', 'Rough-back Forest Frog', NULL, 'Animalia', '2025-06-18 01:59:18', 2, '2025-06-18 01:59:18', 2, 'active', 0, 'Chordata', 'Amphibia', 'Anura', 'Ceratobatrachidae', 'Platymantis', 'corrugatus', 'Least Concern (LC)', 'A medium-sized frog with rough, wrinkled dorsal skin and dull brown to gray coloration. It is well camouflaged in the forest floor leaf litter and possesses strong hind legs for jumping.', 'Humid forest floors, leaf litter, and moist lowland vegetation.', 'Requires clean freshwater for breeding in rain-formed pools.', 'Endemic to rainforests of Mindanao and other Philippine islands.', 'No direct role, but helps control insect pests.', 'Natural pest controller in the forest ecosystem.', 'Contributes to regulation of detritivorous insects.', 3, '1746302327_db70799a1b5eace3db12.png', 'Forested surroundings of Lake Mainit with dense vegetation and high humidity.', 'Insectivorous; feeds on ants, termites, and small arthropods.', 'Solitary except when males call for mates.', 'â€¢ IUCN Red List (2021). Platymantis corrugatus.\r\n\r\nâ€¢ Brown, J. M., & Alcala, A. C. (2003). â€œEcology of Platymantis Species.â€ Philippine Herpetological Society.\r\n\r\nâ€¢ Siler, C. D., & Brown, R. H. (2008). â€œAmphibians of the Philippine Rainforests.â€ Journal of Tropical Biology.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.586397,"lng":125.477078},{"lat":9.342569,"lng":125.517555}]', 'Lays eggs in damp areas; tadpoles develop in ephemeral pools.', 'Low cultural value but relevant in ecological studies.', 'Limited overlap; coexists with other amphibians.', 'Prey for reptiles and birds; helps maintain food chain stability.', 'Advised due to habitat vulnerability.', 'Forest and wetland preservation are key.', 'Encourage sustainable forestry and rainwater retention.', NULL, NULL, NULL),
	(58, 'species/58/9 Pulchrana grandocula 1.png', 'Big-eyed Frog', NULL, '.', 'Pulchrana grandocula', 'Big-eyed Frog', NULL, 'Animalia', '2025-06-18 01:59:35', 2, '2025-06-18 01:59:35', 2, 'active', 0, 'Chordata', 'Amphibia', 'Anura', 'Ranidae', 'Pulchrana', 'grandocula', 'Least Concern (LC)', 'A forest-dwelling frog with prominent large eyes, greenish dorsal coloration with dark markings, and a white ventral side. It is commonly found in forested areas with freshwater bodies.', 'Moist, shaded lowland forest near freshwater streams.', 'Requires clean, oxygen-rich water for breeding.', 'Endemic to Mindanao, Philippines.', 'No direct economic importance.', 'Contributes to insect population control.', 'Regulates invertebrate communities through predation.', 3, '1746302554_73191e0274e4d8ada2ae.png', 'Forested regions and freshwater streams around Lake Mainit.', 'Insectivorous; consumes worms, insects, and spiders.', 'Solitary, with seasonal vocal activity from males.', 'â€¢ IUCN Red List (2021). Pulchrana grandocula.\r\n\r\nâ€¢ Siler, C. D., & Brown, R. H. (2007). â€œEcology of Pulchrana Species in the Philippines.â€ Herpetological Studies.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.583011,"lng":125.475019},{"lat":9.345279,"lng":125.515849}]', 'Breeds in freshwater; tadpoles develop in pools.', 'Not culturally prominent, but appreciated for ecological role', 'Minimal; coexists with other frogs.', 'Prey for birds, reptiles, and small mammals.', 'Required to track impacts of habitat degradation', 'Essential to conserve freshwater forest habitats.', 'Promote wetland and stream preservation.', NULL, NULL, NULL),
