	(60, 'species/60/11 Staurois tuberilinguis  1.png', 'Staurois tuberilinguis', NULL, '.', 'Staurois tuberilinguis', 'Staurois tuberilinguis', NULL, 'Animalia', '2025-06-18 02:00:19', 2, '2025-06-18 02:00:19', 2, 'active', 0, 'Chordata', 'Amphibia', 'Anura', 'Rhacophoridae', 'Staurois', 'tuberilinguis', 'Least Concern (LC)', 'A small to medium-sized frog with a dark body covered in green spots. It has powerful limbs for leaping across rocks and large eyes suited for nocturnal activity. Adapted for life in fast-flowing freshwater environments.', 'Clear, fast-flowing streams with rocky beds and dense vegetation.', 'Requires clean, well-oxygenated freshwater.', 'Endemic to the Philippines, particularly mountainous regions in Mindanao.', 'No direct role, but beneficial for insect control.', 'Supports stream ecosystems by controlling insect larvae.', 'Helps regulate aquatic invertebrate populations.', 3, '1746303244_75302b2a84d114b2dcb5.png', 'Found in rocky streams and waterfalls in the mountainous areas around Lake Mainit.', 'Insectivorous; consumes small invertebrates found near streams.', 'Solitary; males call during the breeding season.', 'â€¢ IUCN Red List (2021). Staurois tuberilinguis.\r\n\r\nâ€¢ Siler, C. D., & Brown, R. H. (2010). â€œRock Frogs of the Philippines: Focus on Staurois Species.â€ \r\n\r\nâ€¢ Journal of Philippine Herpetology.\r\n\r\nâ€¢ Brown, R. H., & Alcala, A. C. (2008). â€œAmphibians of the Philippines: Ecological Significance and Conservation Needs.â€ Biodiversity Studies.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.582334,"lng":125.475022},{"lat":9.342908,"lng":125.517896}]', 'Breeds on rocks above water; tadpoles develop in streams.', 'Recognized for its unique appearance and stream-dwelling habits.', 'Specialized habitat reduces competition.', 'Serves as prey for birds and streamside reptiles.', 'Required due to sensitivity to pollution and habitat disturbance.', 'Conservation of mountain stream habitats is essential.', 'Promote wa