	(61, 'species/61/12 Rhacophorus pardalis 1.png', 'Panther Flying Frog', NULL, '.', 'Rhacophorus pardalis', 'Panther Flying Frog', NULL, 'Animalia', '2025-06-18 02:00:37', 2, '2025-06-18 02:00:37', 2, 'active', 0, 'Chordata', 'Amphibia', 'Anura', 'Rhacophoridae', 'Rhacophorus', 'pardalis', 'Least Concern (LC)', 'A bright green frog with dark mottled markings and large, webbed limbs that enable it to glide between trees. It has large, forward-facing eyes adapted for low-light vision and an arboreal lifestyle.', 'Arboreal rainforest habitats near moist lowlands and streams.', 'Requires clean freshwater for reproduction.', 'Endemic to the Philippines, particularly Mindanao and nearby islands.', 'No direct relevance but supports insect population control.', 'Plays a role in balancing insect populations in forest canopies.', 'Regulates canopy-dwelling insect populations.', 3, '1746303469_e804b880bf3feee1e4b4.png', 'Found in the tropical forests surrounding Lake Mainit, near freshwater streams.', 'Insectivorous; feeds on beetles, crickets, and moths.', 'Solitary; males call from trees during the breeding season.', 'â€¢ IUCN Red List (2021). Rhacophorus pardalis.\r\n\r\nâ€¢ Siler, C. D., & Brown, R. H. (2011). â€œFlying Frogs of the Philippines.â€ Journal of Philippine Amphibian Ecology.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.584704,"lng":125.47674},{"lat":9.343247,"lng":125.514482}]', 'Lays eggs near water; tadpoles develop in pools or streams.', 'Notable for its gliding ability and striking appearance.', 'Minimal, occupies a specialized niche.', 'Preyed upon by birds and arboreal reptiles.', 'Needed due to forest degradation threats.', 'Protection of forest canopy and riparian zones is essential.', 'Promote reforestation and ecotourism-based conservation.', NULL, NULL, NULL),
	(90, 'species/90/1 Vallisneria sp 1.png', 'Lusay', NULL, '.', 'Vallisneria sp.', 'Lusay', 'Lusay', 'Plantae', '2025-06-17 03:55:35', 1, '2025-06-17 03:55:35', 1, 'active', 0, 'Tracheophyta', 'Liliopsida', 'Alismatales', 'Hydrocharitaceae', 'Vallisneria', '0', 'Not Evaluated (NE)', 'Vallisneria sp., locally known as Lusay, is a submerged aquatic plant characterized by long, ribbon-like leaves that can reach up to 1â€“2 meters in length. The leaves are bright green, linear, and arranged in a basal rosette. This plant is dioecious, with male and female flowers produced on separate plants. The female flowers rise to the water surface on long coiled stalks for pollination, while male flowers detach and float to reach the female blooms. Vallisneria plays a significant role in underwater ecosystems, providing habitat and oxygenation.', 'Submerged freshwater aquatic habitat. Prefers soft, muddy substrates where roots can anchor easily.', 'Thrives in nutrient-rich, clear water with moderate to slow flow. Tolerates a range of pH levels but prefers neutral to slightly alkaline waters.', 'Widely distributed across tropical and subtropical regions, including Southeast Asia and the Philippines. Naturally occurring in Lake Mainit.', 'No direct commercial use, but supports fisheries by providing habitat for juvenile fish and invertebrates.', 'Vital for maintaining water clarity and quality by stabilizing sediments and cycling nutrients.', 'Absorbs nutrients from sediments, reducing eutrophication risks. Contributes organic matter upon decomposition, enriching sediment quality.', 5, '1746528259_2338b3b634781292472b.jpg', 'Found in shallow areas of Lake Mainit, particularly in calm, clear waters near the shoreline and in sheltered bays.', 'Autotrophic; relies on photosynthesis, absorbing nutrients directly from the water and sediment.', 'Provides shelter and breeding grounds for fish and invertebrates. Acts as a substrate for epiphytic organisms and contributes to oxygenating the water.', 'â€¢ Cook, C.D.K. (1996). "Aquatic Plant Book." SPB Academic Publishing.\r\n\r\nâ€¢ Ramos, E. M. (2019). "Freshwater Biodiversity in Mindanao Lakes." Philippine Journal of Aquatic Sciences.\r\n\r\nâ€¢ IUCN (2021). "Aquatic Plant Species of Southeast Asia: Conservation Priorities." Global Environmental Review.\r\n\r\nâ€¢ Personal Communication with Local Fisherfolk, Lake Mainit (2025).', '[{"lat":9.565,"lng":125.5264},{"lat":9.519328,"lng":125.499345},{"lat":9.414516,"lng":125.548463},{"lat":9.368112,"lng":125.511878},{"lat":9.348972,"lng":125.520981},{"lat":9.352529,"lng":125.53455}]', 'Reproduces both sexually (via underwater flowering and pollination) and vegetatively (through runners). Vegetative propagation ensures dense colonies.', 'Traditionally recognized by local communities as an indicator of healthy aquatic ecosystems.', 'Positively impacts native fauna by enhancing habitat complexity. Competes with invasive aquatic plants but generally coexists well in natural systems.', 'Serves as a food source for herbivorous aquatic fauna and provides a nursery for small aquatic animals.', 'Periodic assessments are recommended to monitor health and spread, ensuring it remains beneficial to the lake\'s ecology.', 'Conservation of shoreline and submerged aquatic habitats critical to sustaining healthy populations of Lusay.', 'Preventing excessive nutrient runoff from agriculture will support healthy growth and prevent imbalances.', NULL, NULL, NULL),
	(63, 'species/63/1 Corbicula 1.png', 'Freshwater Clam', NULL, '.', 'Corbicula sp.', 'Freshwater Clam', 'Bibe', 'Animalia', '2025-06-18 02:03:50', 2, '2025-06-18 02:03:50', 2, 'active', 0, 'Mollusca', 'Bivalvia', 'Veneroida', 'Cyrenidae', 'Corbicula', '0', 'Not Evaluated (NE)', 'Corbicula, commonly known as the freshwater clam or Bibe, is a small bivalve mollusk found in freshwater ecosystems. Characterized by its rounded, symmetrical shell, Corbicula typically grows to 2â€“3 cm in length. It has a high metabolic rate and can filter large amounts of water, contributing to the maintenance of water quality in aquatic environments. The shell color varies from yellowish-brown to greenish.', 'Prefers shallow freshwater environments, such as riverbanks, marshes, and lakebeds.', 'Prefers clean, slightly alkaline waters with low turbidity and moderate nutrients.', 'Native to Southeast Asia and widely distributed in freshwater lakes across the Philippines, including Lake Mainit.', 'Though not widely harvested, Corbicula plays a role in maintaining the water quality of fishing areas.', 'Helps maintain water quality by filtering excess nutrients and organic materials, contributing to ecosystem health.', 'Plays a vital role in maintaining water clarity by filtering large amounts of water.', 4, '1746304115_39e47baad13d5c23efa1.png', 'Found in shallow, muddy or sandy lakebeds of Lake Mainit, typically in areas with slow-moving water.', 'Filter feeder; feeds by filtering small particles like plankton and detritus from the water.', 'Improves water clarity and helps maintain nutrient balance by filtering excess organic material from the water.', 'â€¢ Bagarinao, T. (2021). "Mollusks of Lake Mainit: Ecological Roles and Economic Importance." Philippine Journal of Aquatic Biology.\r\nâ€¢ Tan, M. M., & Aquino, J. F. (2020). "Freshwater Clams and Mussels of the Philippines: Distribution and Conservation." Philippine Journal of Freshwater Ecosystems.', '[{"lat":9.541573,"lng":125.520406},{"lat":9.456919,"lng":125.567069},{"lat":9.345821,"lng":125.51972}]', 'Reproduces by external fertilization, producing large numbers of offspring in the breeding season.', 'Important for maintaining healthy freshwater ecosystems, crucial for local agriculture and fishing.', 'Can compete with native mollusks for food and space, but its filtering role benefits the aquatic ecosystem.', 'Provides a food source for fish, birds, and other predators.', 'While not a species of concern, monitoring its populations ensures ecological balance.', 'Reducing nutrient loading in the lake helps maintain healthy Corbicula populations.', 'Efforts to improve water quality and reduce pollution benefit Corbicula and other freshwater species.', NULL, NULL, NULL),
	(64, 'species/64/2  Sinanodonta woodiana 2.png', 'Taiwan Shell', NULL, '.', 'Sinanodonta woodiana', 'Taiwan Shell', 'Taiwan Shell', 'Animalia', '2025-06-18 02:15:28', 2, '2025-06-18 02:15:28', 2, 'active', 0, 'Mollusca', 'Bivalvia', 'Unionoida', 'Unionidae', 'Sinanodonta', '0', 'Not Evaluated (NE)', 'Sinanodonta woodiana is a freshwater mussel with a dark, elongated shell that can grow up to 12 cm in length. Its shell is typically dark brown to black, often with greenish or yellow markings. The mussel is found in slow-moving rivers and lakes, where it burrows into the substrate. It feeds by filtering plankton and other small particles from the water.', 'Prefers sandy or muddy lakebeds, rivers, and marshes.', 'Can tolerate a wide range of water quality, but prefers clean, slightly alkaline waters.', 'Native to Southeast Asia and widely distributed in the Philippines.', 'In some areas, the shells are used for ornamental purposes, though it is not heavily exploited.', 'By filtering water, it enhances water quality and supports local fish and other aquatic species.', 'Helps in maintaining water clarity by filtering out pollutants.', 4, '1746304477_bd3e919da5fa6ef4d14b.png', 'Found in the sediment of shallow freshwater habitats like Lake Mainit, particularly in slow-moving or still waters.', 'Filter feeder, consuming small particles such as plankton and organic detritus.', 'Plays a significant role in maintaining water quality by filtering excess nutrients and particulates from the water.', 'â€¢Lee, C. W. (2020). "Freshwater Mussels of the Philippines: Status and Conservation." Philippine Journal of Aquatic Life.\r\nâ€¢ Gomez, R. L., & Santos, D. P. (2019). "Mollusks in Philippine Lakes: An Overview." Journal of Aquatic Ecosystem Health.', '[{"lat":9.537306,"lng":125.523391},{"lat":9.456377,"lng":125.57074},{"lat":9.484484,"lng":125.478101},{"lat":9.348532,"lng":125.525231}]', 'Reproduces by releasing larvae into the water, which eventually settle on the substrate and mature into adult mussels.', 'Contributes to the health of the ecosystem.', 'Competes with other native freshwater mussels for resources.', 'Acts as a food source for fish, birds, and other aquatic animals.', 'Should be monitored to prevent overexploitation or decline.', 'Proper management of water quality and reduction of nutrient loading is necessary for its conservation.', 'Efforts to improve water quality benefit this species, ensuring a healthy aquatic ecosystem.', NULL, NULL, NULL),
	(65, 'species/65/3 Vivipara angularis 1.png', 'Pond Snail', NULL, '.', 'Vivipara angularis', 'Pond Snail', 'Ige', 'Animalia', '2025-06-18 02:15:56', 2, '2025-06-18 02:15:56', 2, 'active', 0, 'Mollusca', 'Gastropoda', 'Architaenioglossa', 'Viviparidae', 'Vivipara', '0', 'Not Evaluated (NE)', 'Vivipara angularis is a freshwater snail with a conical shell, typically around 4â€“6 cm in length. The shell is smooth and can range in color from pale yellow to brown, with spiral markings. This species is viviparous, meaning it gives birth to live young rather than laying eggs, which is a distinguishing feature. The angular shape of the shell gives it its common name.', 'Prefers slow-moving waters, including lakes and marshes with soft sediment for burrowing.', 'Thrives in clean, nutrient-rich waters, often found in areas with moderate to low turbidity.', 'Native to Southeast Asia, including the Philippines.', 'Occasionally harvested for traditional dishes or as bait for fishing.', 'Helps control algae and prevent overgrowth of aquatic plants.', 'Helps reduce algae overgrowth, improving water clarity.', 4, '1746304782_c9333fe2408ffbb42271.png', 'Found in shallow, freshwater areas of Lake Mainit, particularly in marshes and riverbanks.', 'Herbivorous, feeding on algae, detritus, and aquatic plants.', 'Plays an important role in controlling algae growth and maintaining the balance of aquatic plants.', 'â€¢ Agustin, R. E. (2022). "Gastropods of the Philippines: Ecology and Conservation." Philippine Journal of Aquatic Biology.\r\nâ€¢ Santos, E. M., & Tan, A. D. (2020). "Ecology of Freshwater Snails in the Philippines." Journal of Philippine Aquatic Studies.', '[{"lat":9.451297,"lng":125.572114},{"lat":9.536968,"lng":125.523393},{"lat":9.482114,"lng":125.47742},{"lat":9.341892,"lng":125.518936}]', 'Viviparous reproduction, with live young being born from the parent.', 'Maintains the health of the freshwater ecosystem.', 'Competes with other herbivorous species.', 'Provides food for fish, birds, and other aquatic predators.', 'Ensuring that the species is not overexploited is crucial.', 'Protecting aquatic plants and clean water systems supports conservation.', 'Enhancing water quality benefits this species and contributes to a balanced ecosystem.', NULL, NULL, NULL),
	(66, 'species/66/4 Pila luzonica 1.png', 'Pila luzonica', NULL, '.', 'Pila luzonica', 'Pila luzonica', 'Punggok, Kuhol', 'Animalia', '2025-06-18 02:19:16', 2, '2025-06-18 02:19:16', 2, 'active', 0, 'Mollusca', 'Gastropoda', 'Basommatophora', 'Pilidae', 'Pila', '0', 'Not Evaluated (NE)', 'Pila luzonica is a large freshwater snail with a prominent conical shell, growing up to 10â€“12 cm in length. The shell is smooth, shiny, and typically light brown to dark brown in color, with a characteristic large aperture. The snail feeds on aquatic vegetation, and its large size makes it a key species in its ecosystem.', 'Prefers slow-moving water with abundant vegetation.', 'Thrives in clean, unpolluted freshwater environments.', 'Native to the Philippines, including Lake Mainit.', 'Harvested for local consumption, especially in traditional Filipino dishes.', 'Helps regulate aquatic vegetation and maintain ecosystem balance.', 'Helps maintain water clarity by feeding on algae and plants.', 4, '1746305265_98d89793542c96a50ef7.png', 'Found throughout Lake Mainit, especially in marshy and shallow areas where aquatic plants are abundant.', 'Herbivorous, feeding on aquatic plants and algae.', 'Controls plant growth and contributes to nutrient cycling.', 'â€¢ Gomez, R. T. (2021). "Freshwater Gastropods of the Philippines." Philippine Mollusk Journal.\r\nâ€¢ Hernandez, J. L., & Aquino, M. S. (2022). "Ecology and Use of Pila luzonica in Philippine Freshwater Ecosystems." Journal of Aquatic Resources and Management.', '[{"lat":9.452313,"lng":125.575201},{"lat":9.533447,"lng":125.523172},{"lat":9.455564,"lng":125.490234},{"lat":9.338369,"lng":125.521113}]', 'Lays eggs on submerged surfaces, where larvae hatch and mature.', 'Significant in local cuisine near freshwater bodies.', 'May compete with other herbivores.', 'Acts as prey for fish, birds, and other predators.', 'Regulation of harvesting practices is necessary.', 'Water quality improvement initiatives benefit this species.', 'Reducing water pollution and protecting aquatic vegetation is essential.', NULL, NULL, NULL),
	(67, 'species/67/5 Pomacea canaliculata 1.png', 'Golden Apple Snail', NULL, '.', 'Pomacea canaliculata', 'Golden Apple Snail', 'Golden Kuhol', 'Animalia', '2025-06-18 02:19:36', 2, '2025-06-18 02:19:36', 2, 'active', 0, 'Mollusca', 'Gastropoda', 'Architaenioglossa', 'Ampullariidae', 'Pomacea', '0', 'Not Evaluated (NE)', 'Pomacea canaliculata is a large freshwater snail with a glossy, golden-yellow shell that can grow up to 8 cm in diameter. Known for rapid reproduction, it is considered invasive in many regions. It feeds primarily on aquatic plants, especially rice crops, making it a major pest in agriculture.', 'Marshy, shallow areas with abundant aquatic plants.', 'Tolerates a range of conditions but prefers warm, nutrient-rich waters.', 'Native to South America; introduced in the Philippines.', 'Consumed in some regions as a delicacy.', 'Affects nutrient cycling and plant population dynamics.', 'Can alter water quality by overgrazing vegetation.', 4, '1746305572_1d9d8e4a40a1d33e421a.png', 'Found in slow-moving freshwater habitats of Lake Mainit.', 'Herbivorous, feeds on aquatic plants and algae.', 'Can cause vegetation loss, impacting aquatic habitats.', 'â€¢ Nguyen, T. D. (2021). "Invasive Species in Philippine Freshwater Ecosystems: The Case of Pomacea canaliculata." Journal of Aquatic Ecology.\r\nâ€¢ Salazar, J. L., & Sison, A. R. (2020). "Impact of Golden Apple Snail on Philippine Aquatic Vegetation." Philippine Aquatic Resource Management Journal.', '[{"lat":9.45299,"lng":125.571107},{"lat":9.537645,"lng":125.523758},{"lat":9.479066,"lng":125.476409},{"lat":9.344941,"lng":125.522726}]', 'Rapid reproduction, females lay clusters of eggs on submerged surfaces', 'Provides livelihood opportunities despite being a pest.', 'Disrupts native plant and animal communities.', 'Prey for birds, fish, and other predators.', 'Active control required due to invasive nature.', 'Important to preserve native flora and fauna.', 'Measures to reduce spread and improve water management.', NULL, NULL, NULL),
	(68, 'species/68/6 MElanoides 1.png', 'Melanoides Snail', NULL, '.', 'Melanoides sp.', 'Melanoides Snail', 'Not specified', 'Animalia', '2025-06-18 02:19:57', 2, '2025-06-18 02:19:57', 2, 'active', 0, 'Mollusca', 'Gastropoda', 'Neotaenioglossa', 'Thiaridae', 'Melanoides', '0', 'Not Evaluated (NE)', 'Melanoides snails are small to medium-sized freshwater snails with an elongated, turreted shell featuring numerous whorls. Shell coloration ranges from pale to dark brown, often with bands or spots. They possess an operculum for protection and typically grow 20â€“40 mm in length. They are known for their resilience and ability to thrive in varied freshwater environments.', 'Lakes, ponds, rivers, and wetlands with organic detritus and biofilm.', 'Prefers clean, oxygen-rich waters but is tolerant of some variation.', 'Tropical and subtropical Southeast Asia, including the Philippines.', 'Minimal economic importance.', 'Important for algae control, nutrient cycling, and as prey for other species.', 'Facilitates breakdown of organic material.', 4, '1746305936_136396a2d2c33e5a5314.png', 'Common in shallow, slow-moving or still waters of Lake Mainit, often near aquatic vegetation.', 'Grazers and detritivores feeding on algae, biofilm, and decomposing matter.', 'Generally solitary but form dense populations in favorable habitats.', 'â€¢ Glaubrecht, M. (2010). "Thiaridae Snails and Their Ecological Roles in Tropical Freshwater Ecosystems." Journal of Molluscan Studies.\r\nâ€¢ Smith, B. D. (2022). "Freshwater Mollusks of the Philippines: Diversity and Conservation." Aquatic Biodiversity Reports.\r\nField Notes and Interviews, Local Fisherfolk, Lake Mainit, 2025.', '[{"lat":9.536968,"lng":125.526131},{"lat":9.455361,"lng":125.570392},{"lat":9.481098,"lng":125.478782},{"lat":9.342231,"lng":125.51824}]', 'Capable of both parthenogenetic and sexual reproduction; females give birth to live young.', 'No notable cultural use.', 'Can outcompete native snails if populations grow unchecked.', 'Serves as prey for fish, crustaceans, and birds.', 'Recommended to prevent overpopulation.', 'Maintain oxygen-rich, clean water environments.', 'Manage aquatic vegetation and prevent habitat degradation.', NULL, NULL, NULL),
	(69, 'species/69/7 Scylla sp. 1.png', 'Mud Crab', NULL, '.', 'Scylla sp.', 'Mud Crab', 'Alimango', 'Animalia', '2025-06-18 02:20:21', 2, '2025-06-18 02:20:21', 2, 'active', 0, 'Mollusca', 'Malacostraca', 'Decapoda', 'Portunidae', 'Scylla', '0', 'Data Deficient (DD) for Scylla serrata', 'Scylla species are large crabs with broad, smooth carapaces and strong pincers. Their color ranges from dark green to muddy brown. Adults may reach 20â€“24 cm in carapace width. Notable features include serrated front edges, swimming legs, and spines near eyes and claws.', 'Brackish to freshwater areas near river mouths and vegetated margins.', 'Prefers nutrient-rich, slightly saline to freshwater conditions.', 'Indo-West Pacific region, including the Philippines.', 'High economic value; important income source.', 'Regulates smaller invertebrate populations and contributes to detritus decomposition.', 'Breaks down organic matter.', 4, '1746306194_a4b84d33d09187125f74.png', 'Found in estuarine zones, mangrove fringes, and muddy lake bottoms.', 'Omnivorous scavengers, consuming mollusks, fish, and plant debris.', 'Solitary and territorial; aggressive when defending space or mates.', 'â€¢ Keenan, C. P., Davie, P. J. F., & Mann, D. L. (1998). "A Revision of the Genus Scylla." Raffles Bulletin of Zoology.\r\nâ€¢ Local Fisheries Reports, Lake Mainit, 2024â€“2025.\r\nâ€¢ FAO (2023). "Mud Crab Aquaculture and Fisheries Management." FAO Aquaculture Technical Papers.\r\nâ€¢ Interviews with Local Crab Fishers, Lake Mainit, 2025.', '[{"lat":9.535614,"lng":125.517895},{"lat":9.458747,"lng":125.57142},{"lat":9.487193,"lng":125.476723},{"lat":9.346296,"lng":125.516867}]', 'High fecundity; females migrate to spawn.', 'Delicacy featured in feasts and traditional cooking.', 'Balances food webs as predator and scavenger.', 'Preyed upon by large fish and humans; predator to mollusks.', 'Required to ensure sustainable catch levels.', 'Essential to conserve mangrove and vegetated zones.', 'Encourage crab fattening and aquaculture.', NULL, NULL, NULL),
	(70, 'species/70/8 Caridina mindanao 1.png', 'Freshwater Shrimp', NULL, '.', 'Caridina mindanao', 'Freshwater Shrimp', 'Isik', 'Animalia', '2025-06-18 02:20:37', 2, '2025-06-18 02:20:37', 2, 'active', 0, 'Arthropoda', 'Malacostraca', 'Decapoda', 'Atyidae', 'Caridina', '0', 'Educate communities on responsible collection.', 'Caridina mindanao is a small, translucent freshwater shrimp with a slender body, long antennae, and delicate walking legs. Typically measuring 2 to 3.5 cm in length, its coloration varies from green to brown depending on habitat. It has a segmented body with a rostrum and fan-shaped tail, and fine setae on its limbs for filtering food particles.', 'Slow-moving or still waters with aquatic vegetation or leaf litter.', 'Prefers clean, oxygen-rich environments.', 'Endemic to Mindanao, including Lake Mainit.', 'Harvested by local communities for consumption.', 'Maintains water clarity and ecosystem health through detritus consumption.', 'Helps recycle nutrients by breaking down organic matter.', 4, '1746306571_960e8c02b02088275070.png', 'Found in freshwater streams, shorelines, and vegetated areas of Lake Mainit.', 'Omnivorous filter feeder and detritivore consuming algae, biofilm, and organic debris.', 'Gregarious; forms small colonies in suitable habitats.', 'â€¢ Cai, Y., & Ng, P. K. L. (2002). "The Freshwater Shrimps of the Genus Caridina from the Philippines." Zootaxa.\r\nâ€¢ Local Fisheries Surveys, Lake Mainit, 2024â€“2025.\r\nâ€¢ Personal communication with Lake Mainit local fishers, 2025.\r\nâ€¢ Department of Environment and Natural Resources (DENR), Philippines (2024). Freshwater Invertebrate Conservation Guidelines.', '[{"lat":9.538864,"lng":125.526597},{"lat":9.454887,"lng":125.569828},{"lat":9.484146,"lng":125.473954},{"lat":9.342908,"lng":125.518558}]', 'Females carry eggs until hatching; direct development without larval stages.', 'Known as "Isik," included in traditional dishes.', 'Reduces algal blooms and improves water clarity.', 'Prey for fish and invertebrates; supports aquatic biodiversity.', 'Necessary due to sensitivity to pollution.', 'Protection of vegetation zones and control of water pollutants.', 'Educate communities on responsible collection.', NULL, NULL, NULL),
	(71, 'species/71/1 Chrysopelea ornata 1.png', 'Golden Tree Snake', NULL, '.', 'Chrysopelea ornata', 'Golden Tree Snake', 'No widely recognized local name in the Philippines', 'Animalia', '2025-06-18 02:16:32', 2, '2025-06-18 02:16:32', 2, 'active', 0, 'Chordata', 'Reptilia', 'Squamata', 'Colubridae', 'Chrysopelea', 'ornata', 'Least Concern (LC)', 'The Golden Tree Snake is a slender, mildly venomous, rear-fanged colubrid known for its vibrant green body adorned with black crossbars and yellowish scales, giving it a golden appearance. It possesses specialized ribs that allow it to flatten its body, enabling it to glide between treesâ€”a behavior that has earned it the nickname "flying snake." Adults typically measure between 1.0 to 1.2 meters in length.', 'Prefers forested areas, including rainforests, mangroves, and wooded regions near water bodies. It is arboreal, often found in trees and shrubs.', 'Not directly dependent on water bodies but thrives in humid environments that support dense vegetation.', 'Native to Southeast Asia, including India, Thailand, Malaysia, Indonesia, and the Philippines.', 'No direct impact on fisheries.', 'Helps control populations of arboreal vertebrates, maintaining ecological balance.', 'Contributes to the food web by preying on various species and serving as prey for larger predators.', 6, '1746326084_1dd3c24477987346715d.png', 'While Chrysopelea ornata is widely distributed across Southeast Asia, including parts of the Philippines, specific records in the Lake Mainit area are limited. However, given the suitable habitat, its presence is plausible.', 'Feeds primarily on lizards, frogs, birds, and bats. Its gliding ability aids in hunting prey among trees.', 'Solitary and diurnal, it is most active during the day, especially in the early morning and late afternoon.', 'â€¢ Wikipedia. "Chrysopelea ornata." \r\n\r\nâ€¢ Ecology Asia. "Golden Tree Snake." \r\n\r\nâ€¢ Animalia.bio. "Golden Tree Snake." â€‹Animalia\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.536189,"lng":125.519707},{"lat":9.455564,"lng":125.562907},{"lat":9.353952,"lng":125.514871},{"lat":9.459628,"lng":125.486737}]', 'Oviparous, laying clutches of 6â€“12 eggs. Breeding season varies with geographic location but often coincides with warmer months.', 'Not prominently featured in local folklore or traditions.', 'As a predator, it helps regulate populations of certain species but does not pose a significant threat to biodiversity.', 'Mid-level predator; its presence indicates a healthy, biodiverse ecosystem.', 'No specific monitoring programs in place; general herpetofaunal surveys may include this species.', 'Conservation of forested areas around Lake Mainit will support the species\' habitat needs.', 'Promoting forest conservation and preventing deforestation are key to maintaining suitable habitats.', NULL, NULL, NULL),
	(72, 'species/72/2 Ahaetulla prasina  1.png', 'Asian Vine Snake', NULL, '.', 'Ahaetulla prasina', 'Asian Vine Snake', 'No widely recognized local name in the Philippines', 'Animalia', '2025-06-18 02:14:39', 2, '2025-06-18 02:14:39', 2, 'active', 0, 'Chordata', 'Reptilia', 'Squamata', 'Colubridae', 'Ahaetulla', 'prasina', 'Least Concern (LC)', 'The Asian Vine Snake is a slender, elongated snake known for its vibrant green coloration, which provides excellent camouflage among foliage. It has a distinctive pointed snout and horizontal pupils, aiding in depth perception. Adults can reach lengths of up to 1.8 meters. This species is mildly venomous, possessing rear fangs, but is not considered dangerous to humans.', 'Prefers forested areas, including primary and secondary forests, as well as plantations and gardens. It is arboreal and often found in trees and shrubs.', 'Not directly dependent on water bodies but thrives in humid environments that support dense vegetation.', 'Native to Southeast Asia, including the Philippines.', 'No direct impact on fisheries.', 'Helps control populations of arboreal vertebrates, maintaining ecological balance.', 'Contributes to the food web by preying on various species and serving as prey for larger predators.', 6, '1746326571_f9a484753a0c7b3ce28a.png', 'While specific studies on Ahaetulla prasina in the Lake Mainit area are limited, the species is widespread in the Philippines and is likely present in suitable habitats around the lake.', 'Feeds primarily on lizards, frogs, and occasionally small birds. Its slender body allows it to navigate through branches to ambush prey.', 'Solitary and diurnal, it is most active during the day, especially in the early morning and late afternoon.', 'â€¢ Wikipedia. "Ahaetulla prasina." \r\n\r\nâ€¢ Ecology Asia. "Oriental Whip Snake." \r\n\r\nâ€¢ A-Z Animals. "Asian Vine Snake Animal Facts." \r\n\r\nâ€¢ IUCN Red List. "Ahaetulla prasina." \r\n\r\nâ€¢ Dela Cruz, C.J.P., Sevilla, M., & Sy, E.Y. (2023). "Predation by Philippine Vine Snake Ahaetulla prasina preocularis on Philippine forest skink Pinoyscincus sp. on Luzon Island, Philippines." \r\n\r\nâ€¢ Mohagan, A.B., et al. (2019). "Species richness and endemism of Reptilian Fauna in four Long-Term Ecological Research sites in Mindanao, Philippines." Biodiversity Journal, 10(3): 237â€“248.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.581996,"lng":125.475358},{"lat":9.343924,"lng":125.51756}]', 'Ovoviviparous, giving birth to live young. Females can produce up to 10 offspring at a time.', 'Not prominently featured in local folklore or traditions.', 'As a predator, it helps regulate populations of certain species but does not pose a significant threat to biodiversity.', 'Mid-level predator; its presence indicates a healthy, biodiverse ecosystem.', 'No specific monitoring programs in place; general herpetofaunal surveys may include this species.', 'Conservation of forested areas around Lake Mainit will support the species\' habitat needs.', 'Promoting forest conservation and preventing deforestation are key to maintaining suitable habitats.', NULL, NULL, NULL),
	(73, 'species/73/3 Pantherophis onsoletus 1.png', 'Black Rat Snake', NULL, '.', 'Pantherophis obsoletus', 'Black Rat Snake', 'No widely recognized local name in the Philippines', 'Animalia', '2025-06-18 02:03:04', 1, '2025-06-18 02:03:04', 1, 'active', 0, 'Chordata', 'Reptilia', 'Squamata', 'Colubridae', 'Pantherophis', 'obsoletus?', 'Least Concern (LC) ?', 'The Black Rat Snake is a nonvenomous constrictor native to central North America. Adults typically measure between 106.5 to 183 cm in length, with some individuals reaching up to 256.5 cm, making it one of the longest snakes in North America. They have a glossy black dorsal surface with white or light-colored bellies and a white chin and throat. Juveniles exhibit a grayish background with dark blotches, which darken as they mature.', 'They inhabit a variety of environments, including forests, grasslands, farmlands, and suburban areas. They are excellent climbers and are often found in trees and barns.', 'While not aquatic, they are competent swimmers and may be found near water bodies.', 'Central and eastern United States', 'No direct impact on fisheries.', 'Serve as both predator and prey, maintaining ecological balance by controlling rodent populations and serving as food for larger predators.', 'By preying on rodents and birds, they help in nutrient redistribution within ecosystems.', 6, '1746328085_977568068f33879531f6.png', 'Pantherophis obsoletus is native to central North America, ranging from Iowa to Texas and eastward to the Appalachian Mountains.', 'Primarily feeds on rodents, birds, and bird eggs. They are constrictors, subduing prey by coiling around and suffocating them.', 'Solitary except during the breeding season. They hibernate in communal dens during winter, sometimes with other snake species.', 'â€¢ Wikipedia. "Pantherophis obsoletus." \r\n\r\nâ€¢ National Wildlife Federation. "Eastern Rat Snake." \r\n\r\nâ€¢ Live Science. "Rat snake facts." \r\n\r\nâ€¢ Reptile Database. "Pantherophis obsoletus." \r\n\r\nâ€¢ George, A.D., Thompson III, F.R., & Faaborg, J. (2022). "Movements and Habitat Use by Western Ratsnakes (Pantherophis obsoletus) in a Fragmented Midwestern Landscape." Herpetological Conservation and Biology, 17(2), 306â€“315.\r\n\r\nâ€¢ Photo credit to iNaturalist', NULL, 'Breeding occurs in late spring, with females laying clutches of 6 to 24 eggs in early summer. Hatchlings emerge in late summer or early fall.', 'In their native range, they are often appreciated for controlling rodent populations.', 'Beneficial in controlling pest populations; however, they may prey on bird eggs, affecting local bird populations.', 'Mid-level predators; preyed upon by larger snakes, birds of prey, and mammals.', 'Populations are stable in their native range; however, habitat destruction poses a threat.', 'Conservation of forests and grasslands supports their habitat needs.', 'Promoting coexistence and educating the public about their ecological benefits can aid in their conservation.', NULL, NULL, NULL),
	(74, 'species/74/4 Oxyrhabdium modestum 1.png', 'Philippine Shrub Snake', NULL, '.', 'Oxyrhabdium modestum', 'Philippine Shrub Snake', 'No widely recognized local name in the Philippines', 'Animalia', '2025-06-18 02:03:20', 1, '2025-06-18 02:03:20', 1, 'active', 0, 'Chordata', 'Reptilia', 'Squamata', 'Cyclocoridae', 'Oxyrhabdium', 'modestum?', 'Least Concern (LC)', 'The Philippine Shrub Snake is a small, slender, non-venomous snake endemic to the Philippines. It exhibits a brown dorsal coloration that transitions to a yellowish-brown on the sides, with a beige ventral surface. Distinctive features include a pointed snout, smooth scales, and a head slightly distinct from the neck. Adults typically reach a snoutâ€“vent length of approximately 435 mm.', 'Prefers secondary growth forests near rivers and streams. Often found in leaf litter and under logs in moist environments.', 'Thrives in humid conditions with clean freshwater sources, indicating a preference for unpolluted habitats.', 'Endemic to the Philippines, recorded on the islands of Basilan, Bohol, Dinagat, Leyte, Mindanao, Negros, and Samar.', 'No direct impact on fisheries; however, by controlling invertebrate populations, it may indirectly benefit agriculture.', 'Serves as both predator and prey within the ecosystem, aiding in maintaining ecological balance.', 'By preying on invertebrates and being preyed upon by larger animals, it plays a role in nutrient transfer within the ecosystem.', 6, '1746328324_846c37f743cd3a867683.png', 'While specific records of Oxyrhabdium modestum in Lake Mainit are limited, its presence in the surrounding regions of Mindanao suggests potential habitation in the area.', 'Primarily feeds on small invertebrates, such as insects and earthworms, contributing to the control of these populations.', 'Solitary and secretive; most active during twilight hours.', 'â€¢ Sanguila, M.B., Cobb, K.A., Siler, C.D., Diesmos, A.C., Alcala, A.C., & Brown, R.M. (2016). The amphibians and reptiles of Mindanao Island, southern Philippines, II: The herpetofauna of northeast Mindanao and adjacent islands. ZooKeys, 624, 1â€“132. \r\n\r\nâ€¢ Magdua, A.B., & Sanguila, M.B. (2023). First Record of Ophiophagy in Philippine Ground Snake Stegonotus muelleri on the Non-banded Philippine Burrowing Snake Oxyrhabdium modestum. Philippine Journal of Science, 152(2), 1â€“5. \r\n\r\nâ€¢ Leviton, A.E. (1964). Contributions to a review of Philippine snakes. VI. The snakes of the genus Oxyrhabdium. Philippine Journal of Science, 93, 407â€“422. \r\n\r\nâ€¢ Weinell, J.L., Hooper, E., Leviton, A.E., & Brown, R.M. (2019). Illustrated Key to the Snakes of the Philippines. Proceedings of the California Academy of Sciences, 66(1), 1â€“49. â€‹\r\n\r\nâ€¢ Photo credit to iNaturalist', NULL, 'Oviparous, laying eggs in moist, concealed locations. Specific breeding behaviors in Lake Mainit remain undocumented.', 'Not prominently featured in local folklore or traditions.', 'Contributes to controlling invertebrate populations, potentially benefiting plant health and soil quality.', 'Occupies a mid-level trophic position, linking primary consumers and higher predators.', 'Currently classified as Least Concern by the IUCN; however, habitat monitoring is essential to ensure population stability.', 'Preservation of forested areas and riparian zones around Lake Mainit is crucial for its continued survival.', 'Promoting sustainable land use and minimizing deforestation will support the species\' habitat requirements.', NULL, NULL, NULL),
	(75, 'species/75/5 Malayopython reticulatus 1.png', 'Reticulated Python', NULL, '.', 'Malayopython reticulatus', 'Reticulated Python', 'In some Philippine regions, it is referred to as "Sawa"', 'Animalia', '2025-06-18 02:11:18', 2, '2025-06-18 02:11:18', 2, 'active', 0, 'Chordata', 'Reptilia', 'Squamata', 'Pythonidae', 'Malayopython', 'reticulatus?', 'Least Concern (LC)', 'The Reticulated Python is renowned as the world\'s longest snake, with some individuals exceeding 6 meters in length. It possesses a distinctive net-like pattern on its skin, featuring a complex geometric design of black, brown, and gold hues. This non-venomous constrictor subdues its prey by coiling around it and suffocating it. Despite its formidable size, it is known for its excellent swimming abilities and adaptability to various habitats.', 'This species thrives in diverse environments such as rainforests, woodlands, grasslands, and areas adjacent to rivers and lakes. Its affinity for water bodies makes the Lake Mainit region a suitable habitat.', 'Prefers clean freshwater sources; its presence can indicate a healthy aquatic ecosystem.', 'Widely distributed across Southeast Asia, including the Philippines, with confirmed populations in Mindanao.', 'No direct impact; however, by controlling rodent populations, it indirectly benefits agriculture and food storage.', 'As an apex predator, it plays a crucial role in maintaining the balance of the ecosystem by regulating prey populations.', 'By preying on various animals, it facilitates nutrient redistribution within the ecosystem.', 6, '1746328555_38f3e41c8c22c79cd6ef.png', 'While specific studies on Malayopython reticulatus in Lake Mainit are limited, its presence has been documented in the broader Mindanao region, including areas like Mt. Hilong-hilong in Agusan del Norte, which is part of the Lake Mainit watershed.', 'An ambush predator, it feeds on a variety of mammals and birds. Smaller individuals consume rodents and bats, while larger ones can prey on civets, pigs, and deer.', 'Solitary by nature, interactions occur primarily during the breeding season.', 'â€¢ Sanguila, M.B., et al. (2016). The amphibians and reptiles of Mindanao Island, southern Philippines. ZooKeys, (624), 1â€“132. \r\n\r\nâ€¢ Murray-Dickson, G., et al. (2017). Phylogeography of the reticulated python (Malayopython reticulatus): Conservation implications for the world\'s most traded snake species. PLoS ONE, 12(8), e0182049. \r\n\r\nâ€¢ A-Z Animals. Reticulated Python Animal Facts - Malayopython reticulatus.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.58098,"lng":125.476387},{"lat":9.343924,"lng":125.516869}]', 'Oviparous, laying clutches of 15 to 80 eggs. Females exhibit maternal care by coiling around the eggs to regulate temperature until hatching.', 'In some Filipino communities, the Reticulated Python holds cultural importance, featuring in folklore and traditional beliefs.', 'Helps control populations of certain species, preventing overpopulation and associated ecological issues.', 'Occupies a top-tier position, influencing the population dynamics of prey species and serving as a food source for larger predators during its juvenile stages.', 'Currently listed as Least Concern by the IUCN; however, habitat loss and hunting pressures necessitate regular monitoring.', 'Conservation of forested areas and wetlands around Lake Mainit is vital for sustaining healthy populations.', 'Implementing community-based conservation programs and educating locals about the ecological benefits of the species can aid in its protection.', NULL, NULL, NULL),
	(76, 'species/76/6 Cyrtodactylus agusanensis 1.png', 'Mindanao Bow-Fingered Gecko', NULL, '.', 'Cyrtodactylus agusanensis', 'Mindanao Bow-Fingered Gecko', 'No widely recorded local name', 'Animalia', '2025-06-18 02:12:19', 2, '2025-06-18 02:12:19', 2, 'active', 0, 'Chordata', 'Reptilia', 'Squamata', 'Gekkonidae', 'Cyrtodactylus', 'agusanensis?', 'Least Concern (LC)', 'The Mindanao Bow-Fingered Gecko is a small, nocturnal lizard endemic to the southern Philippines. It exhibits a slender body with a distinctive pattern of dark and light bands across its back and tail. The species is characterized by its curved digits, which aid in climbing. Adults typically reach a snoutâ€“vent length of approximately 60â€“80 mm. Its coloration provides effective camouflage against the forest floor and tree bark.', 'Prefers lowland and montane forests, often found in moist environments with abundant leaf litter and undergrowth. It is typically associated with undisturbed or minimally disturbed forest habitats.', 'Thrives in humid conditions; proximity to clean freshwater sources like streams and wetlands supports its habitat preferences.', 'Endemic to the Philippines, specifically recorded in eastern Mindanao, including Agusan del Sur Province.', 'No direct impact on fisheries; however, by controlling insect populations, it may indirectly benefit agriculture.', 'Serves as both predator and prey within the ecosystem, aiding in maintaining ecological balance by controlling insect populations and serving as food for larger predators.', 'By preying on insects and being preyed upon by larger animals, it plays a role in nutrient transfer within the ecosystem.', 6, '1746328806_d024b20d5b9844334869.png', 'While specific records of Cyrtodactylus agusanensis in Lake Mainit are limited, its presence in the surrounding regions of Mindanao suggests potential habitation in the area.', 'Primarily insectivorous, feeding on a variety of small invertebrates such as insects and spiders. It forages at night, utilizing its keen eyesight and agility to capture prey.', 'Solitary and territorial; individuals are often observed alone, especially during foraging activities.', 'â€¢ Sanguila, M.B., et al. (2016). The amphibians and reptiles of Mindanao Island, southern Philippines. ZooKeys, (624), 1â€“132. \r\nWelton, L.J., et al. (2010). Philippine Bent-Toed Geckos of the Cyrtodactylus agusanensis Complex: Multilocus Phylogeny, Morphological Diversity, and Descriptions of Three New Species. Herpetological Monographs, 24(1), 55â€“85. \r\n\r\nâ€¢ The Reptile Database. Cyrtodactylus agusanensis. \r\n\r\nâ€¢ iNaturalist. Cyrtodactylus agusanensis (Mindanao Bow-Fingered Gecko). \r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.58335,"lng":125.472583},{"lat":9.342569,"lng":125.514442}]', 'Oviparous, laying eggs in concealed, moist locations. Clutch size is typically two eggs, and breeding may occur year-round in favorable conditions.', 'Not prominently featured in local folklore or traditions.', 'Contributes to controlling insect populations, potentially benefiting plant health and forest regeneration.', 'Occupies a mid-level trophic position, linking primary consumers and higher predators.', 'Currently listed as Least Concern by the IUCN; however, habitat loss due to deforestation and land conversion necessitates regular monitoring.', 'Preservation of forested areas around Lake Mainit is crucial for its continued survival.', 'Promoting sustainable land use and minimizing deforestation will support the species\' habitat requirements.', NULL, NULL, NULL),
	(77, 'species/77/7 Cyrtodactylus annulatus 1.png', 'Annulated Bow-Fingered Gecko', NULL, '.', 'Cyrtodactylus annulatus', 'Annulated Bow-Fingered Gecko', 'No widely recognized local name', 'Animalia', '2025-06-18 02:12:35', 2, '2025-06-18 02:12:35', 2, 'active', 0, 'Chordata', 'Reptilia', 'Squamata', 'Gekkonidae', 'Cyrtodactylus', 'annulatus?', 'Least Concern (LC)', 'The Annulated Bow-Fingered Gecko is a small, nocturnal lizard endemic to the Philippines. It exhibits a slender body with distinctive annulated (ring-like) patterns across its back and tail. The species is characterized by its curved digits, which aid in climbing. Adults typically reach a snoutâ€“vent length of approximately 60â€“80 mm. Its coloration provides effective camouflage against the forest floor and tree bark.', 'Prefers lowland and montane forests, often found in moist environments with abundant leaf litter and undergrowth. It is typically associated with undisturbed or minimally disturbed forest habitats.', 'Thrives in humid conditions; proximity to clean freshwater sources like streams and wetlands supports its habitat preferences.', 'Endemic to the Philippines, specifically recorded in Mindanao and other islands such as Bohol, Cebu, and Siquijor.', 'No direct impact on fisheries; however, by controlling insect populations, it may indirectly benefit agriculture.', 'Serves as both predator and prey within the ecosystem, aiding in maintaining ecological balance by controlling insect populations and serving as food for larger predators.', 'By preying on insects and being preyed upon by larger animals, it plays a role in nutrient transfer within the ecosystem.', 6, '1746329197_7fc04e110b0c83db3e41.png', 'While specific records of Cyrtodactylus annulatus in Lake Mainit are limited, its presence in the surrounding regions of Mindanao suggests potential habitation in the area.', 'Primarily insectivorous, feeding on a variety of small invertebrates such as insects and spiders. It forages at night, utilizing its keen eyesight and agility to capture prey.', 'Solitary and territorial; individuals are often observed alone, especially during foraging activities.', 'â€¢ Welton, L.J., Siler, C.D., Diesmos, A.C., & Brown, R.M. (2009). A New Bent-Toed Gecko (Genus Cyrtodactylus) from Southern Palawan Island, Philippines and Clarification of the Taxonomic Status of C. annulatus. Herpetologica, 65(3), 328â€“343.\r\n\r\nâ€¢ Sanguila, M.B., et al. (2016). The amphibians and reptiles of Mindanao Island, southern Philippines. ZooKeys, (624), 1â€“132.\r\n\r\nâ€¢ The Reptile Database. Cyrtodactylus annulatus. Retrieved from https://reptile-database.reptarium.cz/species?genus=Cyrtodactylus&species=annulatus\r\n\r\nâ€¢ iNaturalist. Cyrtodactylus annulatus (Annulated Bow-Fingered Gecko). Retrieved from https://www.inaturalist.org/taxa/33341-Cyrtodactylus-annulatus\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.584298,"lng":125.471932},{"lat":9.343857,"lng":125.518246}]', 'Oviparous, laying eggs in concealed, moist locations. Clutch size is typically two eggs, and breeding may occur year-round in favorable conditions.', 'Not prominently featured in local folklore or traditions.', 'Contributes to controlling insect populations, potentially benefiting plant health and forest regeneration.', 'Occupies a mid-level trophic position, linking primary consumers and higher predators.', 'Currently listed as Least Concern by the IUCN; however, habitat loss due to deforestation and land conversion necessitates regular monitoring.', 'Preservation of forested areas around Lake Mainit is crucial for its continued survival.', 'Promoting sustainable land use and minimizing deforestation will support the species\' habitat requirements.', NULL, NULL, NULL),
	(78, 'species/78/8 Eutropis multifasciata 1.png', 'Common Sun Skink / Many-lined Sun Skink', NULL, '.', 'Eutropis multifasciata', 'Common Sun Skink / Many-lined Sun Skink', 'Bubuli', 'Animalia', '2025-06-18 02:13:40', 2, '2025-06-18 02:13:40', 2, 'active', 0, 'Chordata', 'Reptilia', 'Squamata', 'Scincidae', 'Eutropis', 'E. multifasciata', 'Least Concern (LC)', 'Eutropis multifasciata is a medium-sized skink characterized by a robust, cylindrical body, smooth overlapping scales, and well-developed limbs with five digits. Its dorsal coloration ranges from brown to olive, often adorned with multiple dark longitudinal stripes or lines. The ventral side is typically lighter, and some individuals exhibit a reddish or orange hue on the flanks. The tail is long and tapering, aiding in balance and locomotion.', NULL, '', NULL, NULL, NULL, NULL, 6, '1746329399_6204902edeff5bc4b737.png', NULL, NULL, NULL, 'Local (Philippine-based) Research Journals:\r\n\r\nâ€¢ Naelga, J. C., Tayag, D. R. P., YaÃ±ez, H. L., & Sinco, A. L. (2018). Diversity of Squamates in Selected Urban Areas of Cagayan de Oro City, Misamis Oriental. Research Journal of Pharmaceutical, Biological and Chemical Sciences, 9(3), 1348â€“1350. \r\n\r\nInternational Research Journals:\r\n\r\nâ€¢ Kumar, T., Khairuddin, N. S. K., & Das, I. (2025). Interpopulation dietary comparisons in the common sun skink, Eutropis multifasciata (Squamata: Scincidae). Raffles Bulletin of Zoology, 73, 184â€“192. \r\n\r\nâ€¢ Janssen, J., & Gomez, L. (2019). Common Sun Skink Eutropis multifasciata (Kuhl 1820) sold for Traditional Medicine in Indonesia and potential conservation implications. Ethnobiology and Conservation, 8:14. \r\n\r\nâ€¢ Rochford, M. R., Ketterlin, J. K., Vinci, J., Alexander, D. T., & Mazzotti, F. J. (2018). The Many-lined Sun Skink, Eutropis multifasciata (Kuhl 1820) (Mabuyidae), a new population in Broward County, Florida. Reptiles & Amphibians, 25(3), 217â€“219.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.588089,"lng":125.472289},{"lat":9.342231,"lng":125.515515}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(79, 'species/79/9 Hydrosaurus pustulatus 1.png', 'Philippine Sailfin Lizard', NULL, '.', 'Hydrosaurus pustulatus', 'Philippine Sailfin Lizard', 'Layagan, Balubid, Ibid', 'Animalia', '2025-06-18 02:14:01', 2, '2025-06-18 02:14:01', 2, 'active', 0, 'Chordata', 'Reptilia', 'Squamata', 'Agamidae', 'Hydrosaurus', 'H. pustulatus', 'Least Concern (LC)', 'Detailed Description:\r\nThe Philippine Sailfin Lizard is a large, semi-aquatic agamid lizard endemic to the Philippines. Males can reach lengths of up to 1 meter, while females are slightly smaller. They are characterized by a prominent sail-like crest on their tails, which is more pronounced in males. Their coloration varies from gray-brown to olive-green, often with lighter patterns. They possess strong limbs with long toes adapted for swimming.', NULL, '', NULL, NULL, NULL, NULL, 6, '1746329535_38443f8d888a12b3940a.png', NULL, NULL, NULL, 'Local (Philippine-based) Research Journals:\r\n\r\nâ€¢ Heinrich, S., Toomes, A., & Janssen, J. (2021). Legal or unenforceable? Violations of trade regulations and the case of the Philippine Sailfin Lizard Hydrosaurus pustulatus (Reptilia: Squamata: Agamidae). Journal of Threatened Taxa, 13(6), 18532â€“18543. â€‹ \r\n\r\nInternational Research Journals:\r\n\r\nâ€¢ Siler, C. D., Lira-Noriega, A., & Brown, R. M. (2014). Conservation genetics of Australasian sailfin lizards: Flagship species threatened by coastal development and insufficient protected area coverage. Biological Conservation, 169, 100â€“108. â€‹ \r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.585957,"lng":125.471878},{"lat":9.343823,"lng":125.515262}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(80, 'species/80/10 Prasinohaema virens 1.png', 'Green Tree Skink, Green-blooded Skink', NULL, '.', 'Prasinohaema virens', 'Green Tree Skink, Green-blooded Skink', 'Not documented in the Philippines', 'Animalia', '2025-06-18 02:14:19', 2, '2025-06-18 02:14:19', 2, 'active', 0, 'Chordata', 'Reptilia', 'Squamata', 'Scincidae', 'Prasinohaema', 'P. virens', 'Least Concern (LC)', 'Prasinohaema virens is a small, arboreal skink notable for its vivid green coloration and unique physiological traitâ€”green blood. This green pigmentation extends to its muscles, bones, and mucosal tissues, resulting from high concentrations of biliverdin, a bile pigment typically toxic in vertebrates. The species has developed setae on its toe pads, enhancing its climbing abilities, a trait that evolved independently from similar structures in geckos and anoles.', NULL, '', NULL, NULL, NULL, NULL, 6, '1746329731_2e670a91eea987490716.png', NULL, NULL, NULL, 'Local (Philippine-based) Research Journals:\r\n\r\nâ€¢ No local studies available, as P. virens is not native to the Philippines.\r\n\r\nInternational Research Journals:\r\n\r\nâ€¢ Austin, C. C., & Jessing, K. W. (1994). Green-blood pigmentation in lizards. Comparative Biochemistry and Physiology Part A: Physiology, 109(3), 619â€“626.\r\n\r\nâ€¢ Grens, K. (2018). Lizards\' Green Blood Evolved Four Times. The Scientist. Retrieved from https://www.the-scientist.com/news-opinion/lizards-green-blood-evolved-four-times-6415 \r\n\r\nâ€¢ Prasinohaema virens. (n.d.). In Wikipedia. Retrieved from https://en.wikipedia.org/wiki/Prasinohaema_virens\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.585043,"lng":125.474687},{"lat":9.342817,"lng":125.516539}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(81, 'species/81/1 Shorea astylosa 1.png', 'Yakal', NULL, NULL, 'Shorea astylosa', 'Yakal', 'Plantae', 'Plantae', '2025-06-16 13:35:36', 1, '2025-06-16 13:35:36', 1, 'active', 0, 'Angiosperms', 'Dicotyledonae', 'Theales', 'Dipterocarpaceae', 'Shorea', 'astylosa', 'Vulnerable (VU)', 'Shorea astylosa, known locally as Yakal, is a large tree species endemic to the Philippines. This species grows to heights of up to 50 meters, with a wide trunk that can reach diameters of over 2 meters. The bark is typically thick, rough, and greyish-brown, often covered with small, scaly plates. The leaves are leathery, dark green, and elliptical, with prominent veins. Shorea astylosa produces large, cream-colored flowers that bloom in clusters. The wood is heavy, durable, and resistant to rot, making it valuable for construction and carpentry.', 'This tree species is typically found in primary and secondary tropical rainforests, often in mixed forest environments. It thrives in areas with high rainfall and humidity.', 'The species is indirectly reliant on good water quality in the surrounding environment for the proper growth of its host forest ecosystem, though it does not require proximity to water bodies.', 'Endemic to the Philippines, Shorea astylosa is most commonly found in Mindanao, particularly around Lake Mainit, where it grows in both protected and disturbed forests.', 'While Shorea astylosa does not directly contribute to local fisheries, the species is integral to maintaining the overall health of the forest ecosystem, which indirectly supports aquatic habitats around Lake Mainit.', 'The timber of Shorea astylosa has significant commercial value, particularly for use in building infrastructure and crafting durable goods.', 'Shorea astylosa plays a crucial role in the local ecosystem by contributing to nutrient cycling through its large biomass and leaf litter. It enriches the soil and provides habitat for various organisms.', 7, '1746330204_51d3eb9792ecf1c699a0.png', 'Shorea astylosa is found in the forests around Lake Mainit, predominantly in the mountainous regions and on slopes where fertile, well-drained soils prevail.', 'As a tree species, Shorea astylosa does not have feeding habits in the traditional sense. However, it plays a role in the local ecology by providing food and shelter for various species of insects, birds, and mammals.', 'This tree serves as an important provider of shelter and food in the forest ecosystem. It is also crucial for soil stabilization, helping to prevent erosion in areas with steep slopes.', 'â€¢ Brown, G. J., & Simons, P. (2019). "Conservation of Shorea species in Southeast Asia." Journal of Tropical Botany.\r\n\r\nâ€¢ International Union for Conservation of Nature (IUCN), (2021). "The conservation status of Shorea species." Global Environmental Review.\r\n\r\nâ€¢ Lopez, J. R., & Ramos, D. M. (2018). "Endemic Flora of the Philippines: The Case of Shorea astylosa." Philippine Forest Journal, 11(4), 255-263.\r\n\r\nâ€¢ Photo credit to iNaturalist', NULL, 'Shorea astylosa reproduces sexually through the production of flowers that attract various pollinators, including bees and butterflies. Its seeds are dispersed by the wind and potentially by animals, aiding in forest regeneration.', 'The wood of Shorea astylosa is highly prized for its durability and is used in construction and furniture making. It holds cultural importance for local communities that rely on it for traditional practices and materials.', 'As a dominant tree species, Shorea astylosa can influence the plant community around it by providing shade and altering the local microenvironment. It supports various species of birds, insects, and mammals.', 'Shorea astylosa supports numerous species by providing nectar, shelter, and food. Its fruit is consumed by animals, and its leaves support various herbivores and pollinators.', 'There is a need to monitor the populations of Shorea astylosa, as over-harvesting of timber and habitat loss due to logging pose significant threats to its survival.', 'Preserving the natural forests around Lake Mainit is crucial for maintaining the populations of Shorea astylosa and other native species. Forest conservation efforts should focus on preventing deforestation and promoting sustainable forest management practices.', 'Encouraging the sustainable use of Shorea astylosa timber and supporting reforestation programs are key to ensuring the long-term survival of this species.', NULL, NULL, NULL),
	(82, 'species/82/rafflesia mixta.png', 'Rafflesia mixta', NULL, '.', 'Rafflesia mixta', 'Rafflesia mixta', '(If applicable, please insert the local name)', 'Plantae', '2025-06-20 14:13:58', 2, '2025-06-20 14:13:58', 2, 'active', 0, 'Angiosperms', 'Dicotyledonae', 'Malpighiales', 'Rafflesiaceae', 'Rafflesia', 'mixta', 'Endangered (EN)', 'Rafflesia mixta is a species of flowering plant known for its massive, foul-smelling flowers. It is one of the largest flowers in the world, and its blooms can reach up to 70 cm in diameter. The flower has a deep red color with white specks, resembling a rotting carcass, which is why it is often referred to as the "corpse flower." The plant is parasitic, attaching itself to the roots of host vines, typically in the rainforests of Southeast Asia. It lacks leaves, stems, and roots, living entirely off the host plant.', 'This species thrives in the tropical rainforest environment, typically in moist, shaded areas with high humidity. It grows on the roots of certain vines and is often found in isolated patches within dense forest.', 'Rafflesia mixta depends on consistent moisture in the environment, and thus, the quality and availability of water are critical to its survival.', 'Endemic to the Philippines, particularly in Mindanao, Rafflesia mixta is found in rainforests and secluded forest patches around Lake Mainit.', 'While Rafflesia mixta does not directly affect local fisheries, its presence in the forest ecosystem contributes to the overall health of the environment, which indirectly supports the aquatic life around Lake Mainit.', 'Rafflesia mixta has no significant direct economic value, but it contributes to ecotourism, attracting botanists and tourists interested in rare and unusual plant species.', 'As a parasitic plant, Rafflesia mixta affects the nutrient dynamics of its host plant. Though it does not contribute to the soil directly, it is a part of the overall nutrient cycling within the forest ecosystem.', 5, '1746330642_e712bee0079b88d8ac8a.png', 'Rafflesia mixta is found in the lowland rainforests of Mindanao, including the forested areas around Lake Mainit.', 'As a parasitic plant, Rafflesia mixta does not photosynthesize. Instead, it depends entirely on its host vine for nutrients and water, attaching to the hostâ€™s roots through specialized structures.', 'Rafflesia mixta plays an important role in the biodiversity of the rainforests around Lake Mainit by adding to the variety of plant life, despite its parasitic nature. It is an indicator of a healthy, undisturbed rainforest ecosystem.', 'â€¢ Ang, G. L., & Dimalanta, R. L. (2020). "Rafflesia Species in the Philippines: Conservation Status and Ecological Significance." \r\n\r\nâ€¢Philippine Botanical Journal, 23(2), 113-126.\r\n International Union for Conservation of Nature (IUCN), (2021). "The conservation status of Rafflesia mixta." Global Environmental Review.\r\n\r\nâ€¢ Smithsonian Conservation Biology Institute. (2020). "The Role of Parasitic Plants in Biodiversity." Smithsonian Journal of Botany.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.583925,"lng":125.473236}]', 'The flowers of Rafflesia mixta are pollinated by carrion-feeding beetles, which are attracted to the smell of rotting flesh emitted by the flower. This distinctive smell is part of its strategy to attract the pollinators.', 'Rafflesia mixta is regarded as a rare and fascinating species in the Philippines, often featured in local folklore and conservation discussions. Its striking appearance and rarity make it a symbol of natural wonder.', 'Rafflesia mixta can affect the host plant, potentially weakening or killing it, though this typically does not have a large-scale impact on the overall forest biodiversity.', 'The species is an important food source for carrion-feeding beetles and other insects that are attracted to its flowers, thus playing a role in the local food web.', 'Rafflesia mixta is a rare and endangered species, and its populations need to be carefully monitored. Habitat destruction due to logging and agricultural expansion poses a major threat.', 'Protecting the remaining rainforest habitats around Lake Mainit is crucial for the survival of Rafflesia mixta. Efforts should focus on preserving natural areas from deforestation and other environmental pressures.', 'Sustainable land-use practices, such as eco-friendly logging and promoting forest conservation, are essential for maintaining the habitats that Rafflesia mixta depends on.', NULL, NULL, NULL),
	(83, 'species/83/3 Cyathea contaminans 1.png', 'Anotong', NULL, NULL, 'Cyathea contaminans', 'Anotong', 'Anotong', 'Plantae', '2025-06-16 13:44:01', 1, '2025-06-16 13:44:01', 1, 'active', 0, 'Pteridophyta', 'Polypodiopsida', 'Cyatheales', 'Cyatheaceae', 'Cyathea', 'contaminans', 'Least Concern (LC)', 'Cyathea contaminans, commonly known as Anotong, is a species of tree fern characterized by its large, arborescent form. It typically grows to a height of 10â€“20 meters. The trunk is thick, erect, and covered with scales. The fronds are large, finely divided, and have a feather-like appearance, with a glossy green color that becomes darker as the fronds mature. The sporangia are clustered on the underside of the fronds. Anotong is known for its role in forest undergrowth, thriving in the humid and shaded environments typical of tropical forests.', 'Cyathea contaminans thrives in moist, shaded forested environments, often near streams or in swampy areas where the soil remains consistently moist', '', 'Indigenous to the Philippines, this species is particularly found in the southern regions, including areas around Lake Mainit.', 'While Cyathea contaminans is not widely used for commercial purposes, its fronds are sometimes used in traditional Filipino crafts and decoration due to their attractive appearance.', NULL, 'Cyathea contaminans helps in soil stabilization by forming dense root systems that prevent erosion, particularly in moist and waterlogged forest areas.', 7, '1746330932_acdda97050f075faf597.png', 'Found primarily in the lowland forests surrounding Lake Mainit. It prefers humid, shaded areas and is often found in the understory of montane or tropical rainforests.', 'Cyathea contaminans grows slowly and is generally found in the undergrowth of tropical forests. It contributes to the vertical stratification of forest habitats by providing ground cover and shelter for various small organisms.', NULL, 'â€¢ Bracken, R. (2017). The Ferns of the Philippines: A Field Guide. Manila: Philippine University Press.\r\n\r\nâ€¢ Fernandez, M. (2015). Tropical Ferns of Southeast Asia. Philippine Botanical Journal.\r\n\r\nâ€¢ IUCN Red List (2021). Cyathea contaminans. International Union for Conservation of Nature.\r\n\r\nâ€¢ Photo credit to iNaturalist', NULL, 'As a tree fern, it plays an essential role in maintaining the moisture levels in the forest environment, providing a microhabitat for moisture-loving organisms such as amphibians and insects. It is also a significant part of the forest\'s nutrient cycle.', 'The tree fern is part of traditional Filipino knowledge of plant species, with some indigenous communities using ferns like Cyathea in rituals or as ornamental plants.', 'The tree fern\'s dense fronds provide habitat and shelter for many small forest creatures, playing an indirect role in the biodiversity of Lake Mainitâ€™s forest ecosystems.', NULL, 'Currently not listed as a threatened species, Cyathea contaminans is monitored primarily for habitat conservation, especially in the face of deforestation and habitat degradation.', 'Habitat preservation is crucial, and efforts to conserve tropical rainforests and montane ecosystems help maintain healthy populations of this tree fern.', NULL, NULL, NULL, NULL),
	(84, 'species/84/5 Pterocarpus indicus 1.png', 'Narra', NULL, NULL, 'Pterocarpus indicus', 'Narra', 'Narra', 'Plantae', '2025-06-16 13:43:55', 1, '2025-06-16 13:43:55', 1, 'active', 0, 'Angiosperms', 'Dicotyledonae', 'Fabales', 'Fabaceae', 'Pterocarpus', 'indicus', 'Near Threatened (NT)', 'Narra is a large, evergreen tree that can grow up to 30â€“40 meters tall. The tree has a broad, spreading canopy with compound leaves. The flowers are yellow, fragrant, and arranged in dense clusters. The fruit is a flattened, winged pod that disperses seeds when it matures. The wood of Pterocarpus indicus is highly prized for its fine grain, reddish-brown color, and durability. Narra wood is used in furniture making, carving, and building construction.', 'Narra prefers well-drained soils in tropical lowland forests, often growing along riverbanks or in areas with high rainfall.', 'Pterocarpus indicus is indigenous to Southeast Asia, with notable populations in the Philippines, including Mindanao.', NULL, NULL, NULL, NULL, 7, '1746331352_42b31fa8749db5808fe0.png', 'Pterocarpus indicus is found throughout the lowland and montane forests of Mindanao, including the areas surrounding Lake Mainit.', NULL, NULL, 'â€¢ Philippine Forest Research Institute (2020). Afzelia rhomboidea: A Comprehensive Study. Manila: Department of Environment and Natural Resources.\r\n\r\nâ€¢  IUCN Red List (2021). Afzelia rhomboidea. International Union for Conservation of Nature.\r\n\r\nâ€¢ Photo credit to iNaturalist', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(85, 'species/85/6 Diospyros philippinensis 1.png', 'Kamagong', NULL, NULL, 'Diospyros philippinensis', 'Kamagong', 'Kamagong', 'Plantae', '2025-06-16 13:43:00', 1, '2025-06-16 13:43:00', 1, 'active', 0, 'Angiosperms', 'Dicotyledonae', 'Ericales', 'Ebenaceae', 'Diospyros', 'philippinensis', 'Vulnerable (VU)', 'Diospyros philippinensis, commonly known as Kamagong, is a small to medium-sized tree that can grow up to 25 meters in height. It is renowned for its extremely hard, dark-colored wood, often referred to as "ironwood" due to its density and durability. The tree has a straight trunk with smooth, dark brown to black bark, and its leaves are glossy, elliptical, and leathery. Kamagong produces small, inconspicuous flowers, with male and female reproductive organs on separate trees (dioecious). The fruit is a berry-like drupe, which is green when unripe and turns dark purple when mature.', 'This species thrives in tropical forests, often in areas with high rainfall and humidity. It is typically found in primary and secondary forests, particularly in disturbed forest ecosystems.', '', 'Native to the Philippines, Diospyros philippinensis is found across various regions of the country, especially in Mindanao, including the areas surrounding Lake Mainit.', NULL, NULL, NULL, 7, '1746331597_cb6602a4ab4a340c119c.png', 'Diospyros philippinensis is found in the lowland and montane forests around Lake Mainit, specifically in areas with rich, fertile soils.', NULL, NULL, 'â€¢ Philippine Department of Environment and Natural Resources (2020). Diospyros philippinensis: Ecological and Economic Contributions. Manila: DENR.\r\n\r\nâ€¢ IUCN Red List (2021). Diospyros philippinensis. International Union for Conservation of Nature.\r\n\r\nâ€¢ Photo credit to iNaturalist', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(86, 'species/86/7 Homalomera philippinensis 1.png', 'Payaw', NULL, NULL, 'Homalomera philippinensis', 'Payaw', 'Payaw', 'Plantae', '2025-06-16 13:42:42', 1, '2025-06-16 13:42:42', 1, 'active', 0, 'Angiosperms', 'Dicotyledonae', 'Sapindales', 'Sapindaceae', 'Homalomera', 'philippinensis', 'Least Concern (LC)', 'Homalomera philippinensis, commonly known as Payaw, is a large, evergreen tree that can grow up to 30 meters tall. The tree has a distinctive appearance with glossy, dark green leaves and thick, leathery foliage. The flowers are small and clustered, typically pink to reddish in color. The fruit is a capsule that splits open when mature, releasing numerous small seeds. Payaw is primarily known for its wood, which is used for construction and crafting purposes.', 'This species thrives in lowland and montane forests, often growing along riverbanks or in humid environments where there is consistent rainfall', 'Homalomera philippinensis is found across the Philippines, including Mindanao, where it contributes to the biodiversity of the local ecosystems.', NULL, NULL, NULL, NULL, 7, '1746331819_eab46b9f3d54bdde68ea.png', 'Homalomera philippinensis is native to tropical forests in the Philippines, particularly in the region surrounding Lake Mainit.', NULL, NULL, 'â€¢ Philippine Department of Environment and Natural Resources (2021). Homalomera philippinensis: An Overview of its Role in Philippine Forests. Manila: DENR.\r\n\r\nâ€¢ IUCN Red List (2021). Homalomera philippinensis. International Union for Conservation of Nature.\r\n\r\nâ€¢ Photo credit to iNaturalist', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(87, 'species/87/8 Musa acuminata 1.png', 'Paguha', NULL, NULL, 'Musa acuminata', 'Paguha', 'Paguha', 'Plantae', '2025-06-16 13:41:47', 1, '2025-06-16 13:41:47', 1, 'active', 0, 'Angiosperms', 'Monocotyledonae', 'Zingiberales', 'Musaceae', 'Musa', 'acuminata', 'Least Concern (LC)', 'Musa acuminata, commonly known as Paguha in the Philippines, is a species of banana plant characterized by its tall stature, reaching heights of 3â€“7 meters. The plant has large, broad leaves with a smooth, waxy texture. The inflorescence is large, with bright yellow to purple flowers arranged in a cluster. The fruit of the Musa acuminata is the well-known banana, which has a sweet flavor and is eaten both raw and cooked.', 'This species thrives in humid, tropical environments with well-drained soils. It is often found in areas with consistent rainfall and warm temperatures.', '', 'Native to Southeast Asia, Musa acuminata is cultivated throughout the Philippines, including the Lake Mainit region.', NULL, NULL, NULL, 7, '1746331966_51e28b1f3b2e7da3fd43.png', 'Musa acuminata is widely cultivated in agricultural areas around Lake Mainit, as bananas are a staple crop in the region.', NULL, NULL, 'â€¢ Photo credit to iNaturalist', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(88, 'species/88/9 Paraserianthes falcata 1.png', 'Falcata', NULL, NULL, 'Paraserianthes falcata', 'Falcata', 'Falcata', 'Plantae', '2025-06-16 13:42:34', 1, '2025-06-16 13:42:34', 1, 'active', 0, 'Angiosperms', 'Dicotyledonae', 'Fabales', 'Fabaceae', 'Paraserianthes', 'falcata', 'Least Concern (LC)', 'Paraserianthes falcata, commonly known as Falcata, is a medium-sized tree species that typically grows to a height of 10 to 20 meters. The tree has a straight trunk and smooth bark. Its compound leaves are large, bipinnate, and bright green. The tree produces striking yellow flowers in long clusters, which are highly attractive to pollinators like bees. The fruit is a flat, leguminous pod containing multiple seeds. Falcata wood is highly prized for its use in construction and as a source of timber for various applications.', 'This species grows in tropical and subtropical climates, thriving in a range of habitats, including grasslands, forest margins, and agricultural land.', '', 'Indigenous to Southeast Asia, including the Philippines, Paraserianthes falcata is widely distributed in the Philippines, especially in Mindanao and around Lake Mainit.', NULL, NULL, NULL, 7, '1746332305_0a434091b29c4cd7294c.png', 'Paraserianthes falcata is found in the lowland and montane forests around Lake Mainit, particularly in disturbed or secondary forests and along roadsides.', NULL, NULL, 'â€¢ Philippine Department of Environment and Natural Resources (2021). Paraserianthes falcata: Ecological and Economic Uses in the Philippines. Manila: DENR.\r\n\r\nâ€¢ IUCN Red List (2021). Paraserianthes falcata. International Union for Conservation of Nature.\r\n\r\nâ€¢ Photo credit to iNaturalist', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(89, 'species/89/10 Shorea negronensis 1.png', 'Red Lawaan', NULL, NULL, 'Shorea negrosensis', 'Red Lawaan', 'Red Lawaan', 'Plantae', '2025-06-16 13:35:54', 1, '2025-06-16 13:35:54', 1, 'active', 0, 'Angiosperms', 'Dicotyledonae', 'Theales', 'Dipterocarpaceae', 'Shorea', 'negrosensis', 'Vulnerable (VU)', 'Shorea negrosensis, commonly known as Red Lawaan, is a large evergreen tree that typically grows up to 40 meters in height. The tree has a straight, cylindrical trunk with a reddish-brown bark. The leaves are large, ovate to lance-shaped, and have a glossy texture. The flowers of Shorea negrosensis are yellowish-white and occur in dense clusters. Its fruits are winged and are dispersed by wind. The timber of Red Lawaan is highly prized for its strength and durability and is widely used in construction, furniture making, and boat building.', 'This species thrives in tropical rainforests and is typically found in primary and secondary forest areas with stable climates and ample rainfall.', '', 'Endemic to the Philippines, Shorea negrosensis is primarily found in Mindanao and the Visayas regions, including the vicinity of Lake Mainit.', NULL, NULL, NULL, 7, '1746332519_ff1c097570b0d5e321e9.png', 'Shorea negrosensis is commonly found in the lowland forests surrounding Lake Mainit, particularly in areas with rich, fertile soils.', NULL, NULL, 'â€¢ Philippine Department of Environment and Natural Resources (2020). Shorea negrosensis: Conservation Strategies for Red Lawaan. Manila: DENR.\r\n\r\nâ€¢ IUCN Red List (2021). Shorea negrosensis. International Union for Conservation of Nature.\r\n\r\nâ€¢ Photo credit to iNaturalist', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(91, 'species/91/2 Hydrilla verticillata 1.png', 'Water Thyme', NULL, '.', 'Hydrilla verticillata', 'Water Thyme', 'Dugman', 'Plantae', '2025-06-18 02:06:51', 2, '2025-06-18 02:06:51', 2, 'active', 0, 'Tracheophyta', 'Liliopsida', 'Alismatales', 'Hydrocharitaceae', 'Hydrilla', 'verticillata', 'Least Concern (LC)', 'Hydrilla verticillata, locally known as Dugman, is a submerged aquatic plant with slender, branching stems that can reach up to 2.5 meters in length. Its leaves are arranged in whorls of 3â€“8, are small (5â€“20 mm long), and have serrated edges. Tiny white flowers emerge on long, thread-like stalks reaching the surface. The plant propagates through fragmentation and tuber formation, making it highly resilient.', 'Freshwater lakes and slow-moving rivers.', 'Tolerant of a wide range of water conditions but prefers eutrophic (nutrient-rich) environments.', 'Asia; naturalized in the Philippines and parts of Lake Mainit.', 'Provides shelter for juvenile fish and invertebrates.', 'Enhances biodiversity and oxygen production.', 'Absorbs excess nutrients, reducing algal blooms.', 5, '1746528915_551ecaa3a429ef41558d.jpg', 'Found in shallow regions of Lake Mainit, especially in nutrient-rich, calm areas.', 'Photosynthetic, absorbs nutrients from water and sediments.', 'Provides habitat for aquatic fauna and stabilizes sediments.', 'â€¢ Langeland, K. A. (1996). "Hydrilla verticillata: Biology and Impacts." Aquatic Botany, 53(3).\r\n\r\nâ€¢ Lake Mainit Development Alliance (2022). "Aquatic Flora of Lake Mainit." Annual Report. Global Invasive Species Database (2021). "Hydrilla verticillata."\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.433212,"lng":125.520461}]', 'Reproduces vegetatively via fragments and tubers, and sexually via seeds.', 'Recognized locally for its role in maintaining aquatic habitat quality.', 'Can outcompete native aquatic plants if unchecked.', 'Supports herbivores and detritivores.', 'Regular monitoring to control overgrowth.', 'Promote balanced nutrient management to prevent dominance.', 'Manual removal and use of native aquatic vegetation for balance.', NULL, NULL, NULL),
	(92, 'species/92/3 Eichhornia crassipes 1.png', 'Water Hyacinth', NULL, '.', 'Eichhornia crassipes', 'Water Hyacinth', 'Water Lily', 'Plantae', '2025-06-18 02:07:42', 2, '2025-06-18 02:07:42', 2, 'active', 0, 'Tracheophyta', 'Liliopsida', 'Commelinales', 'Pontederiaceae', 'Eichhornia', 'crassipes', 'Least Concern (LC)', 'Eichhornia crassipes is a free-floating perennial aquatic plant, notable for its glossy, rounded leaves and swollen bulbous petioles that aid buoyancy. The plant produces striking violet to lavender flowers with a distinct yellow mark on the upper petal. It forms dense mats on water surfaces, with a complex root system hanging beneath, which provides habitat for aquatic fauna.', 'Prefers still or slow-flowing freshwater bodies', 'Tolerant of a broad range of conditions, including eutrophic (high nutrient) waters.', 'Native to South America, introduced and naturalized in the Philippines.', 'Offers habitat for aquatic organisms, indirectly supporting fisheries.', 'Can act as a phytoremediator by absorbing pollutants.', 'Absorbs excess nutrients but can contribute to oxygen depletion.', 5, '1746529751_d4f9b17c7db0127d73d5.jpg', 'Found along the margins and slow-moving parts of Lake Mainit.', 'Photosynthetic, absorbing nutrients directly from water.', 'Provides refuge and breeding ground for fish and invertebrates', 'â€¢ Villamagna, A. M., & Murphy, B. R. (2010). "Ecological and socio-economic impacts of invasive water hyacinth (Eichhornia crassipes): a review." Freshwater Biology, 55(2).\r\n\r\nâ€¢ Lake Mainit Development Alliance (2022). "Aquatic Flora of Lake Mainit." Annual Report.\r\n\r\nâ€¢ Fernando, E. S. (2014). "Flora of the Philippines: Aquatic Plants." University of the Philippines Press.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.433754,"lng":125.523844}]', 'Reproduces rapidly via stolons and seed production.', 'Recognized by locals for its ornamental beauty despite its invasive potential.', 'Aggressive growth can outcompete native vegetation.', 'Provides food and habitat for invertebrates and some fish species.', 'Regular removal and monitoring to prevent overgrowth.', 'Control nutrient inputs to prevent eutrophication.', 'Promote mechanical harvesting and utilization (e.g., for composting or handicrafts).', NULL, NULL, NULL),
	(93, 'species/93/4 Pistia stratiotes 1.png', 'Water Lettuce', NULL, '.', 'Pistia stratiotes', 'Water Lettuce', '(No recorded local name in Lake Mainit, commonly referred to descriptively)', 'Plantae', '2025-06-18 02:09:19', 2, '2025-06-18 02:09:19', 2, 'active', 0, 'Tracheophyta', 'Liliopsida', 'Alismatales', 'Araceae', 'Pistia', 'stratiotes', 'Least Concern (LC)', 'Pistia stratiotes is a floating aquatic plant resembling a rosette of lettuce, with velvety, light green leaves covered in fine hairs to repel water. Its roots dangle below the surface, forming dense mats. Tiny, inconspicuous flowers are produced in the leaf axils. This species reproduces rapidly through vegetative offshoots.', 'Freshwater lakes, ponds, and rivers.', 'Prefers nutrient-rich waters, can tolerate varying pH and temperature.', 'Pantropical distribution, likely native to South America.', 'Enhances habitat complexity for juvenile fish.', 'Potential phytoremediation species.', 'Absorbs excess nutrients, helps mitigate eutrophication.', 5, '1746530116_7bbfa471c57a00f6ed91.jpg', 'Found floating in still waters and slow-flowing areas of Lake Mainit.', 'Photosynthetic, extracts nutrients from the water.', 'Provides habitat for fish fry and aquatic invertebrates.', 'â€¢ Center, T. D., et al. (2002). "Biology and control of aquatic plants: Pistia stratiotes." Aquatic Plant Control Technical Note.\r\n\r\nâ€¢ Lake Mainit Development Alliance (2022). "Aquatic Flora of Lake Mainit." Annual Report.\r\n\r\nâ€¢ Fernando, E. S. (2014). "Flora of the Philippines: Aquatic Plants." University of the Philippines Press.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.534124,"lng":125.523159},{"lat":9.492137,"lng":125.560901},{"lat":9.492137,"lng":125.472379},{"lat":9.423729,"lng":125.493652},{"lat":9.342434,"lng":125.521786},{"lat":9.409504,"lng":125.55198}]', 'Primarily vegetative reproduction via stolons; also produces seeds.', 'Limited ornamental and traditional use.', 'Can outcompete native plants if unchecked.', 'Base for detrital food chains and provides shade for aquatic life.', 'Controlled harvesting to maintain balance.', 'Reduce nutrient inflow from agriculture and settlements.', 'Explore uses for compost and livestock feed.', NULL, NULL, NULL),
	(94, 'species/94/5 Nelumbo nucifera 1.png', 'Sacred Lotus', NULL, '.', 'Nelumbo nucifera', 'Sacred Lotus', 'Paguse', 'Plantae', '2025-06-18 02:10:55', 2, '2025-06-18 02:10:55', 2, 'active', 0, 'Tracheophyta', 'Magnoliopsida', 'Proteales', 'Nelumbonaceae', 'Nelumbo', 'nucifera', 'Least Concern (LC)', 'Nelumbo nucifera is an emergent aquatic plant with large, round, peltate leaves that float or rise above the water surface. Its magnificent pink to white flowers are well-known symbols of purity in various cultures. The plant produces distinctive, spongy seed pods. Underground rhizomes anchor the plant and store nutrients, allowing seasonal regeneration.', 'Prefers shallow, muddy-bottomed freshwater bodies.', 'Thrives in nutrient-rich, sunlit waters.', 'Asia, widespread in tropical and subtropical regions, cultivated and naturalized in parts of the Philippines.', 'Supports biodiversity, attracting aquatic species.', 'Enhances aesthetic and ecological value of aquatic landscapes.', 'Uptakes nutrients from sediment and water, improving water clarity.', 5, '1746530410_51354fb2baf9dee30864.webp', 'Found in shallow, calm areas of Lake Mainit.', 'Photosynthetic, absorbs nutrients from water and sediment.', 'Stabilizes sediments, provides habitat, and supports pollinators.', 'â€¢ Chen, F., et al. (2007). "The Sacred Lotus, Nelumbo nuciferaâ€”Phytochemistry and Therapeutic Potential." Journal of Ethnopharmacology, 109(3).\r\n\r\nâ€¢ Lake Mainit Development Alliance (2022). "Aquatic Flora of Lake Mainit." Annual Report.\r\n\r\nâ€¢ Fernando, E. S. (2014). "Flora of the Philippines: Aquatic Plants." University of the Philippines Press.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.501957,"lng":125.472892},{"lat":9.535884,"lng":125.523045},{"lat":9.550443,"lng":125.477069},{"lat":9.582944,"lng":125.472265},{"lat":9.454277,"lng":125.569023}]', 'Reproduces sexually via seeds and vegetatively through rhizomes.', 'Revered for its beauty and symbolism; seeds and rhizomes are edible.', 'Generally beneficial, as it coexists with native flora.', 'Provides food for herbivorous species and habitat for aquatic organisms.', 'Promote cultivation while monitoring spread.', 'Maintain shallow water zones and prevent habitat degradation.', 'Encourage eco-tourism and sustainable harvesting of seeds and rhizomes.', NULL, NULL, NULL),
	(95, 'species/95/6 Ipomoea aquatica 1.png', 'Water Spinach', NULL, '.', 'Ipomoea aquatica', 'Water Spinach', 'Tangkong', 'Plantae', '2025-06-18 02:10:13', 2, '2025-06-18 02:10:13', 2, 'active', 0, 'Angiosperms', 'Eudicots', 'Solanales', 'Convolvulaceae', 'Ipomoea', 'aquatica', 'Not Evaluated (NE)', 'Ipomoea aquatica, commonly known as Water Spinach or "Tangkong" in the Philippines, is a fast-growing, semi-aquatic plant. It has broad, lance-shaped leaves, and its stems are green to reddish in color, often floating or sprawling along the waterâ€™s surface. This herbaceous plant thrives in wet conditions, with its roots submerged in shallow waters. The flowers are funnel-shaped, typically white or light purple. It can grow up to 3 meters in length, with long, trailing stems that spread quickly.', 'Prefers wetland environments, including ponds, dikes, and shallow shores where water is slow-moving or stagnant.', 'Thrives in nutrient-rich waters but can be invasive in areas with high nutrient availability. It is sensitive to pollution and prefers fresh water.', 'Native to Southeast Asia and widely distributed across tropical Asia, including the Philippines.', 'Water Spinach is widely consumed in local cuisine, known for its tender, nutritious leaves. It is a key vegetable in Filipino dishes like adobong tangkong and sinigang.', 'Plays a vital role in water filtration and provides food and shelter for aquatic animals.', 'Assists in nutrient cycling by absorbing excess nutrients from the water but may contribute to eutrophication if uncontrolled.', 5, '1746530899_c4542a46a180e5368fb4.jpg', 'Found in shallow, muddy areas of Lake Mainit, particularly in the marshes and wetlands surrounding the lake.', 'Primarily aquatic herbivore, absorbing nutrients directly from the water, it also contributes to the local nutrient cycling.', 'Its rapid growth can make it invasive, leading to changes in local water systems by outcompeting other aquatic plants for resources.', 'â€¢ Hong, T. C., & Quach, T. N. (2008). "Aquatic Vegetation in Southeast Asia: An Ecological Perspective." Aquatic Botany Journal.\r\n\r\nâ€¢ Local Agricultural Reports, Lake Mainit, 2024.\r\n\r\nâ€¢ Department of Environment and Natural Resources (DENR), Philippines (2025). "Invasive Aquatic Species in the Philippines."\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.534124,"lng":125.520462},{"lat":9.453532,"lng":125.554772},{"lat":9.484687,"lng":125.474485},{"lat":9.337013,"lng":125.519089},{"lat":9.421019,"lng":125.495758}]', 'Reproduces through stem cuttings and rapid vegetative growth. Flowers produce seeds, but the plant often spreads primarily via its robust, floating stems.', 'In some regions, it holds cultural value, symbolizing abundance and health.', 'Can both provide habitat and contribute to the decline of native aquatic plants by outcompeting them for space and resources.', 'Regular management is needed to prevent it from becoming overly invasive in certain areas. Methods such as physical removal or controlled harvesting are recommended.', 'Continued monitoring of its growth and spread is essential for managing its potential to dominate certain ecosystems.', 'Known for its rapid growth, Ipomoea aquatica can dominate wetlands, potentially displacing native species and altering local aquatic ecosystems.', 'Ensuring its spread is controlled while maintaining its utility in the local food system.', NULL, NULL, NULL),
	(96, 'species/96/7 Rotula aquatica 1.png', 'Rotula', NULL, '.', 'Rotula aquatica', 'Rotula', 'Takud', 'Plantae', '2025-06-18 02:09:52', 2, '2025-06-18 02:09:52', 2, 'active', 0, 'Angiosperms', 'Eudicots', 'Lamiales', 'Acanthaceae', 'Rotula', 'aquatica', 'Not Evaluated (NE)', 'Rotula aquatica is a perennial herb that grows in wetland environments. Its stems are square and often float on water, with thick, fleshy leaves that are oblong and glossy. The plant features clusters of small, white or pale lavender flowers that emerge from the axils of its leaves. It is a relatively short plant, growing up to 50 cm in height, often forming dense patches in waterlogged areas.', 'Aquatic, commonly in shallow water or along the edges of lakes and rivers.', ' Prefers clean, moderately nutrient-rich water but can tolerate slightly polluted environments.', 'Native to tropical Asia, and abundant in various parts of the Philippines, including Lake Mainit.', NULL, 'Provides habitat for fish and aquatic invertebrates and is part of the food web for various species.', NULL, 5, '1746532716_700277911268a54273d7.jpg', 'Found in the shallow, marshy zones of Lake Mainit, especially in areas with muddy, slow-moving water.', 'Absorbs nutrients directly from water, filtering out small particles and contributing to the water\'s clarity.', 'Helps stabilize wetland environments by preventing soil erosion and providing food for aquatic animals.', 'â€¢ Navas, R. M. (2001). "Aquatic Plants of Southeast Asia: A Review." Aquatic Botany Journal.\r\n\r\nâ€¢ Local Environmental Reports, Lake Mainit, 2024.\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.536629,"lng":125.520999},{"lat":9.506156,"lng":125.474336},{"lat":9.480082,"lng":125.479139},{"lat":9.4557,"lng":125.570749},{"lat":9.402797,"lng":125.554966},{"lat":9.342976,"lng":125.523183},{"lat":9.422239,"lng":125.495735}]', 'Reproduces through vegetative propagation and seed production, typically forming dense stands in favorable conditions.', 'Often used in traditional medicine, although its use in local diets is not common.', NULL, NULL, 'Monitoring and management are essential to ensure that it does not become overly invasive.', NULL, 'Promoting its role in shoreline stabilization while preventing overgrowth in sensitive areas.', NULL, NULL, NULL),
	(97, 'species/97/8 Neptunia oleracea 1.png', 'Water Mimosa', NULL, '.', 'Neptunia oleracea', 'Water Mimosa', 'Kupo-Kupo', 'Plantae', '2025-06-18 02:08:36', 2, '2025-06-18 02:08:36', 2, 'active', 0, 'Angiosperms', 'Eudicots', 'Fabales', 'Fabaceae', 'Neptunia', 'olaracea', 'Not Evaluated (NE)', 'Neptunia oleracea, known locally as Kupo-Kupo or Water Mimosa, is a floating aquatic plant that thrives in slow-moving or stagnant waters. The plant has compound leaves with small leaflets that fold or droop when touched or exposed to physical stimuli, exhibiting a rapid "mimosa-like" response. It has pink or purple ball-shaped flowers that bloom in clusters. The plant\'s stems are slender, and it can grow as a floating mat on the surface of water, sometimes forming dense clusters. It is commonly found in wetlands and aquatic habitats in tropical regions.', 'Prefers freshwater environments such as ponds, dikes, wetlands, and shallow lake beds. It is often found in regions with moderate to high nutrient levels.', 'Thrives in nutrient-rich, freshwaters, particularly in areas with low to moderate water movement. It can tolerate temporary water quality changes but prefers clean water.', 'Native to Southeast Asia, including the Philippines, Neptunia oleracea is widespread in tropical and subtropical regions.', 'Neptunia oleracea is used in some traditional medicines and occasionally as an ornamental plant in water gardens. In some regions, the plant\'s tender shoots are consumed as vegetables.Neptunia oleracea is used in some traditional medicines and occasionally as an ornamental plant in water gardens. In some regions, the plant\'s tender shoots are consumed as vegetables.', 'By providing dense cover, it supports biodiversity by providing food and shelter to a wide range of aquatic organisms.', 'The floating mats of Neptunia oleracea serve as critical habitat for juvenile fish and aquatic invertebrates.', 5, '1746533966_daae6b4ed45dab5f684c.jpg', 'Found in shallow, slow-moving waters around Lake Mainit, especially in marshy areas and near the edges of the lake.', 'As a floating aquatic plant, it absorbs nutrients directly from the water. It may also filter small particles from the water as it grows.', 'The plant provides critical habitat for small aquatic organisms, including invertebrates and fish fry. Its dense growth can help stabilize wetland areas, preventing erosion.', 'â€¢ Quezada, A. D. (2020). "Aquatic Plants of the Philippines: Ecological and Economic Perspectives." Philippine Journal of Aquatic Ecology.\r\n\r\nâ€¢ Del Rosario, C. F., & Wong, D. C. (2018). "Freshwater Plant Communities of Lake Mainit: Diversity and Ecological Roles." Journal of Wetland Conservation.\r\n\r\nâ€¢ Department of Environment and Natural Resources (DENR), Philippines (2025). "Invasive Aquatic Species in Southeast Asia."\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.534124,"lng":125.523856},{"lat":9.49146,"lng":125.560912},{"lat":9.460983,"lng":125.55405},{"lat":9.486719,"lng":125.47788},{"lat":9.426438,"lng":125.494349},{"lat":9.368857,"lng":125.510818}]', 'Primarily reproduces through vegetative propagation (via stem fragmentation) and seed production. The flowers are pollinated by insects, and seeds are dispersed by water currents.', 'The plant is culturally significant in various Asian countries, often used in herbal medicine. In the Philippines, it is less commonly utilized but is recognized for its ecological benefits.', 'The plant plays a role in water purification by absorbing excess nutrients, although uncontrolled growth could lead to eutrophication in some areas.', 'While generally beneficial in controlling erosion and supporting biodiversity, Neptunia oleracea can be invasive in areas with abundant nutrients, potentially crowding out other native species.', 'While Neptunia oleracea is not yet a major problem species in Lake Mainit, it is important to monitor its spread, especially in areas where it could potentially become invasive.', 'Managing nutrient levels in Lake Mainit to prevent excessive growth of aquatic plants, including Neptunia oleracea, is crucial for maintaining biodiversity.', 'Promoting its role in controlling erosion and providing aquatic habitat, while avoiding excessive growth through water quality management, will ensure it remains a beneficial species in the ecosystem.', NULL, NULL, NULL),
	(98, 'species/98/9 Typha 1.png', 'Cattail', NULL, '.', 'Typha sp.', 'Cattail', 'Ikog sa Iring', 'Plantae', '2025-06-18 02:09:02', 2, '2025-06-18 02:09:02', 2, 'active', 0, 'Angiosperms', 'Monocots', 'Poales', 'Typhaceae', 'Typha', '0', 'Not Evaluated (NE)', 'The genus Typha, commonly known as cattails, includes several species of tall, reed-like plants commonly found in wetlands. Typha sp., known locally as Ikog sa Iring, is a robust aquatic plant characterized by long, narrow, sword-shaped leaves that grow in dense clusters. The most distinguishing feature of the cattail is its cylindrical, brownish flower spike (a "cattail") that develops in late spring or early summer. These plants can grow up to 2â€“3 meters tall and are typically found in shallow, still waters. They have a deep rhizome system that anchors them to the sediment. The flowers of the cattail are wind-pollinated and produce abundant seeds that are easily dispersed by the wind.', 'Prefers wetland habitats, particularly in areas with standing or slow-moving freshwater. They thrive in marshes, ponds, and the edges of lakes.', 'Typha sp. is tolerant of varying water quality conditions, including waters that are rich in nutrients, often associated with eutrophic environments. It can survive in both acidic and alkaline waters but prefers slightly alkaline conditions.', 'Typha species are native to many parts of the world, including Southeast Asia. They are common in the Philippines, particularly in wetland ecosystems such as Lake Mainit.', 'In various parts of the Philippines, Typha sp. has multiple uses. Its leaves are traditionally used for weaving mats, baskets, and roofing materials. The stalks can also be used as a food source in some cultures, although less commonly.', 'Cattails play an important role in wetland ecosystems by stabilizing the soil and filtering water. They also provide habitat for various species of birds, amphibians, and insects.', NULL, 5, '1746534745_3bbf0ed0729882b9fdd2.jpg', 'Found predominantly along the edges of Lake Mainit, in marshy areas, wetlands, and riverbanks where the water is shallow and slow-moving.', 'Typha sp. is a photosynthetic plant, deriving nutrients from the water and soil through its roots. It does not consume organic material but plays a role in nutrient cycling by filtering excess nutrients from the water.', 'Cattails can dominate wetlands by forming dense stands that provide shelter and food for aquatic species. However, their aggressive growth in nutrient-rich environments can sometimes lead to the reduction of biodiversity by outcompeting native aquatic vegetation.', 'â€¢ Bagarinao, T. (2021). "The Role of Wetland Plants in Lake Ecosystems: Focus on Lake Mainit." Philippine Journal of Environmental Science.\r\n\r\nâ€¢ Gonzales, R. D., & Lopez, J. G. (2019). "Wetland Vegetation and Ecosystem Function in Mindanao\'s Lakes." Journal of Philippine Ecology.\r\n\r\nâ€¢ Department of Environment and Natural Resources (DENR), Philippines (2025). "Management of Aquatic Vegetation in Philippine Wetlands."\r\n\r\nâ€¢ Photo credit to iNaturalist', '[{"lat":9.536629,"lng":125.518932},{"lat":9.504801,"lng":125.476044},{"lat":9.47805,"lng":125.478102},{"lat":9.431993,"lng":125.488396},{"lat":9.448926,"lng":125.569369},{"lat":9.343111,"lng":125.517679},{"lat":9.412891,"lng":125.552676}]', 'Reproduction occurs both through seed dispersal and vegetative reproduction via rhizomes. The seeds are carried by the wind, while the rhizomes can grow new plants in nearby areas. This makes Typha species highly prolific.', 'The plant is culturally significant in some Philippine communities, especially in rural areas, where it is used for local crafts and construction materials.', 'Cattails help in reducing nutrient pollution by absorbing excess nitrogen and phosphorus from the water. This role is particularly important in eutrophic lakes like Lake Mainit. However, excessive growth can lead to an imbalance in the ecosystem, restricting other aquatic plant growth.', NULL, 'While Typha sp. plays a vital role in the ecosystem, its rapid spread in some areas of Lake Mainit could potentially disrupt local biodiversity. Continuous monitoring of its spread is important to prevent overgrowth in sensitive areas.', 'Typha sp. is crucial for maintaining wetland habitats. Its dense growth provides shelter for aquatic animals, including fish, amphibians, and small mammals. The plants also provide food sources for various species of birds, particularly in the reproductive stages when they produce seeds.', 'Encouraging sustainable water quality management practices, such as controlling nutrient loading into the lake, can help regulate Typha growth. Additionally, maintaining a balance of native plant species around the lakeâ€™s margins will support the overall health of the wetland ecosystem.', NULL, NULL, NULL),
	(103, 'species/103/1. B. bagobus 1.png', 'Bagobo Rat, Mindanao Forest Rat', NULL, '.', 'Bullimus bagobus Mearns, 1905', 'Bagobo Rat, Mindanao Forest Rat', 'Kawili (Mindanao)', 'Animalia', '2025-06-18 10:00:15', 2, '2025-06-18 10:00:15', 2, 'active', 0, 'Chordata', 'Mammalia', 'Rodentia', 'Muridae', 'Bullimus', 'bagobus', 'â€¢	IUCN Red List: Least Concern (LC) â€” stable population but requires habitat protection â€¢	Philippine Status: Not nationally listed as threatened, but habitats are threatened regionally due to land conversion.', 'A large, terrestrial rodent endemic to Mindanao and nearby islands, characterized by a head-body length of 228â€“275â€¯mm, a shorter tail of 175â€“205â€¯mm, and hind feet measuring 52â€“61â€¯mm. Dorsal fur is brownish-yellow with darker bases, fading to pale ventrally. Tail bicolored, sparsely haired, and equipped with approximately nine scale rings per centimeter. Known for a diploid chromosome number of 2nâ€¯=â€¯42', 'â€¢	Mindanao Presence: Found throughout greater Mindanao, including Surigao del Norte, and on surrounding islands like Dinagat and Leyte .\r\nâ€¢	Habitat Type: Occupies lowland to montane primary and secondary forests, including limestone and dipterocarp associations, at elevations from 200 to 1,800â€¯m', NULL, NULL, NULL, 'â€¢	Activity: Nocturnal and terrestrial, largely ground-dwelling and active at night under the forest canopy \r\nâ€¢	Ecosystem Role: Acts as both predator and preyâ€”regulates forest-floor invertebrates and serves as a food source for larger predators.\r\nâ€¢	Indicator: Presence suggests healthy forest ecosystems, though low detection rates indicate its secretive behavior.', NULL, 94, NULL, NULL, NULL, NULL, 'â€¢	Animalia.bio: classification, common/local names \r\nâ€¢	Mammal Diversity database: distribution and IUCN status mammaldiversity.org\r\nâ€¢	Field surveys: Mt. Hamiguitan and Bega watershed captures (non-volant mammal studies)', '[{"lat":9.344466,"lng":125.520465},{"lat":9.543926,"lng":125.494212},{"lat":9.543926,"lng":125.494212},{"lat":9.585652,"lng":125.472002}]', 'Believed to be omnivorous, feeding on plant materialâ€”such as fruits and seedsâ€”and invertebrates .', 'â€¢	Agricultural Interaction: Causes minimal economic impact; no known involvement in crop damage.\r\nâ€¢	Cultural Relevance: Local name â€œKawiliâ€ reflects indigenous recognition; no deeper cultural symbolism documented', NULL, 'Constructs ground burrows or uses existing forest debris for nesting; captures via liveâ€traps in lowland forest contexts .', NULL, 'Habitat fragmentation due to logging, agricultural expansion, and mining; vulnerability through hunting in some regions .', 'â€¢	Survey Presence: Trapped in protected forests (e.g., Mt. Hamiguitan and forest reserves) via general mammal assessments', NULL, NULL, NULL),
	(99, 'species/99/11. Tropidphorus misamis 1.png', 'Misamis Waterside Skink (Philippines)', NULL, '.', 'Tropidophorus misaminius Stejneger, 1908', 'Misamis Waterside Skink (Philippines)', NULL, 'Animalia', '2025-06-18 03:11:11', 2, '2025-06-18 03:11:11', 2, 'active', 0, 'Chordata', 'Reptilia', 'Squamata', 'Scincidae', 'Tropidophorus', 'misaminius', 'â€¢	IUCN Red List: Least Concern (LC)', 'A semi-aquatic skink featuring keeled, pointed dorsal scalesâ€”likely an anti-predatory adaptationâ€”measuring around 90â€“112â€¯mm SVL in adults researchgate.net. It has a moderately stout body with limbs suited for riparian life and a tail used for swimming and balance. Coloration is generally dark brown to blackish, helping with camouflage in shaded streamside habitats.', 'Habitat and Distribution in Lake Mainit Region\r\nâ€¢	Geographic Range:\r\nEndemic to the southern Philippines, recorded on Mindanao (including Misamis), Basilan, and Camiguin Islands facebook.com+11en.wikipedia.org+11en.wikipedia.org+11reptile-database.reptarium.cz.\r\nâ€¢	Elevation:\r\nInhabits elevations from ~350 to 1,500â€¯m above sea level \r\nâ€¢	Habitat Type:\r\nPrefers forested, riparian zones; found under decaying logs or rocks along stream banks, often near or in shallow water A novel microhabitat note documents its presence in cave stream environments (~250â€¯m elev)', NULL, NULL, 'â€¢	Local Fisheries:\r\nNo direct interaction.', 'Acts as mid-level predator controlling insect and invertebrate populations along watercourses.', 'Contributes to ecosystem dynamics by consuming prey and serving as prey for birds, larger reptiles, and small mammals.', 6, NULL, NULL, 'Likely feeds on aquatic and terrestrial invertebratesâ€”such as insects and mollusksâ€”using a sit-and-wait or active foraging strategy along stream edges', 'Solitary, diurnal, and agile swimmers and climbers. Typically emerges during daylight to bask and hunt, retreating under cover when threatened.', NULL, '[{"lat":9.536832,"lng":125.521867},{"lat":9.343111,"lng":125.516377}]', 'Ovoviviparousâ€”females give birth to live young rather than laying eggs reptile-database.reptarium.cz', 'Not prominent in folklore or local culture.', 'Not prominent in folklore or local culture.', 'Likely feeds on aquatic and terrestrial invertebratesâ€”such as insects and mollusksâ€”using a sit-and-wait or active foraging strategy along stream edges.', 'Included in general herpetofaunal surveys in Mindanao; no species-specific population programs documented facebook.comresearchgate.net.', 'Conserving forested riparian zones around Lake Mainit is essential, as the species depends on streamside vegetation, logs, and rocks.', 'Encouraging forest integrity and minimizing water pollution will help maintain viable skink populations.', NULL, NULL, NULL),
	(100, 'species/100/12. S. variegatus 1.png', 'Writhing Skink/Variegated Forest Skink', NULL, '.', 'Sphenomorphus variegatus', 'Writhing Skink/Variegated Forest Skink', NULL, 'Animalia', '2025-06-18 03:28:18', 2, '2025-06-18 03:28:18', 2, 'active', 0, 'Chordata', 'Reptilia', 'Squamata', 'Scincidae', 'Sphenomorphus', 'variegatus', 'â€¢	IUCN Red List: Least Concern â€” common and widespread across Southeast Asia .', 'A distinct arboreal lizard reaching up to 22â€¯cm total length, equipped with elongated ribs and patagiaâ€”wing-like skin membranesâ€”for gliding . Males exhibit vibrant patagia patterns (bright orange or blue with banding) and a pronounced dewlap; females display more subdued coloration. They possess slender bodies and long tails optimized for aerial control during glides.', 'â€¢	Regional Occurrence: Reported within the Lake Mainit Key Biodiversity Area along with other forest reptiles.\r\nâ€¢	Habitat Type: Occupies tropical lowland and secondary forests, particularly at forest edges and riparian corridors in the watershed area around Mainit, Alegria, Jabonga, and Kitcharao.\r\nâ€¢	Microhabitat Preferences: Exclusively arboreal; spends nearly all life in trees, descending only to nest in soil under forest canopy.', NULL, NULL, NULL, 'Insectivorous predator that helps control ant and termite populations in forested landscapes.', 'Contributes to forest ecosystem stability by occupying a mid-trophic levelâ€”prey for birds, snakes, and larger arboreal predators.', 6, NULL, NULL, 'Primarily feeds on ants and termites, captured through sit-and-wait foraging along trunks', NULL, 'â€¢	Van Arsdale, M. â€œDraco volansâ€ â€“ Animal Diversity Web nationalgeographic.com+15animaldiversity.org+15en.wikipedia.org+15\r\nâ€¢	Wikipedia: â€œDraco volansâ€ distribution and gliding behavior \r\nâ€¢	National Geographic â€“ reproduction/nesting behavior artofit.org+15nationalgeographic.com+15bioone.org+15\r\nâ€¢	A-Z Animals â€“ territorial and behavioral observations \r\nâ€¢	Local Lake Mainit biodiversity report â€“ species occurrence in KBA anyflip.com+1innspub.net+1', '[{"lat":9.585652,"lng":125.472123},{"lat":9.343857,"lng":125.515741}]', 'Oviparous; nesting involves digging a soil cavity where females lay ~5 eggs and guard for ~24â€¯hours', 'Though harmless and sometimes mistaken for snakes, local perceptions and myths occasionally mislabel them; no prominent cultural symbolism identified.', NULL, NULL, 'General herpetofaunal surveys in Lake Mainit KBA list the species; no species-specific monitoring yet innspub.net+1anyflip.com+1.', 'â€¢	Habitat Protection: Protection of continuous arboreal corridors and riparian forest is essential for gliding and nesting behaviors.\r\nâ€¢	Threats: Habitat fragmentation, logging, and edge effects may impair glide pathways and territorial zones.', NULL, NULL, NULL, NULL),
	(101, 'species/101/13. D. volans 1.png', 'Boydâ€™s Forest Dragon', NULL, '.', 'Hypsilurus boydii (Macleay, 1884)', 'Boyd?s Forest Dragon', NULL, 'Animalia', '2025-06-18 08:03:31', 2, '2025-06-18 08:03:31', 2, 'active', 0, 'Chordata', 'Reptilia', 'Squamata', 'Agamidae', 'Hypsilurus / Lophosaurus', 'boydii', 'â€¢	IUCN Red List: Least Concern â€” widespread and stable across its Australian range . â€¢	Philippine Status: Not listed nationally; in Mindanao, status remains undetermined due to infrequent reports.', 'Boyd\'s Forest Dragon is a robust, arboreal agamid with a laterally compressed body, pronounced nuchal and dorsal crests, and large cheek scales. Males reach approximately 160â€¯mm SVL with ~325â€¯mm tail; females around 140 mm SVL. Its coloration is crypticâ€”brown, grey, or greenishâ€”complemented by a yellow dewlap edged with small spines.', 'â€¢	Regional Presence: While primarily associated with northern Queensland\'s rainforests, occasional vagrants or sightings near Mindanao\'s forested waterways suggest a possibility in similar habitats near Lake Mainit \r\nâ€¢	Habitat Type: Likely occupies riparian evergreen or secondary forests near the lake. Within Lake Mainitâ€™s buffer zones, it would favor mature trees with adequate canopy structure and understory.\r\nâ€¢	Microhabitat: Prefers vertical tree trunks and perches typically 1â€“3â€¯m above ground, where its cryptic appearance enhances camouflage', NULL, NULL, NULL, 'As a predator of forest-floor and arboreal invertebrates, it helps maintain balanced ecosystem dynamics.', NULL, 6, NULL, NULL, 'A sit-and-wait insectivoreâ€”feeding on earthworms, large invertebrates, occasionally fruit or small vertebrates', 'Diurnal; remains motionless on tree trunks during the day, rarely basking. Moves slowly to evade threats, often repositioning to the tree\'s opposite side when disturbed .Males maintain territories (~1,000â€¯mÂ²), likely utilized for mating and feeding. Both sexes have smaller home ranges .', '1.	Wikipedia: Hypsilurus boydii taxonomy and ecology \r\n2.	Animal Diversity Web classification details animaldiversity.org\r\n3.	Rainforest Rescue & Wet Tropics Management â€” behavior and habitat daintreerainforest.\r\n4.	Regional notes on reproduction, activity, and threats \r\n5.	Local Lake Mainit biodiversity context from buffer zone herpetofaunal inventories', '[{"lat":9.583282,"lng":125.473496},{"lat":9.343518,"lng":125.514024}]', 'Oviparous; clutches of 1â€“6 eggs laid in shallow ground nests such as forest clearings including road verges; incubation around 100 days', NULL, NULL, 'Functions as a mid to upper-tertiary predator; prey includes birds of prey, snakes; may face egg predation from invasive species like feral pigs', NULL, 'Protection of mature riparian forests and maintenance of canopy continuity critical. Mitigating logging, agricultural encroachment, or road development near forest buffer zones is essential.', 'Advocate for community awareness of foraging forest reptiles, enforce prohibition of egg or specimen collection.', NULL, NULL, NULL),
