ial and behavioral observations \r\nâ€¢	Local Lake Mainit biodiversity report â€“ species occurrence in KBA', '[{"lat":9.539609,"lng":125.523624},{"lat":9.464776,"lng":125.577544},{"lat":9.452923,"lng":125.574797},{"lat":9.339588,"lng":125.516773}]', 'Oviparous; nesting involves digging a soil cavity where females lay ~5 eggs and guard for ~24â€¯hours', NULL, NULL, NULL, 'General herpetofaunal surveys in Lake Mainit KBA list the species; no species-specific monitoring yet', 'Protection of continuous arboreal corridors and riparian forest is essential for gliding and nesting behaviors.', 'Habitat fragmentation, logging, and edge effects may impair glide pathways and territorial zones.', NULL, NULL, NULL),
	(104, 'species/104/2 P. stangeri 1.png', 'Forest Giant Squirrel, Stangerâ€™s Squirrel', NULL, '.', 'Protoxerus stangeri (Waterhouse, 1842)', 'Forest Giant Squirrel, Stanger?s Squirrel', NULL, 'Animalia', '2025-06-18 10:00:43', 2, '2025-06-18 10:00:43', 2, 'active', 0, 'Chordata', 'Mammalia', 'Rodentia', 'Sciuridae', 'Protoxerus', 'stangeri', 'â€¢	IUCN Red List: Least Concernâ€”large population and wide distribution', 'The largest arboreal squirrel in Africa, with a headâ€“body length of ~300â€¯mm and a similarly long, bushy tail. Upperparts range from brownish-yellow to olive or reddish-brown, often with frosted appearance; underparts are mostly white and sparsely furred. The tail may have subtle banding. Ears are small and almost hairless. Weight averages 540â€“700â€¯g. It is spotted in the Upland areas of  Cantugas and Jabonga.', 'Inhabits subtropical/tropical moist lowland forests and plantations; favors canopy regions; capable of tolerating some habitat modification', NULL, NULL, NULL, 'Important seed disperser in forest ecosystems; serves as prey for large avian and arboreal predators.', NULL, 94, NULL, NULL, 'Consumes fruits, seeds, nuts, and occasionally insectsâ€”a generalist frugivore-insectivore.', 'Largely solitary or seen in pairs; may have overlapping home ranges.', 'â€¢	IUCN & Mammal Diversity taxonomy and status \r\nâ€¢	Coke Smith Wildlife & Ontosight ecological notes', '[{"lat":9.586261,"lng":125.47555},{"lat":9.339453,"lng":125.522289}]', 'Breeds seasonally; litter size and timing vary regionally.', 'Not widely hunted for sport or bushmeat; limited cultural significance', NULL, NULL, NULL, 'Maintaining canopy continuity, protecting large forest tracts, and monitoring forest-adapted species.', NULL, NULL, NULL, NULL),
	(105, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-18 10:17:03', 2, '2025-06-18 10:17:03', 2, 'active', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(106, 'species/106/3. R. tanezumi 1.png', 'Oriental House Rat', NULL, '.', 'Rattus tanezumi Temminck, 1844', 'Oriental House Rat', 'Ilaga', 'Animalia', '2025-06-18 10:23:52', 2, '2025-06-18 10:23:52', 2, 'active', 0, 'Chordata', 'Mammalia', 'Rodentia', 'Muridae', 'Rattus', 'tanezumi', 'IUCN Red List: Least Concern (LC) â€“ due to its wide range and high adaptability  Local Status: Not protected; considered a pest species in the Lake Mainit area', 'Rattus tanezumi is a medium-sized murid rodent with a coarse brownish to grayish dorsal coat and lighter ventral side. Adults typically measure 200â€“260 mm in body length, with tails that are equal to or slightly longer than the body. The ears are relatively large, the snout is pointed, and the tail is scaly and bicolored. This species is morphologically similar to Rattus rattus but distinguishable by molecular and cranial traits.', 'Regional Presence: Widespread across the lowland and human-modified landscapes of the Lake Mainit basin, especially in the municipalities of Mainit, Alegria, Jabonga, and Kitcharao.\r\nHabitat Type: R. tanezumi thrives in agricultural settings (rice paddies, coconut farms), residential zones, and secondary forest edges. It is commonly observed near homes, granaries, and irrigation canals.\r\nDistribution Context: Considered one of the most ubiquitous mammalian species in Lake Mainitâ€™s lowland areas. Regular sightings and captures have been reported during pest control activities and ecological surveys conducted by local agricultural and health offices.', NULL, NULL, 'Agricultural Impact: One of the most destructive vertebrate pests in the Lake Mainit agroecosystem. Farmers report significant pre- and post-harvest damage to rice paddies, cornfields, and stored grains.', NULL, NULL, 94, NULL, NULL, 'Opportunistic omnivoreâ€”feeds on rice grains, root crops, fruits, household waste, insects, and small vertebrates. In the Lake Mainit area, it is a known pest in rice and coconut plantations.', 'Nocturnal and highly adaptive. It utilizes burrows in rice fields, coconut husk piles, and house foundations. Active throughout the year, with peak population growth during harvest periods.', 'Maglinte, D. T., Seronay, R. A., & Jumawan, J. C. (2021). Zoonotic Parasites in Rattus spp. in barangays surrounding Lake Mainit, Philippines. Asian Journal of Biological and Life Sciences, 10(1), 91â€“97.\r\n\r\nStuart, A. M., & Singleton, G. R. (2014). Ecologically based rodent management in the Philippines: challenges and opportunities. Wildlife Research, 41(3), 174â€“182.\r\n\r\nIUCN Red List (2024). Rattus tanezumi species profile.\r\n\r\nDENR-BMB. (2015). Philippine Biodiversity Strategy and Action Plan.\r\n\r\nInterviews and unpublished data from DA-Surigao del Norte and Lake Mainit field technicians (2023).', '[{"lat":9.58599,"lng":125.46972},{"lat":9.341824,"lng":125.519519}]', 'Breeds throughout the year with increased intensity during the wet season (Juneâ€“October), coinciding with peak agricultural productivity. Females can produce multiple litters annually, each with 6â€“12 offspring.', 'Cultural Perception: Often viewed negatively due to its association with disease, crop loss, and unclean environments. However, its presence is tolerated due to lack of sustainable control alternatives.', 'Though native to Southeast Asia, R. tanezumi behaves as an invasive species in many ecosystems. In Lake Mainit, it potentially displaces native murids in disturbed habitats.', 'Functions as both predator and preyâ€”feeds on insects and snails but is also preyed upon by snakes, barn owls (Tyto alba), and feral cats in the Lake Mainit area.', 'Included in agricultural pest surveys by the Department of Agriculture (DA) and the Provincial Agriculture Office (PAO) of Surigao del Norte. Data from these agencies help plan rodent control campaigns.', 'Current practices in Lake Mainit include:\r\n\r\nRodent trapping and community-led campaigns\r\n\r\nField sanitation and waste management\r\n\r\nLimited application of rodenticides (used cautiously to avoid environmental harm)', NULL, NULL, NULL, NULL),
	(107, 'species/107/1. M. wetmorei 1.png', 'Whiteheadâ€™s Fruit Bat', NULL, '.', 'Harpyionycteris whiteheadi', 'Whitehead?s Fruit Bat', 'Kabog', 'Animalia', '2025-06-20 12:20:46', 2, '2025-06-20 12:20:46', 2, 'active', 0, 'Chordata', 'Mammalia', 'Chirpotera', 'Pteropodidae', 'Harpyionycteris', 'whiteheadi', 'IUCN Red List: Near Threatened (NT)', 'Harpyionycteris whiteheadi is a medium-sized fruit bat endemic to the Philippines. It is characterized by a woolly, chocolate-brown fur, elongated muzzle, and a notably long tongue, adapted for feeding on soft fruits and nectar. It lacks a tail and has reduced interfemoral membranes. The species is morphologically adapted to a frugivorous diet, possessing robust molars and specialized cranial features to process pulpy fruits.', 'This species is found in tropical montane and lowland forests of Mindanao, including areas around Lake Mainit. It likely inhabits the forested slopes and riparian zones in barangays located in Alegria, Jabonga, and Kitcharao, where fragments of primary and secondary forest remain. Occasional sightings and local ecological assessments suggest that it may be present in areas near Maglinte and other upland zones within the Lake Mainit Key Biodiversity Area.', NULL, NULL, NULL, 'Whiteheadâ€™s Fruit Bat is primarily nocturnal and frugivorous, foraging at night for fruits such as figs, wild bananas, and soft berries. It plays a significant ecological role in pollination and seed dispersal. Roosting behavior remains insufficiently studied, but the species likely uses dense forest canopies or vine-covered trees. Its long tongue suggests occasional nectar feeding, which complements its role as a pollinator.', NULL, 94, NULL, NULL, NULL, NULL, 'Heaney, L. R., Balete, D. S., & Rickart, E. A. (2016). The Mammals of Luzon Island: Biogeography and Natural History of a Philippine Fauna. Johns Hopkins University Press.\r\n\r\nSedlock, J. L., Ingle, N. R., & Rickart, E. A. (2008). Bat diversity in the Philippines: patterns and conservation priorities. Acta Chiropterologica, 10(2), 309â€“322.\r\n\r\nIUCN. (2023). Harpyionycteris whiteheadi. The IUCN Red List of Threatened Species.\r\n\r\nMaglinte, R. T. et al. (2022). Community-based biodiversity assessments in the Lake Mainit watershed. SNSU Research Journal, 18(2), 45â€“56.', '[{"lat":9.585313,"lng":125.471747},{"lat":9.343518,"lng":125.516363}]', NULL, 'Although not directly used for food or trade in the Lake Mainit region, H. whiteheadi contributes to ecosystem services that benefit agriculture and forest regeneration. In local discourse, it is sometimes confused with larger â€œkabogâ€ species that are occasionally hunted, though this species is not known to be a major target of bat hunting.', NULL, NULL, 'The species is threatened by habitat loss, especially from upland farming, logging, and infrastructure expansion. In the Lake Mainit context, conservation should include:\r\nProtection and reforestation of riparian and montane forest corridors\r\nInclusion in biodiversity monitoring under the DARETO project and local conservation ordinances\r\nCommunity education on the ecological importance of native bats', NULL, NULL, NULL, NULL, NULL),
	(108, 'species/108/lesser long tongue 1.png', 'Lesser Long-tongued Fruit Bat', NULL, '.', 'Macroglossus minimus', 'Lesser Long-tongued Fruit Bat', 'Kagi', 'Animalia', '2025-06-20 14:04:21', 2, '2025-06-20 14:04:21', 2, 'active', 0, 'Chordata', 'Mammalia', 'Chiroptera', 'Pteropodidae', 'Macroglossus', 'minimus', 'IUCN Red List: Least Concern (LC)', 'The Lesser Long-tongued Fruit Bat is one of the smallest megabats, measuring about 60â€“85 mm in body length and weighing between 14â€“21 grams. It has reddish-brown fur with a paler underside and a dark stripe running from the nose to the crown. Its most notable feature is its elongated muzzle and tongue, specialized for nectar feeding. The wings are narrow, adapted for quick and agile flight in cluttered forest and riparian environments. It lacks a tail and has a reduced interfemoral membrane.', 'This species is widely distributed in the Philippines and has likely established populations in various habitats around Lake Mainit, especially in barangays with coconut groves, banana plants, and forest fringes in the municipalities of Mainit, Alegria, and Jabonga.', NULL, NULL, NULL, NULL, NULL, 94, NULL, NULL, 'Nectarivorous, feeding on the nectar and pollen of banana, coconut, mangrove, and wild flowering plants. Occasionally feeds on soft fruit pulp.', 'Typically roosts solitarily or in small groups under banana leaves, tree canopies, or human structures. Primarily nocturnal, though some early evening foraging occurs.', 'Heaney, L. R., et al. (2016). The Mammals of Luzon Island: Biogeography and Natural History of a Philippine Fauna.\r\nNational Museum of the Philippines. (2021). "The Lesser Long-Tongued Bat."\r\nIUCN Red List. Macroglossus minimus Species Profile.\r\nMaglinte, R. T., et al. (2023). Biodiversity Assessment Reports in the Lake Mainit Watershed. SNSU-DARETO Project.\r\nEcology Asia. "Lesser Long-tongued Nectar Bat."', '[{"lat":9.584095,"lng":125.476215},{"lat":9.34196,"lng":125.51774}]', 'Breeds year-round in tropical zones; females typically give birth to a single pup, with 2â€“3 reproductive cycles annually. Gestation lasts around 120 days.', 'Not directly prominent in local beliefs or customs, but generally regarded neutrally by communities.', NULL, 'Acts as a pollinator and minor seed disperser; preyed upon by nocturnal birds and snakes.', 'No formal studies in the area; local biodiversity surveys should include monitoring this species as a pollinator indicator.', 'Preservation of flowering plant corridors and forest patches along the lake should be prioritized.', 'Encouraging planting of native nectar-producing trees and avoiding pesticide use in agricultural zones can support population health.', NULL, NULL, NULL),
	(109, 'species/109/2. C brachyotis 1.png', 'Short-nosed Fruit Bat', NULL, '.', 'Cynopterus brachyotis', 'Short-nosed Fruit Bat', 'Short-nosed Fruit Bat', 'Animalia', '2025-06-20 12:58:31', 2, '2025-06-20 12:58:31', 2, 'active', 0, 'Chordata', 'Mammalia', 'Chiroptera', 'Pteropodidae', 'Cynopterus', 'brachyotis', 'IUCN Red List: Least Concern (LC)', 'The Short-nosed Fruit Bat is a small to medium-sized megabat with a forearm length ranging from 60 to 70 mm and a weight of approximately 40â€“60 grams. It has short, rounded ears, large eyes, and dense brownish to reddish fur. The species is sexually dimorphic, with males often having a throat gland and a slightly brighter coloration. Its broad wings and short snout are adaptations for maneuverable flight in dense vegetation and efficient fruit feeding.', 'Cynopterus brachyotis is commonly found across various lowland habitats in the Philippines, including forest edges, orchards, and agricultural landscapes near Lake Mainit. It has been observed in secondary forests and fruit-bearing areas around the municipalities of Mainit, Kitcharao, and Jabonga. Prefers disturbed habitats, including plantations, home gardens, lowland forests, and forest edges. Roosts in banana leaves, coconut fronds, and under tree canopies.', NULL, NULL, NULL, 'Functions as an essential pollinator and seed disperser, contributing to forest regeneration and the maintenance of plant diversity.', NULL, 94, NULL, NULL, 'Frugivorous, feeding on a wide variety of fruits such as bananas, papayas, figs, guavas, and cultivated crops. May also consume nectar and pollen.', 'Roosts in small groups or singly in foliage. Exhibits high adaptability to human-altered environments and shows some tolerance for light and noise.', 'Heaney, L. R., Balete, D. S., & Rickart, E. A. (2016). The Mammals of Luzon Island: Biogeography and Natural History of a Philippine Fauna.\r\nSedlock, J. L., Ingle, N. R., & Rickart, E. A. (2008). Bat diversity in the Philippines: patterns and conservation priorities. Acta Chiropterologica, 10(2), 309â€“322.\r\nIUCN Red List. Cynopterus brachyotis.\r\nMaglinte, R. T. et al. (2022). Community-based biodiversity assessments in the Lake Mainit watershed. SNSU-DARETO Project.\r\nAnimal Diversity Web. Cynopterus brachyotis species account.\r\nWikipedia. "Cynopterus brachyotis."', '[{"lat":9.584907,"lng":125.47245},{"lat":9.342675,"lng":125.518284}]', 'Polyestrous species, capable of breeding year-round. Females give birth to one or two pups after a gestation period of approximately 3â€“4 months.', 'Generally not hunted or traded in the Lake Mainit area, but may be recognized by locals as â€œkabog.â€', NULL, 'Serves as both a pollinator and prey for snakes and nocturnal birds; integral to the fruit-forest ecosystem of Lake Mainit.', 'Presently not the focus of targeted conservation programs, but its abundance makes it a candidate species for bat monitoring in community-based biodiversity surveys.', 'Maintenance of fruit-bearing trees and avoidance of monoculture plantations support population health.', 'Agroforestry and mixed cropping systems around Lake Mainit help sustain foraging resources for this species. Public education on its ecological value is essential to mitigate negative perceptions.', NULL, NULL, NULL),
	(110, 'species/110/3.  E. robusta 1.png', 'Philippine Dawn Bat or Philippine Nectar Bat', NULL, '.', 'Eonycteris robusta', 'Philippine Dawn Bat or Philippine Nectar Bat', 'Kabog', 'Animalia', '2025-06-20 13:10:54', 2, '2025-06-20 13:10:54', 2, 'active', 0, 'Chordata', 'Mammalia', 'Chiroptera', 'Pteropodidae', 'Eonycteris', 'robusta', 'IUCN Red List: Vulnerable (VU)', 'A medium-sized megabat with a head-body length of approximately 127â€“155 mm, forearm length of 67â€“82 mm, and weighing between 56â€“80 g. It has dark grey to silver-grey fur with lighter ventral coloration and a pale collar. The muzzle is elongated, with tubular nostrils and a pointed tongue. Large eyes and short rounded ears are characteristic. A reduced tail and interfemoral membrane are typical.', 'Location: Endemic to the Philippines, including lowland and foothill forests in Mindanaoâ€”the Lake Mainit watershed likely supports populations given the presence of limestone caves and forest remnants .\r\nHabitat Type: Occupies primary lowland forests and caves; roosts in limestone caves, rock crevices, and riparian cliffs up to 1,100 m elevation. Exclusively found in the Philippines across major islands excluding Batanes and Palawan .', NULL, NULL, NULL, NULL, NULL, 94, NULL, NULL, 'Nectarivorous, specializing on pollen and nectar from nocturnally flowering plants within cave-adjacent forests .', 'Colonial roosting species; colonies in caves can be segregated by sex with varying group sizes. Roosts are communal, often mixed with other cave-dwelling bats like E. spelaea .', 'Waldien, D. L. & Carino, A. (2020). Eonycteris robusta. IUCN Red List of Threatened Species 2020. \r\nWikipedia. â€œPhilippine dawn bat (Eonycteris robusta)â€\r\nGBIF. Species profile for Eonycteris robustaMammal Diversity Database. Species account', '[{"lat":9.583282,"lng":125.471404},{"lat":9.343857,"lng":125.517736}]', 'Likely reproduces year-round with a single pup per pregnancy; reproductive patterns are similar to other Eonycteris spp., with gestation around 200 days and lactation lasting several weeks .', 'Supports biodiversity by aiding regeneration of plant species; cave roosts also serve as microhabitats.', 'A key pollinator for native and cultivated flowering plants; indirectly supports ecosystem services beneficial to agriculture.', 'Serves as prey for predatory birds and snakes; also hosts cave-specific ectoparasites, contributing to ecosystem complexity.', 'Needs inclusion in bat surveys using mist netting near lake-adjacent caves.', 'Protect limestone caves and adjacent forest patches from mining, guano extraction, and disturbance.', 'Promote cave conservation initiatives, ecotourism alternatives, local education on bat importance, and enforce wildlife protection regulations.', NULL, NULL, NULL),
	(111, 'species/111/4. E spelaea 1.png', 'Cave Nectar Bat (also Dawn Bat, Common Dawn Bat)', NULL, '.', 'Eonycteris spelaea', 'Cave Nectar Bat (also Dawn Bat, Common Dawn Bat)', 'Kabog (generic term)', 'Animalia', '2025-06-20 13:23:12', 2, '2025-06-20 13:23:12', 2, 'active', 0, 'Chordata', 'Mammalia', 'Chiroptera', 'Pteropodidae', 'Eonycteris', 'spelaea', 'IUCN Red List: Least Concern (LC)', 'The Cave Nectar Bat is a medium-sized fruit bat with a head-and-body length of 85â€“110â€¯mm, a forearm length of approximately 60â€“70â€¯mm, and weight between 35â€“80â€¯g. Its fur is grey-brown to dark brown dorsally and paler beneath, occasionally with a pale neck collar. It has an elongated muzzle with tubular nostrils, a long tongue for nectar feeding, external tail (~15â€“18â€¯mm), and reduced interfemoral membrane .', 'Location: Found across Southeast Asia and mainland Philippines, including Mindanao. Lake Mainitâ€™s karstic limestone areas likely host roosts in caves or cliff faces .\r\nHabitat Type: Roosts primarily in cavesâ€”where colonies can exceed thousandsâ€”also uses forested and semi-urban fringes near lake shores. Occurs from sea-level to montane zones (~1,000â€¯m) . Widespread from India through Southeast Asia to the Philippines .', NULL, NULL, NULL, NULL, 'Facilitates pollination and genetic diversity via long-distance foraging.', 94, NULL, NULL, 'Nectar and pollen specialist; recorded feeding on over 30 plant species including durian, banana, jackfruit, and mangrove flowers. Forages in flock-like groups, traveling 20â€“40â€¯km nightly .', 'Strongly gregarious and colonialâ€”colonies can range from dozens to over 10,000 individuals. Unique wingâ€‘clapping sounds are used for orientation within caves .', 'Animal Diversity Web. â€œEonycteris spelaeaâ€ \r\nbitsandbugs.com\r\n\r\nAnimalia.bio. â€œCave nectar batâ€ \r\n\r\nMacaranga.org. â€œDawn bats (Eonycteris spelaea) are important pollinatorsâ€ \r\nanimalia.bio\r\n\r\nAnimal Diversity Web. Social and foraging behavior of E. spelaea', '[{"lat":9.583621,"lng":125.471404},{"lat":9.342502,"lng":125.516363}]', 'Likely polygynous; colonies may segregate by sex. Reproduction patterns are similar to other Eonycteris, producing one pup after a long gestation (~200 days) and extended lactation period .', NULL, 'Supports regeneration of native flora and mangrove ecosystems.', 'Serves as a prey species for owls and snakes; hosts cave ectoparasites; important for ecosystem complexity.', NULL, 'Monitoring Populations: Should be included in nighttime surveys of caves and lake-edge forests.\r\nHabitat Protection: Safeguarding caves, surrounding forests, and flowering plant corridors is critical.', 'Cave tourism regulations, public education, and protection of key pollinator plants improve population resilience.', NULL, NULL, NULL),
	(112, 'species/112/P. jagori 1.png', 'Greater Musky Fruit Bat', NULL, '.', 'Ptenochirus jagori', 'Greater Musky Fruit Bat', 'Kabog', 'Animalia', '2025-06-20 13:51:00', 2, '2025-06-20 13:51:00', 2, 'active', 0, 'Chordata', 'Mammalia', 'Chiroptera', 'Pteropodidae', 'Ptenochirus', 'jagori', 'IUCN Red List: Least Concern (LC)', 'A medium-sized fruit bat with a head-body length of 120â€“145â€¯mm, forearm length of 76â€“90â€¯mm, tail extending 6â€“18â€¯mm, and weighing up to ~97â€¯g.The dorsal fur is dark brown (almost black) with a slightly lighter belly. It has small pointed ears, a short muzzle with tubular nostrils, and a reduced uropatagium with a protruding tail. Males possess a musky scent gland, visible as a small tuft near the throat.', 'Location: Endemic to the Philippines; likely occurs within lowland forest patches and cliff-edge roosts around Lake Mainit (Mainit, Alegria, Kitcharao, Jabonga).\r\nHabitat Type: Prefers primary and secondary lowland forests; commonly found in limestone caves, tree cavities, and cliff ledges near riparian zones. Adapts well to human-disturbed environments.', NULL, 'Endemic throughout Philippine islands, including Mindanao', NULL, 'Key seed disperser, especially for forest and riparian species, fostering plant community recruitment and structure.', NULL, 94, NULL, NULL, 'Frugivorous, specializing on fruits like Ficus chrysolepis, bananas, coconut, coffee, and kapok blossoms .', 'Roosts singly or in small groups (up to 10); colonies often located in caves or tree hollows near watercourses . Known for its musky odor used in social or sexual signaling.', 'GBIF & phylogeographic study: â€œPtenochirus jagori is endemic â€¦ most abundant in lowland primary forestâ€\r\nItalian Wikipedia & Mammal Species of World: Morphology, distribution, breeding details\r\nWikipedia. Greater musky fruit bat (Ptenochirus jagori)', '[{"lat":9.584941,"lng":125.474163},{"lat":9.342468,"lng":125.515044}]', 'Produces one pup twice annually (bimodal breeding). Gestation and lactation cycles align with fruit availability; lifespan ~5â€“8 years in the wild .', 'Not traditionally hunted, though occasional small-scale capture for bushmeat may occur.', NULL, 'Acts as both seed disperser and prey (snakes, raptors); contributes to cave ecosystem health.', 'Should be included in bat surveys, especially in limestone caverns and riparian forest corridors.', 'Preservation of lowland forests, fig trees, and cave sites is essential; agroforestry systems with native fruit trees can support populations.', 'Promote conservation education about batsâ€™ roles, prevent deforestation, and manage cave disturbance/tourism sustainably.', NULL, NULL, NULL),
	(113, 'species/113/p. minor 1.png', 'Lesser Musky Fruit Bat', NULL, '.', 'Ptenochirus minor', 'Lesser Musky Fruit Bat', 'Kabog musky gamay (informal)', 'Animalia', '2025-06-20 14:01:08', 2, '2025-06-20 14:01:08', 2, 'active', 0, 'Chordata', 'Mammalia', 'Chiroptera', 'Pteropodidae', NULL, 'Ptenochirus', 'minor', 'A medium-sized fruit bat with a head-body length of approximately 60â€“78â€¯mm and a forearm length of ~60â€“78â€¯mm; typically weighs between 40â€“60 grams. It has dark brown dorsal fur, a lighter ventral side, small pointed ears, tubular nostrils, and a reduced tail in its interfemoral membrane .', 'Location: Endemic to the Philippines and recorded in Mindanao regions; likely present in Lake Mainit KBA, especially around Maglinte and other riparian forest patches .\r\nHabitat Type: Prefers primary and montane rainforests from sea level to ~1,600â€¯m; roosts under forest foliage and occasional caves or rock crevices near lake shores .', NULL, 'Philippine endemic, distributed in scattered lowland and montane forests across Mindanao and adjacent islands .', NULL, 'Helps maintain plant diversity by dispersing seeds of Ficus and other nut- and fruit-bearing species.', 'Contributes to forest regeneration via seed dispersal of keystone plant species.', 94, NULL, NULL, 'Frugivorous, feeding primarily on figs (Ficus spp.) and occasionally on bananas; a vital seed disperser .', 'Observed roosting singly or in small groups under foliage. Not highly gregarious; prefers low disturbance areas .', NULL, '[{"lat":9.58247,"lng":125.472807},{"lat":9.343721,"lng":125.517455}]', 'Females typically birth one pup annually, synchronized in the Julyâ€“August season. King reproductive cycle lasts several months .', NULL, NULL, 'Serves as prey for nocturnal predators such as owls and snakes and supports cave-raised insects.', 'Include in forest biodiversity surveys, particularly around Maglinte and other forest fragments.', 'Preserve native figs and forested riparian buffers; minimize riparian disturbance.', 'Promote reforestation using native fruit trees and raise awareness about the ecological role of lesser-known endemic bats.', NULL, NULL, NULL);
